INSERT INTO `cms_masters` VALUES (1,'about-us','About Us','<div class=\"elementor-element elementor-element-d72c8c8 elementor-column elementor-col-50 elementor-top-column\">\r\n<div class=\"elementor-column-wrap  elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-ed0c567 elementor-position-left elementor-vertical-align-top elementor-widget elementor-widget-image-box\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image-box-wrapper\">\r\n<div class=\"elementor-image-box-content\">\r\n<h2>Our Mission</h2>\r\n\r\n<p>Our mission is to deliver quality education and guidance to each and every aspirant and also to ensure his or her success. Our simple, practical and focused approach will help aspirants to understand the demand of NTA NET exam effectively. Our strategy is to constantly innovate to keep the preparation process dynamic and give personalized attention to individual aspirants based on factors like core competence, availability of time and resources, and the requirements of NTA NET EXAM.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"elementor-element elementor-element-3c4b297 elementor-widget elementor-widget-text-editor\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p>We ensure to provide excellent education and boast of a number of faculty members who are totally devoted and committed so as to build trust and compassion between educators and aspirants.</p>\r\n\r\n<div class=\"elementor-element elementor-element-8d1e1f7 elementor-column elementor-col-50 elementor-top-column\">\r\n<div class=\"elementor-column-wrap  elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-8d5f2bb elementor-position-left elementor-vertical-align-top elementor-widget elementor-widget-image-box\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image-box-wrapper\">\r\n<div class=\"elementor-image-box-content\">\r\n<h2>Vision</h2>\r\n\r\n<p>&ldquo;The future belongs to those who believe in the beauty of their dreams.&rdquo; -Eleanor Roosevelt. Our vision is to create an educational set up with advanced interactive technologies and unique instructional methodologies that work towards the comprehensive development of aspirants by strengthening their brightest and young minds to achieve best in competitive arena.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"elementor-element elementor-element-5bf76cb elementor-widget elementor-widget-text-editor\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p>At &lsquo;teachinns&rsquo;, we nurture the aspirants to explore their full potential so as to boost their self-confidence and moral in order to realise their dreams by advanced teaching methodology. At &lsquo;teachinns&rsquo;, aspirants gain an understanding of the courses and get mentorship in achieving career directions while accessing the educational process as they become the next generation of professionals.</p>\r\n\r\n<div class=\"elementor-element elementor-element-bcd9e41 elementor-column elementor-col-50 elementor-top-column\">\r\n<div class=\"elementor-column-wrap  elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-5b4c86b elementor-position-left elementor-vertical-align-top elementor-widget elementor-widget-image-box\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image-box-wrapper\">\r\n<div class=\"elementor-image-box-content\">\r\n<h2>Our Uniqueness</h2>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"elementor-element elementor-element-929532e elementor-widget elementor-widget-text-editor\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<ul>\r\n	<li>Biggest online platform for proper guidance</li>\r\n	<li>Digital classroom with modern facilities</li>\r\n	<li>Video lecture on every topic</li>\r\n	<li>Innovative analysis and tracing out&nbsp;</li>\r\n	<li>Dedicated faculties to find out Achilles&rsquo; heel</li>\r\n	<li>Detail analysis of previous-years questions</li>\r\n	<li>Clear segregation&nbsp; of direct and conceptual question</li>\r\n	<li>Doubt clearing session</li>\r\n	<li>Regular assessment</li>\r\n	<li>Online and innovative mock test</li>\r\n	<li>Uniqueness in study material</li>\r\n	<li>Flexibility of instructional model</li>\r\n	<li>Quality based question bank</li>\r\n	<li>Proper evolution</li>\r\n</ul>\r\n\r\n<div class=\"elementor-element elementor-element-f00f8a7 elementor-column elementor-col-50 elementor-top-column\">\r\n<div class=\"elementor-column-wrap  elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-905fbbe elementor-position-left elementor-vertical-align-top elementor-widget elementor-widget-image-box\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image-box-wrapper\">\r\n<div class=\"elementor-image-box-content\">\r\n<h2>&nbsp;</h2>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Teachinns - India\'s Best Online Website for CSIR UGC NET/SET/JRF Study Material','About Us',NULL,'Welcome to India\'s best online website to get CSIR-UGC NET/SET/JRF study material, regular assessment, question paper analysis, and more at a modest price!',1,'2020-01-15 05:38:24','2020-03-11 16:33:14'),(2,'why-us','Why us','<p>We ensures quality education by&nbsp; perfectly blending and seamless integration of innovative technology with the traditional methods .This generation requires high-speed learning which can only be achieved through the modern techniques involving latest technology, coupled with the hard work under&nbsp; proper guidance. In this competitive area, one must chalk-out their strategy to build up a career in advance. An analytical approach and constant research on emerging trends is a must for definitive success, which is possible only at &lsquo;teachinns&rsquo;. For us, education is a mission. Our mission is to make quality education and guidance accessible globally with an ease to upgrade the knowledge-machine of the universe and to ignite the passion for education in the younger generation to redefine the term &lsquo;success.</p>\r\n\r\n<p>&nbsp;</p>','Why Us | Teachinns','Why us',NULL,'At Teachinns, we consistently try to bridge the gap between quality education and candidates who are aspiring to crack the coveted CSIR UGC NET/SET/JRF exam.',1,'2020-01-24 04:37:33','2020-09-11 17:42:27'),(3,'privacy-policy','Privacy Policy','<p><strong>PRIVACY POLICY</strong></p>\r\n\r\n<p><strong>1. INTRODUCTION</strong></p>\r\n\r\n<p>The following privacy policy is being published in accordance with the provisions of the Information Technology Act, 2000 <strong>(&quot;IT ACT&quot;)</strong>, Information Technology (Intermediary Guidelines) Rules, 2011, Information Technology (Reasonable Security Practices and Procedures and Sensitive Personal Data or Information) Rules, 2011.</p>\r\n\r\n<p>This Privacy Policy explains the policy of teachinns.com website and teachinns.com&rsquo;s mobile application - (hereinafter referred to as <strong>&quot;the App&quot;</strong>), with respect to the disclosure, collection, storage, usage and protection of your information during the course of your interaction with the Website and the App.</p>\r\n\r\n<p>Please read this Privacy Policy carefully and in conjunction with the Terms of Use before accepting our services. If you do not understand this policy or do not accept any part of it, then you should not use the Platform, as the case may be. Your use and/or continued use of the Platform, as the case may amount to express consent to the terms of this Privacy Policy as well as the Terms of Use.</p>\r\n\r\n<p>For the purposes of this Policy, accessing the Website and the App together with any study material made available or uploaded therein or downloaded, embedded therefrom shall collectively be referred to as the <strong>&quot;Services&quot;</strong>. The Website and the App shall be collectively referred to as <strong>&quot;the Platform&quot;</strong>.</p>\r\n\r\n<p>This Privacy Policy forms part and parcel of the Terms of Use for the teachinns.com services and shall be read as a whole. Capitalized terms used here, but undefined, shall have the same meaning as attributed to them in the Terms of Use.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2. INFORMATION COLLECTED FROM YOU</strong></p>\r\n\r\n<p>1) When you use the Platform by way of registration, login, purchase of study material and test series, attempting a mock test, etc. or by way of interaction via third party websites and/or mobile applications or by way of any other communication with the Platform, teachinns.com may collect your personally identifiable information including name, date of birth, gender, demographic information, photos, e-mail address, telephone number, mobile phone number, credit card or debit card details, geographic location, mailing address, social media account details including list of contacts/friends and examination preference.</p>\r\n\r\n<p>2) Teachinns.com will use this information to validate you as a user when using the Platform, to provide the Service to you, including administration of your user account, to notify you of changes to the Service or about any changes to our terms and conditions or this privacy policy, to manage its business, including financial reporting and billing of its Service, for the development of new products and services, to send you newsletters, offers and promotion coupons to market and advertise its products and services by email, to comply with applicable laws, court orders and government enforcement agency requests, for research and analytic purposes including to improve the quality of the Service and to ensure that the Service is presented in the most effective manner for you and your device.</p>\r\n\r\n<p>3) &nbsp;By registering on the Platform, you agree and confirm your consent to providing teachinns.com with your aforementioned personal information, which is lawful, necessary and permissible. You at all times have the right to discontinue the use of the Platform. Teachinns.com is not liable to provide you with its Services in the absence of or your refusal to provide the aforesaid information. Additionally, Teachinns.com is not liable to ensure or maintain the same quality of its Services to you, as it may for a user who provides all the aforementioned information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3. AUTOMATIC COLLECTION OF INFORMATION</strong></p>\r\n\r\n<p>When you visit or interact with the Platform, apart from teachinns.com certain third-party advertisers and/or service providers may use technologies that automatically collect information about you for both transactional (e.g., confirmation of registration, notification of purchase made, etc.) and promotional (e.g., promotions, newsletters, etc.) purposes. Your information may be collected by teachinns.com or such third party advertisers and/or service providers in the following ways:-</p>\r\n\r\n<p><strong>Log Files</strong>: Every time you visit the Platform, teachinns.com servers automatically receive and log information from your browser and device used to access the Platform (such as IP address, device ID, details of your network operator and type, your operating system, browser type, and version, CPU speed, and connection speed). This enables us to validate you as a User, to understand your usage of the Platform and helps us to make changes and updates most suited to your needs and interests.</p>\r\n\r\n<p><strong>Mobile Device</strong>: When you register your mobile device or use the mobile device to access the App, In addition to the aforesaid, teachinns.com will also collect device information such as mobile device ID, model, and manufacturer details, operating system, etc. for improving the App&rsquo;s overall functionality and displaying the content according to your preferences.</p>\r\n\r\n<p><strong>Cookies</strong>: Cookies are data files placed on your device, used to keep track of information such as your interaction with social media websites, the content you click on, download, upload or share and other activity on the Platform, etc. in order to improve your experience of the Platform by personalizing it to your preferences and usage trends.</p>\r\n\r\n<p><strong>Web Beacons</strong>: Web beacons are transparent graphic images used in our email communication to you, in order to understand customer behavior and improve the overall quality, functionality, and interactivity of the Platform.</p>\r\n\r\n<p><strong>Mobile Analytics</strong>: Mobile analytics software is used by teachinns.com to better understand and customize the functionality of the App&rsquo;s software on your phone. This is done by collecting information such as your frequency of the App&rsquo;s usage, the features you prefer to use on the App, where the App was downloaded from, Device Id, name of other mobile applications on your device, etc.</p>\r\n\r\n<p><strong>Payment /Purchase Information</strong>: In order to access certain paid features and services on the Platform, you may be required to create or log into a separate account on a payment gateway or website such as &ldquo;PayTM&rdquo;. Once such an account is created, in order to process your payments/ purchases on the Platform, such payment gateway provider may require and collect your details such as name, address, phone number, email address and credit or debit card information, net banking information or details of any web wallets maintained by you. Any/all payment(s) made/processed or details provided to or shared with such authorized payment gateway providers shall be stored directly by such payment gateway providers without any information passing through or relayed to teachinns.com.&nbsp; We assume no liability in respect of such payments and/or information shared with or provided to such authorized payment gateway providers. It is further clarified that the aforementioned information is only used in accordance with the provisions of the applicable law and in strict adherence to this Privacy Policy.</p>\r\n\r\n<p><strong>Public Forums</strong>: Any information that is disclosed by you in the comments section or by way of the &ldquo;create a post&rdquo; feature becomes published information and teachinns.com shall not be held liable for the security of the same or any personal information that you disclose herein. You agree to exercise caution when disclosing any personal information or personally identifiable information in this regard.</p>\r\n\r\n<p>Please note that we only use the aforesaid information to communicate with and/or improve the service and to better understand our users&#39; operating systems, for system administration and to audit the use of the service. We do not use any of the aforesaid data to identify the name, address or other personal details of any individual.</p>\r\n\r\n<p>For the purpose of this Privacy Policy, any passwords, financial information such as credit or debit card details or other payment instrument details and any additional information prescribed by law to be sensitive that may be collected by teachinns.com during your use of the platform and the services provided thereon, shall be referred to as &quot;Sensitive Personal Data or Information&quot;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4. SHARING OR DISCLOSURE OF COLLECTED</strong></p>\r\n\r\n<p><strong>INFORMATION </strong></p>\r\n\r\n<p>As a strict policy, we will not disclose, share or exploit your information with anyone without your express permission.</p>\r\n\r\n<p>However, we may be mandated under law or under contracts to make certain limited disclosures under the following circumstances:</p>\r\n\r\n<p><strong>Legal Necessity</strong>: Teachinns.com may share any of the aforesaid information, including your personally identifiable information or Sensitive Personal Data or Information, without obtaining a separate consent from you, if and when such information is requested or required by law or by any court or governmental agency or authority to disclose, for the purpose of verification of identity, or for the prevention, detection, investigation of any criminal activity, or for prosecution and punishment of offenses.</p>\r\n\r\n<p><strong>Limited Disclosure to Service Providers</strong>: We may disclose your information (but not Sensitive Personal Data or Information) to our service providers and business partners (&quot;Service Providers&quot;) for the purposes of betterment and improvement of our services including but not limited to hosting the Platform, payment processing, analyzing data, providing customer service, etc, for the purpose of making various features, services, and products of teachinns.com available to you and investigating or redressing grievances. This will be in the form of aggregated anonymized data and will be under strict contractual arrangements that preserve the confidentiality and security of your personal information in accordance with this Privacy Policy.</p>\r\n\r\n<p><strong>Limited Disclosures for improvement of services</strong>: Teachinns.com may share the aforesaid information including your personally identifiable information (but not Sensitive Personal Data or Information) when it is required to be shared with sponsors, partners, advertisers, analytics companies or third parties for the purpose of marketing, advertising promotional offers, offering product information and market research, in connection with the Service. This will be in the form of aggregated anonymized data and will be under strict contractual arrangements that preserve the confidentiality and security of your personal information in accordance with this Privacy Policy;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5. SECURITY OF INFORMATION COLLECTED</strong></p>\r\n\r\n<p>We take the security of your personal information seriously and use appropriate technical and organizational measures to protect your personal information against unauthorized or unlawful processing and against accidental loss, destruction or damage. Unfortunately, the transmission of information via the internet is not completely secure. Although we will do our best to protect your personal data, we cannot guarantee the security of your data which is transmitted to or from the Service. Any transmission is at your own risk.</p>\r\n\r\n<p>We keep your personal information for no longer than is necessary for our business purposes or for legal requirements.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>6. AMENDMENTS TO THE PRIVACY POLICY</strong></p>\r\n\r\n<p>Teachinns.com may amend the Privacy Policy posted on the Website from time to time at its sole discretion. Your continued access or use of the platform or services constitutes your acceptance of the amendments. Your access and use of the platform and Services will be subject to the most current version of the Terms of Use, rules, and guidelines posted on the Website at the time of such use. Please regularly check the link on the home page to view the most current Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>7. REACH US</strong></p>\r\n\r\n<p>If you have any doubts or concerns regarding the Privacy Policy, kindly contact at<u> contact@teachinns.com</u></p>\r\n\r\n<p>&nbsp;</p>','Privacy Policy | Teachinns','Privacy Policy','privacy-policy','At Teachinns, we have a robust privacy policy to protect your identity and your information with us.',1,'2020-02-19 00:49:43','2020-03-11 16:36:49'),(4,'terms-condition','Terms & Conditions','<p><strong>TERMS AND CONDITIONS</strong></p>\r\n\r\n<p><strong>I. Overview</strong></p>\r\n\r\n<p>This website, Teachinns.com and all sub-domains of Teachinns.com, hereinafter referenced as site or website, are operated by Teachinns.com. Throughout the site, the terms &ldquo;we&rdquo;, &ldquo;us&rdquo; and &ldquo;our&rdquo; refer to Teachinns.com. Teachinns.com offers this website, including all information, tools, and services available from this site to you, the user, conditioned upon your acceptance of all terms, conditions, policies, and notices stated here.</p>\r\n\r\n<p>By visiting our site and/ or purchasing something from us, you engage in our &ldquo;Service&rdquo; and agree to be bound by the following terms and conditions (&ldquo;Terms of Service&rdquo;, &ldquo;Terms&rdquo;), including those additional terms and conditions and policies referenced herein and/or available by hyperlink. These Terms of Service apply to all users of the site, including without limitation users who are browsers, vendors, customers, and/or contributors of content.</p>\r\n\r\n<p>Please read these Terms of Service carefully before accessing or using or purchasing from our website. By accessing or using any part of the site, you agree to be bound by these Terms of Service. If you do not agree to all the terms and conditions of this agreement, then you may not access the website or use any services. If these Terms of Service are considered an offer, acceptance is expressly limited to these Terms of Service.</p>\r\n\r\n<p>Any new features or tools which are added to the current website shall also be subject to the Terms of Service.</p>\r\n\r\n<p><strong>1. Website and Online Course Usage Terms</strong></p>\r\n\r\n<p>By agreeing to these Terms of Service, you represent that you are at least the age of majority in your state or province of residence, or that you are the age of majority in your state or province of residence.</p>\r\n\r\n<p>You may not use our products for any illegal or unauthorized purpose nor may you, in the use of the Service, violate any laws in your jurisdiction (including but not limited to copyright laws).</p>\r\n\r\n<p>You must not transmit any worms or viruses or any code of a destructive nature.</p>\r\n\r\n<p>A breach or violation of any of the Terms will result in an immediate termination of your Services.</p>\r\n\r\n<p><strong>2. General Conditions</strong></p>\r\n\r\n<p>We reserve the right to refuse service to anyone for any reason at any time.</p>\r\n\r\n<p>You understand that your content (not including credit card information), may be transferred unencrypted and involve (a) transmissions over various networks; and (b) changes to conform and adapt to technical requirements of connecting networks or devices. Credit card information is always encrypted during transfer over networks.</p>\r\n\r\n<p>You agree not to reproduce, duplicate, copy, sell, resell or exploit any portion of the Service, use of the Service, or access to the Service or any contact on the website through which the service is provided, without express wrote permission by us.</p>\r\n\r\n<p>The headings used in this agreement are included for convenience only and will not limit or otherwise affect these Terms.</p>\r\n\r\n<p><strong>3. Accuracy, Completeness, and Timeliness of Information</strong></p>\r\n\r\n<p>We are not responsible if information made available on this site is not accurate, complete or current. The material on this site is provided for general information only and should not be relied upon or used as the sole basis for making decisions without consulting primary, more accurate, more complete or more timely sources of information. Any reliance on the material on this site is at your own risk.</p>\r\n\r\n<p>This site may contain certain historical information. Historical information, necessarily, is not current and is provided for your reference only. We reserve the right to modify the contents of this site at any time, but we have no obligation to update any information on our site. You agree that it is your responsibility to monitor changes to our site.</p>\r\n\r\n<p><strong>4. Modifications to the Service and Prices</strong></p>\r\n\r\n<p>Prices for our courses, study material, online courses, and other products and services are subject to change without notice.</p>\r\n\r\n<p>We reserve the right at any time to modify or discontinue the Service (or any part or content thereof) without notice at any time.</p>\r\n\r\n<p>We shall not be liable to you or to any third-party for any modification, price change, suspension or discontinuance of the Service.</p>\r\n\r\n<p><strong>5. Products or Services</strong></p>\r\n\r\n<p>Certain products or services including our online courses and eBooks may be available exclusively online through the website.</p>\r\n\r\n<p>We reserve the right but are not obligated, to limit the sales of our products or Services to any person, geographic region or jurisdiction. We may exercise this right on a case-by-case basis. We reserve the right to limit the quantities of any products or services that we offer. All descriptions of products or product pricing are subject to change at any time without notice, at our sole discretion. We reserve the right to discontinue any product at any time. Any offer for any product or service made on this site is void where prohibited.</p>\r\n\r\n<p>We do not warrant that the quality of any products, services, information, or other material purchased or obtained by you will meet your expectations, or that any errors in the Service will be corrected.</p>\r\n\r\n<p><strong>6. Accuracy of Billing and Account Information</strong></p>\r\n\r\n<p>We reserve the right to refuse any order you place with us. We may, in our sole discretion, limit or cancel quantities purchased per person, per household or per order. These restrictions may include orders placed by or under the same customer account, the same credit card, and/or orders that use the same billing and/or shipping address. In the event that we make a change to or cancel an order, we may attempt to notify you by contacting the e-mail and/or billing address/phone number provided at the time the order was made. We reserve the right to limit or prohibit orders that, in our sole judgment, might meet certain criteria that we think might harm our business interests.</p>\r\n\r\n<p>You agree to provide current, complete and accurate purchase and account information for all purchases made at our site. You agree to promptly update your account and other information, including your email address and credit card numbers and expiration dates so that we can complete your transactions and contact you as needed.</p>\r\n\r\n<p><strong>7. Third-Party Links</strong></p>\r\n\r\n<p>Certain content, products, and services available via our Service may include materials from third-parties.</p>\r\n\r\n<p>Third-party links on this site may direct you to third-party websites that are not affiliated with us. We are not responsible for examining or evaluating the content or accuracy and we do not warrant and will not have any liability or responsibility for any third-party materials or websites, or for any other materials, products, or services of third-parties.</p>\r\n\r\n<p>We are not liable for any harm or damages related to the purchase or use of goods, services, resources, content, or any other transactions made in connection with any third-party websites. Please review carefully the third-party&#39;s policies and practices and make sure you understand them before you engage in any transaction. Complaints, claims, concerns, or questions regarding third-party products should be directed to the third-party.</p>\r\n\r\n<p><strong>8. User Comments, Feedback, and Other Submissions</strong></p>\r\n\r\n<p>If at our request, you send certain specific submissions (for example contest entries) or without a request from us you send creative ideas, suggestions, proposals, plans, or other materials, whether online, by email, by postal mail, or otherwise (collectively, &#39;comments&#39;), you agree that we may, at any time, without restriction, edit, copy, publish, distribute, translate and otherwise use in any medium any comments that you forward to us. We are and shall be under no obligation</p>\r\n\r\n<ol>\r\n	<li>to maintain any comments in confidence;</li>\r\n	<li>to pay compensation for any comments;</li>\r\n	<li>Or (3) to respond to any comments.</li>\r\n</ol>\r\n\r\n<p>We may, but have no obligation to, monitor, edit or remove content that we determine in our sole discretion are unlawful, offensive, threatening, libelous, defamatory, pornographic, obscene or otherwise objectionable or violates any party&rsquo;s intellectual property or these Terms of Service.</p>\r\n\r\n<p><strong>9. Personal Information</strong></p>\r\n\r\n<p>Your submission of personal information through the store is governed by our Privacy policy.</p>\r\n\r\n<p><strong>10. Errors, Inaccuracies, and Omissions</strong></p>\r\n\r\n<p>Occasionally there may be information on our site or in the Service that contains typographical errors, inaccuracies or omissions that may relate to courses descriptions, pricing, promotions, and offers. We reserve the right to correct any errors, inaccuracies or omissions, and to change or update information or cancel orders if any information in the Service or on any related website is inaccurate at any time without prior notice (including after you have submitted your order).</p>\r\n\r\n<p>We undertake no obligation to update, amend or clarify information in the Service or on any related website, including without limitation, pricing information, except as required by law. No specified update or refresh date applied in the Service or on any related website should be taken to indicate that all information in the Service or on any related website has been modified or updated.</p>\r\n\r\n<p><strong>11. Prohibited Uses</strong></p>\r\n\r\n<p>In addition to other prohibitions as set forth in the Terms of Service, you are prohibited from using the site or its content: (a) for any unlawful purpose; (b) to solicit others to perform or participate in any unlawful acts; (c) to violate any international, federal, provincial or state regulations, rules, laws, or local ordinances; (d) to infringe upon or violate our intellectual property rights or the intellectual property rights of others; (e) to harass, abuse, insult, harm, defame, slander, disparage, intimidate, or discriminate based on gender, sexual orientation, religion, ethnicity, race, age, national origin, or disability; (f) to submit false or misleading information; (g) to upload or transmit viruses or any other type of malicious code that will or may be used in any way that will affect the functionality or operation of the Service or of any related website, other websites, or the Internet; (h) to collect or track the personal information of others; (i) to spam, phish, &nbsp;pretext, spider, crawl, or scrape; (j) for any obscene or immoral purpose; or (k) to interfere with or circumvent the security features of the Service or any related website, other websites, or the Internet. We reserve the right to terminate your use of the Service or any related website for violating any of the prohibited uses.</p>\r\n\r\n<p><strong>12. Disclaimer of Warranties; Limitation of Liability</strong></p>\r\n\r\n<p>We do not guarantee, represent or warrant that your use of our service will be uninterrupted, timely, secure or error-free.</p>\r\n\r\n<p>We do not warrant that the results that may be obtained from the use of the service will be accurate or reliable.</p>\r\n\r\n<p>You agree that from time to time we may remove the service for indefinite periods of time or cancel the service at any time, without notice to you.</p>\r\n\r\n<p>You expressl