\n\r\n<p>For the purposes of this Policy, accessing the Website and the App together with any study material made available or uploaded therein or downloaded, embedded therefrom shall collectively be referred to as the <strong>&quot;Services&quot;</strong>. The Website and the App shall be collectively referred to as <strong>&quot;the Platform&quot;</strong>.</p>\r\n\r\n<p>The Teachinns&nbsp; website uses the following cookies:</p>\r\n\r\n<p><strong>Website Cookies</strong></p>\r\n\r\n<p>The cookie in connection with the date of your last visit is called a persistent cookie. It stores information about your last visit date to the website and is used with connection to statistics. This cookie is deleted as per browser settings.</p>\r\n\r\n<p><strong>Internet Advertising</strong></p>\r\n\r\n<p>On Google-owned, operated anf affiliated sites, we display interest-based advertising using information you make available to them when you interact with our/other websites, content or services.-</p>\r\n\r\n<p>Interest-based ads, popularly referred to as personalised or targeted ads, are displayed based on information relating to activities such as visiting a particular page on our site, etc.</p>\r\n\r\n<p>However, we do not associate your interaction with unaffiliated sites with your identity in providing you with interest-based ads.</p>\r\n\r\n<p>We do not provide any personal information to advertisers or to third party sites that display our interest-based ads. However, advertisers and other third-parties (including the ad networks, ad-serving companies, and other service providers they may use) may assume that users who interact with or click on a personalized ad or content are part of the group that the ad or content is directed towards.</p>\r\n\r\n<p>Also, legitimate GDPR compliant third-parties may provide us information about you (such as demographic information or sites where you have been shown ads) from offline and online sources that we may use to provide you more relevant and useful advertising.</p>\r\n\r\n<p><strong>Third Party Cookies</strong></p>\r\n\r\n<p>Third party advertising companies or advertisers working on their behalf sometimes use technology to display the advertisements that appear on our sites directly to your browser. This helps them recieve your IP automatically. The cookies may be used to measure the effectiveness of their advertisements and to customize the advertising content. We do not control over or access to cookies or other features that advertisers and third-party sites may use, and the information practices of third-party websites and the advertisers are not covered by our Privacy Notice or this Cookies &amp; Internet Advertising page. Please go through their privacy practices and cookie policy directly from their website as has been described below.</p>\r\n\r\n<p><strong>Google Analytics</strong></p>\r\n\r\n<p>Like most websites, this site too uses Google Analytics (GA) to track user interactions. This data is used to determine the number of people who are using our site, how they find it and to see their journey through our website by their web page views.</p>\r\n\r\n<p>Although GA records data such as your geographical location, device, internet browser and operating system, none of this information personally identifies you to us. GA also records your computer&rsquo;s IP address which could be used to personally identify you but Google do not grant us access to this.</p>\r\n\r\n<p>How GA makes use of cookies, can be found on Google&#39;s developer guides.</p>\r\n\r\n<p>Disabling cookies on your internet browser will stop GA from tracking any part of your visit to pages within this website.</p>\r\n\r\n<p><strong>Google Tag Manager</strong></p>\r\n\r\n<p>We use Google Tag Manager (GTM) to constantly improve the customer experience on our website. It helps to provide visitors with more personalized and targeted offerings and campaigns.</p>\r\n\r\n<p>GTM is a little snippet of code that helps us track user behaviour across our sites and then pushes the data to our Google Analytics account. Then, all the data is perfectly organized and ready for us to assess and review for potential site improvements and remarketing campaigns. Learn more about here Google Tag Manager.</p>\r\n\r\n<p><strong>Facebook Pixels Ads</strong></p>\r\n\r\n<p>To track user interaction, this website uses a very common third-party cookie , i.e.,Facebook Pixel (FP) . It helps to create Facebook Custom Audiences on Facebook based on mobile numbers and email addresses to deliver advertisements to website visitors. It also allows us to use this information to display advertisements from our customers to their target audience of users.</p>\r\n\r\n<p>We use this data to determine the number of people using this website, to better understand how they find and use our web pages and to see their journey through the website.</p>\r\n\r\n<p><strong>How can I avoid the use of cookies on the Website?</strong></p>\r\n\r\n<p>Irrespective of the browser you are using, you can change the browser settings to disable the storage of cookies. However, some browsers will allow you to do this change in the setting only for certain websites. Know how you can disable it <a href=\"javascript:void(0)\" onclick=\"deleteKSCookieAccept()\">here</a>.</p>\r\n\r\n<p><strong>How can I delete cookies?</strong></p>\r\n\r\n<p>Cookies can be deleted from your browser settings. You can find help either within the browser settings or on the browsers&#39; WebPages.</p>','Cookies Policy | Teachinns','Cookies Policy','cookies-policy','At Teachinns, we have a robust cookies policy to protect your identity and your information with us.',1,'2020-06-05 16:55:35','2020-06-05 17:19:03'),(30,'manipur','MANIPUR','<div class=\"elementor-widget-container\">\r\n<ul>\r\n	<li><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><a href=\"https://www.cau.ac.in/\" target=\"_blank\">Central Agricultural University(