INSERT INTO `email_templates` VALUES (1,'singup_email_verify','Teachinns Email Verify','<p>Congratulations !&nbsp;Your account has been created successfully.</p>\n\n<p>Your email is {{email}}.<br />\n<br />\nYour password is {{password}}.</p>\n\n<p>Please click <a href=\"{{link}}\">here</a> to activate your account.</p>\n\n<p>Thank you,</p>\n\n<p>Teachinns&nbsp;Team</p>',0,'2020-01-21 18:30:00','2020-01-21 18:30:00'),(2,'forgot_password','Your Password Reset Link','<p>Reseting your password is simple.</p>\n\n<p>Please click <a href=\"{{link}}\">here</a> to reset your password</p>\n\n<p>Thank you,</p>\n\n<p>Teachinns Team</p>',1,NULL,NULL),(3,'reset_password','Your Password has been changed Successfully.','<p>Your password has been changed successfully,</p>\n\n<p>your current password is :- {{password}}</p>\n\n<p>&nbsp;</p>\n\n<p>Thank you,</p>\n\n<p>Teachinns Team</p>',1,NULL,NULL),(4,'order-mail','New Order','<p><strong>Your order is confirmed.</strong></p>\r\n\r\n<p>Hi {{user_name}},</p>\r\n\r\n<p>We&#39;ve received order â„– {{order_id}} .</p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"table table-bordered table-striped\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Course</strong></td>\r\n			<td><strong>Total</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>{{product_name}} &times; 1</td>\r\n			<td>â‚¹{{amount}}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Discount:</td>\r\n			<td>- â‚¹{{discount_amount}}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Subtotal:</td>\r\n			<td>â‚¹{{subtotal}}</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Payment method:</td>\r\n			<td>{{payment_method}}</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Total:</strong></td>\r\n			<td><strong>â‚¹{{grand_total}}</strong></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you,</p>\r\n\r\n<p>Teachinns Team</p>',1,NULL,'2020-02-19 05:43:01'),(5,'admin-order-mail','New Order','<p><strong>Your order is confirmed.</strong></p>\r\n\r\n<p