INSERT INTO `mock_question_master` VALUES (26,'<p>Difference between acceptance and non-acceptance of certain stimuli in classroom communication is the basis of&hellip;.</p>','<p>Selective Attention is defined as &quot;the skill of identifying what is important to any situation and attending to what is necessary with appropriate focus.&quot; Effective teachers guide their students to identify what is most important in learning situations so that they can attend to necessary tasks with appropriate focus</p>','0',1,'2020-08-29 13:44:41','2020-08-29 13:45:43'),(27,'<p>The science of the study of feedback systems in humans, animals and machines is known&nbsp;&nbsp;as:</p>','<p>The word &ldquo;Cybernetics&rdquo; was first defined by Norbert Wiener, in his book from 1948 of that title, as the study of control and communication in the animal and the machine. Cybernetics includes the study of&nbsp;feedback,&nbsp;black boxes&nbsp;and derived concepts such as&nbsp;communication&nbsp;and control&nbsp;in&nbsp;living organisms,&nbsp;machines&nbsp;and&nbsp;organizations&nbsp;including&nbsp;self-organization.</p>','0',1,'2020-08-29 13:47:21','2020-08-29 13:48:06'),(28,'<p>Which is not correct in the latest award related to the communication sector?</p>','<p>The&nbsp;Dadasaheb Phalke Award&nbsp;is India&#39;s highest award in cinema. It is presented annually at the&nbsp;National Film Awards&nbsp;ceremony by the&nbsp;Directorate of Film Festivals, an organization set up by the&nbsp;Ministry of Information and Broadcasting. The recipient is honored for their &quot;outstanding contribution to the growth and development of Indian cinema and is selected by a committee consisting of eminent personalities from the Indian film industry. As of 2017, the award comprises a&nbsp;Swarna Kamal&nbsp;(Golden Lotus)&nbsp;medallion, a&nbsp;shawl, and a cash prize of&nbsp;?1,000,000.&nbsp;In 2018, Amitav Bachhan was awarded with this prize.</p>','0',1,'2020-08-29 13:48:53','2020-08-29 13:49:48'),(29,'<p>The criterion variable is the</p>','<p>Criterion variable&nbsp;is a name used to describe the dependent&nbsp;variable&nbsp;in a variety of statistical modeling contexts, including multiple regression, discriminant analysis, and canonical correlation. ... Similarly, predictor&nbsp;variables&nbsp;are often referred to using names such as independent&nbsp;variable, explanatory&nbsp;variable, and X.</p>','0',1,'2020-08-29 13:51:15','2020-08-29 13:52:07'),(33,'<p>Which of the following set of statements is correct for describing the human communication process?</p>\r\n\r\n<p>Choose the correct option:</p>','<p>Communication is not totally learnt ability. Some person can communicate very well naturally because this is their innate quality. To communicate well in the classroom, we need to have nice blending of our innate qualities with acquired qualities. So, statement B is false.</p>\r\n\r\n<p>There is no hard and fast rule that communication cannot break. So, statement D is also wrong.</p>','1',1,'2020-08-29 14:01:46','2020-08-29 14:03:39'),(34,'<p>&nbsp;</p>\r\n\r\n<p><strong>Assertion (A):</strong> To communicate well in the classroom is totally a natural ability.</p>\r\n\r\n<p><strong>Reason (R):</strong> Effective teaching in the classroom demands knowledge of the communication process.</p>\r\n\r\n<p>Choose the correct code:</p>','<p>To communicate well in the classroom is not totally a natural ability. Though the teacher training, different techniques have been taught to the would-be teachers, but it can help upto certain level. So, for conversing well in the classroom, teacher need to formulate his own strategy.</p>\r\n\r\n<p>Effective teaching in the classroom is not possible without proper knowledge of communication. It is essential because it helps teacher to reach to his students very smoothly and effectively.</p>\r\n\r\n<p>So, assertion is false but reason is true.</p>','0',1,'2020-08-29 14:04:13','2020-08-29 14:04:57'),(35,'<p>Qualitative research methods can be thought of as:</p>','<p>Qualitative research methods are designed in a manner that helps reveal the behavior and perception of a target audience with reference to a particular topic. This is a preliminary stage in the research that can contribute to the development of adequate quantification There are different types of qualitative research methods like an in-depth interview, focus groups, ethnographic research, content analysis, case study research that are usually used. The results of qualitative methods are more descriptive and the inferences can be drawn quite easily from the data that is obtained.</p>','0',1,'2020-08-29 14:06:53','2020-08-29 14:07:53'),(36,'<p>An appropriate source to find out descriptive information is</p>','<p>A bibliography is a list of all of the sources you have used (whether referenced or not) in the process of researching your work. In general, a bibliography should include:</p>\r\n\r\n<ul>\r\n	<li>the authors name</li>\r\n	<li>the titles of the works</li>\r\n	<li>the names and locations of the companies that published your copies of the sources.</li>\r\n	<li>the dates your copies were published.</li>\r\n	<li>the page numbers of your sources (if they are part of multi-source volumes)</li>\r\n</ul>','0',1,'2020-08-29 14:09:29','2020-08-29 14:10:28'),(37,'<p>------------ is a preferred sampling method for the population with infinite size.</p>','<p>Systematic sampling is a type of probability&nbsp;sampling&nbsp;method in which sample members from a larger population (infinite) are selected according to a random starting point but with a fixed, periodic interval. This interval, called the sampling interval, is calculated by dividing the population size by the desired sample size.</p>','0',1,'2020-08-29 14:12:29','2020-08-29 14:13:18'),(38,'<p>A satisfactory statistical quantitative method should not possess one of the following qualities:</p>','<p>The statistical quantitative approach is especially useful for addressing specific questions about relatively well-defined phenomena.&nbsp; Quantitative analysis requires high-quality data in which variables are measured well (meaning the values of the variables must accurately represent differences in the characteristics of interest); this can be challenging when conducting research on complicated or understudied areas that do not lend themselves well to being measured with specific variables.&nbsp; Because it uses deductive logic and is, therefore, more easily viewed as &ldquo;real science,&rdquo; the quantitative approach is often perceived as providing stronger empirical evidence than other research approaches. This method should not possess any flexibility.</p>','0',1,'2020-08-29 14:13:54','2020-08-29 14:14:40'),(39,'<p>Consider the following statement regarding New Education Policy 2020.</p>\r\n\r\n<p>Choose the correct statement from the above statements.</p>','<p>A new education policy usually comes along every few decades. India had three NEP till the date. The first came in 1968 and the second came in 1986 during Rajiv Gandhi and third one has come in 2020.</p>\r\n\r\n<p>The NEP 2020 has been headed by K. Kasturirangan, the former chairman of ISRO.</p>\r\n\r\n<p>Education has been placed in concurrent list by the constitution of India. As a result of it, both the state and central govt. can formulate and change policy related to education at its will.</p>','1',1,'2020-08-29 14:16:38','2020-08-29 14:18:26'),(40,'<p>The Great Green Wall Initiative sometimes seen in the news aims to restore degraded land in:</p>','<p>The Great Green Wall is the symbol of hope in the face of one of the biggest challenges of desertification. Launched by 2007 by African Union, the game changing Africa-led initiative aims to restore African degraded landscape and transform millions of lives in one of the world&rsquo;s poorest regions, the Sahel. The Great Green Wall is now being implemented in more than 20 countries.</p>\r\n\r\n<p>India is also mulling an ambitious plan to create green wall on the north-western part of India. It will be 1400 km long and 5 km wide green belt from Gujrat to Delhi-Haryana border.</p>','0',1,'2020-08-29 14:18:48','2020-08-29 14:19:32'),(41,'<p>Consider the following statement regarding the Urban Heat Island (UHI).</p>\r\n\r\n<p>Choose the correct code:</p>','<p>UHI is significantly warmer than its surrounding rural areas due to human activities. The temperature difference is larger at night rather than daytime and most apparent when the wind is weak. UHI is most noticeable during summer and winter. The UHI decreases air quality by increasing the production of pollutants such as Ozone and the decreased water quality, is true.</p>','1',1,'2020-08-29 14:21:07','2020-08-29 14:23:20'),(42,'<p>Which of the following are the contributors to nitrogen emission in India?</p>\r\n\r\n<p>Select the correct answer code:</p>','<p>Nitrogen particles make up the largest fraction of PM 2.5, the class of pollutants closely linked to cardiovascular and respiratory illness. All the above-mentioned sources are the contributors to nitrogen emission in India.</p>','1',1,'2020-08-29 14:23:53','2020-08-29 14:25:15'),(43,'<p>Consider the following statements</p>\r\n\r\n<p>Select the correct answer code:</p>','<p>The chlorine compounds originating from chlorofluorocarbons (CFC, e.g. greenhouse gases and refrigerants) and other pollutants are converted chemically at temperatures below -78&deg;C. These chemical conversion products attack the ozone layer and destroy it partly. One of the main statements in the study: If the trend to colder temperatures in the stratosphere observed in the past decades will continue, repeated occurrence of an Arctic ozone hole has to be expected.</p>','1',1,'2020-08-29 14:25:45','2020-08-29 14:27:40'),(44,'<p>Nation Institute Ranking Framework has been launched by?</p>','<p>This framework outlines a methodology to rank institutions across the country. It was initiated in 2015 by MHRD (Ministry of Human resource and development). First ranking was released in 2016. In 2020, IIT Madras is the top institution in government ranking.</p>','0',1,'2020-08-29 14:32:24','2020-08-29 14:33:14'),(45,'<p>Who is called the father of English education in India?</p>','<p>On 2 February 1835, British historian and politician Thomas Babington Macaulay presented his &lsquo;Minute on Indian Education&rsquo; that sought to establish the need to impart English education to Indian &lsquo;natives&rsquo;. He is called the father of English education in India.</p>','0',1,'2020-08-29 14:33:43','2020-08-29 14:34:30'),(46,'<p>The concept of totalitarian education in the West was in favour of</p>','<p>As the word suggests, totalitarian systems claim to have uncovered absolute and universal laws that provide a &ldquo;total&rdquo; explanation of all history. Totalitarian rule, far from being lawless or arbitrary, appeals to suprahuman laws.&nbsp;Totalitarian movements are different from mere revolutionary movements, in that what they aim at is &ldquo;not the.&nbsp;.&nbsp;. transmutation of society, but the transformation of human nature itself.&rdquo; The aim of the totalitarian education is to make the students as an instrument for realizing the end of the state.</p>','0',1,'2020-08-29 14:34:55','2020-08-29 14:35:40'),(47,'<p>A review of NPE- 1986 Programme of Action was done by?</p>','<p>The implementation of the National Policy on Education 1986 was evaluated by two committees namely the Ramamurti Committee (1990) and the Janardhana Reddy Committee (1992). As a result of the recommendations of these two committees, slight modifications were made in the NPE in 1992.</p>','0',1,'2020-08-29 14:36:15','2020-08-29 14:37:05'),(48,'<p>Which article of the constitution says, &ldquo;The State shall endeavour to provide, within a period of ten years from the commencement of this Constitution, for free and compulsory education for all children until they complete the age of fourteen years.&rdquo;</p>','<p><strong>Article 45</strong>&ndash; Provision for free and compulsory education for children The State shall endeavour to provide, within a period of ten years from the commencement of this Constitution, for free and compulsory education for all children until they complete the age of fourteen years.</p>','0',1,'2020-08-29 14:37:27','2020-08-29 14:38:14'),(49,'<p>The concept of pragmatism in educational philosophy says that education should be about-</p>','<p>Pragmatism&nbsp;is an&nbsp;educational&nbsp;philosophy that says that&nbsp;education&nbsp;should be about life and growth. Two important elements of&nbsp;pragmatism&nbsp;include practical learning, which focuses on the real-world applications of lessons, and experiential learning, which involves learning through experience, not through simple ideas.</p>','0',1,'2020-08-29 14:38:58','2020-08-29 14:39:41'),(50,'<p>The theory that the effect is already implicit in the cause, is known as-</p>','<p>Satkaryavada&nbsp;is the Samkhya theory of the pre-existent effect, which states that the effect (Karya) already exists in its material cause, which is (Sat), and therefore nothing new is brought into existence. This theory uses two basic concepts. Sat &ndash; pure being or existence.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-08-29 14:40:02','2020-08-29 14:40:42'),(51,'<p>Arrange the following activities of instruction in a logical order</p>\r\n\r\n<p>Choose the correct code:</p>','<p>Instructional Activities&nbsp;are small, routine segments of&nbsp;instruction&nbsp;that specify how the teacher and students will participate and how they will interact with materials and content. The chronological order of the instruction activities is (1) planning and preparation (2) presentation of material (3) analysis of the work done (4) modification and improvement.</p>\r\n\r\n<p>&nbsp;</p>','1',1,'2020-08-29 14:41:23','2020-08-29 14:42:21'),(52,'<p>Union HRD Minister has launched World&rsquo;s first-ever online B.Sc degree in Programming and Data Science. The course has been designed by-</p>','<p>IIT Madras has introduced&nbsp;world&#39;s first-ever&nbsp;online BSc degree&nbsp;programme in&nbsp;Data Science&nbsp;and Programming. The Indian Institute of Technology (IIT) Madras said that it has launched the &ldquo;world&#39;s first&rdquo;&nbsp;online BSc degree&nbsp;course in Programming and&nbsp;Data Science.</p>','0',1,'2020-08-29 14:42:50','2020-08-29 14:44:21'),(53,'<p>In which of the following method, the learner&rsquo;s participation is optimal and proactive?</p>','<p>Students in a project method environment are allowed to explore and experience their environment through their senses and, in a sense, direct their own learning by their individual interests. Very little is taught from textbooks and the emphasis is on experiential learning, rather than rote and memorization. A project method classroom focuses on democracy and collaboration to solve &quot;purposeful&quot; problems. So, in the project method, learner&rsquo;s participation is optimal and proactive.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-08-29 14:44:43','2020-08-29 14:45:29'),(54,'<p>Empirical Research is characterized by-</p>','<p>Empirical research&nbsp;is&nbsp;research&nbsp;that is based on observation and measurement of phenomena, as directly experienced by the researcher. The data thus gathered may be compared against a theory or hypothesis, but the results are still based on real life experience.</p>','0',1,'2020-08-29 14:45:52','2020-08-29 14:46:35'),(55,'<p>Which of the following is not an air pollutant?</p>','<p>By volume, dry air contains 78.09%&nbsp;nitrogen, 20.95% oxygen, 0.93% argon, 0.04% carbon dioxide, and small amounts of other gases. Air also contains a variable amount of water vapor, on average around 1% at sea level, and 0.4% over the entire&nbsp;atmosphere. Nitrogen is not an air pollutant.</p>','0',1,'2020-08-29 14:47:40','2020-08-29 14:48:27'),(56,'<p>Which of the following Schemes of Government of India comes under the Clean Development Mechanism (CDM) of the Kyoto Protocol?</p>','<p><strong>&ldquo;Bachat Lamp Yojana&rdquo;</strong> seeks to utilize the Clean Development Mechanism (CDM) of the Kyoto Protocol to bring-down the price of CFLs. This public-private partnership between the Government of India, Private sector CFL Manufactures /Traders (Project Developers) and State level Electricity Distribution Companies would provide the framework to distribute high quality CFLs at about Rs.15 per piece to the households of the country. Under the scheme only 60 Watt and 100-Watt incandescent Lamps have to be replaced with 11to15 Watt and 20 -25 Watt CFLs respectively.</p>','0',1,'2020-08-29 14:50:58','2020-08-29 14:51:41'),(57,'<p>Which of the following does not belong to the group?</p>','<p>All other three are operating system while firewall is security system. In computing, a firewall is a network security system that monitors and controls incoming and outgoing network traffic based on predetermined security rules. A firewall typically establishes a barrier between a trusted network and an untrusted network, such as the Internet.</p>','0',1,'2020-08-29 14:52:09','2020-08-29 14:52:54'),(58,'<p>------ is the process of finding errors in software code?</p>','<p>Debugging&nbsp;is the routine process of locating and removing&nbsp;computer&nbsp;program bugs, errors or abnormalities, which is methodically handled by software programmers via&nbsp;debugging&nbsp;tools.</p>\r\n\r\n<p>Debugging&nbsp;checks, detects and corrects errors or bugs to allow proper program operation according to set specifications.</p>','0',1,'2020-08-29 14:53:56','2020-08-29 14:54:51'),(59,'<p>The Uniform Resource Locator (URL) is case sensitive in the</p>','<p>A&nbsp;Uniform Resource Locator&nbsp;(URL) is a URI that specifies the means of acting upon or obtaining the representation of a resource, i.e. specifying both its primary access mechanism and network location. The most common form of Uniform Resource Locator (URL), frequently referred to informally as a&nbsp;web address. URL is case sensitive in the directory.</p>','0',1,'2020-08-29 14:55:14','2020-08-29 14:58:32'),(60,'<p>A peer-to-peer LAN is an appropriate network</p>',NULL,'0',1,'2020-08-29 14:58:56','2020-08-29 14:58:56'),(61,'<p>A peer-to-peer LAN is an appropriate network</p>','<p>A&nbsp;home network&nbsp;or&nbsp;home area network&nbsp;(HAN) is a type of&nbsp;computer network&nbsp;that facilitates communication among devices within the close vicinity of a&nbsp;home. Devices capable of participating in this network, for example,&nbsp;smart devices&nbsp;such as network printers and handheld mobile computers, often gain enhanced&nbsp;emergent&nbsp;capabilities through their ability to interact.&nbsp;A peer-to-peer LAN is an appropriate in Home Network.</p>','0',1,'2020-08-29 15:00:34','2020-08-29 15:01:13'),(62,'<p>What is the unit used to count the speed of a printer?</p>','<p>In olden days, we had Line printer which prints one line of text at a time. speed of&nbsp;line/impact printer&nbsp;is measured in unit&nbsp;&ldquo;Lines per minute&rdquo; (LPM). Although they have been replaced in most instances by high-speed laser printer, they are still used in some business as they are low cost and have the ability to print on multi-part forms in one go. Today&#39;s modern digital printers (laser and inkjet) are measured in&nbsp;&ldquo;pages per minute&rdquo; (PPM).&nbsp;high-speed newspaper printers (offset and gravure) where they use continue form of paper reel are measured in&nbsp;&ldquo;Feet per minute&rdquo; (FPM).</p>','0',1,'2020-08-29 15:01:34','2020-08-29 15:02:19'),(63,'<p>Ravi travels 12 km to the north, then turns left and travels 6 km, and again turns right and then covers another 4 km and then turns right and travels another 6 km. How far he is right now from the starting point?</p>','<p><img alt=\"\" src=\"https://teachinns.com/storage/uploads/banner/Capture.JPG\" style=\"height:324px; width:496px\" /></p>','0',1,'2020-08-29 15:02:50','2020-08-29 15:05:24'),(64,'<p>Look at the series: 8, 6, 9, 23, 87, &hellip;&hellip; What number should come next?</p>','<p>8 &times; 1 - 2 = 6</p>\r\n\r\n<p>6 &times; 2 &ndash; 3 = 9</p>\r\n\r\n<p>9 &times; 3 &ndash; 4 = 23</p>\r\n\r\n<p>23 &times; 4 &ndash; 5 = 87</p>\r\n\r\n<p>87 &times; 5 &ndash; 6 = 429</p>','0',1,'2020-08-29 15:06:00','2020-08-29 15:06:52'),(65,'<p>In a school, 40% of the students play football and 50% of the students play cricket. If 18% of the students play neither cricket nor football, then calculate&nbsp;&nbsp; percentage of the students playing both:</p>','<p>Given 18% students neither play football nor cricket. That means (100-18) = 82% play either football or cricket.</p>\r\n\r\n<p>Given 40% play football and 50% play cricket.</p>\r\n\r\n<p>So, students playing both cricket and football are [(40 +50) -82] = (90-82) = 8%</p>','0',1,'2020-08-29 15:07:15','2020-08-29 15:12:38'),(66,'<p>In certain code AUSTRALIA is written as TSUARAILA, how the word ANTARTICA can be written</p>','<p>First four letters are rearranged in the reverse order (AUST as TSUA) and fifth letter is fixed (R as R) and last four letters are rearranged in reverse (ALIA as AILA).</p>\r\n\r\n<p>Similarly, in the case of ANTARTICA is written as ATNARACIT.</p>','0',1,'2020-08-29 15:13:02','2020-08-29 15:13:43'),(67,'<p>Which of the following terms shows the relationship between two propositions having the same subject, but different both in quality and quantity?</p>','<p>Contrary opposition is the term which shows the relationship between two opposite having same subject, but different in quality and quantity.</p>','0',1,'2020-08-29 15:14:03','2020-08-29 15:14:47'),(68,'<p><strong>Statements:</strong> All bags are cakes. All lamps are cakes.</p>\r\n\r\n<p><strong>Conclusion:</strong> (I) Some lamps are bags.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; (II) No lamp is a bag.</p>','<p>Since the middle term &#39;cakes&#39; is not distributed even once in the premises, no definite conclusion follows. However, I and II involve only the extreme terms and form a complementary pair. So, either I or II follows.</p>','0',1,'2020-08-29 15:15:23','2020-08-29 15:16:03'),(69,'<p>--------------- is an organism used to gauge the quality of an ecosystem?</p>','<p>Bioindicators&nbsp;are living organisms such as plants, planktons, animals, and microbes, which are utilized to screen the health of the natural ecosystem in the environment. They are used for assessing environmental health and biogeographic changes taking place in the environment.</p>','0',1,'2020-08-29 15:16:22','2020-08-29 15:17:00'),(70,'<p>Which of the following is strongly presumptive fault line scarps?</p>','<p>Insequent&nbsp;streams have almost random drainage often forming dendritic patterns. These are typical tributaries and have developed by a headward erosion on a horizontally stratified belt or on homogeneous rocks. These streams follow courses that apparently were not controlled by the original slope of the surface, its structure, or the type of rock.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-08-29 15:31:14','2020-08-29 15:32:37'),(71,'<p>Which of the following is formed due to tectonic forces?</p>','<p>A rift valley is a linear-shaped lowland between several highlands or mountain ranges created by the action of a geologic rift or fault. A rift valley is formed on a divergent plate boundary, a crustal extension or spreading apart of the surface, which is subsequently further deepened by the forces of erosion. Very frequently Sevier earthquake is happened by this process.</p>','0',1,'2020-08-29 15:32:59','2020-08-29 15:34:08'),(72,'<p>Which of the following is strongly presumptive of fault line scrap ?</p>','<p>Insequent&nbsp;streams have an almost random drainage often forming dendritic patterns. These are typically tributaries and have developed by a headward erosion on a horizontally stratified belt or on homogeneous rocks. These streams follow courses that apparently were not controlled by the original slope of the surface, its structure or the type of rock.</p>','0',1,'2020-08-29 15:34:38','2020-08-29 15:35:51'),(73,'<p>Given below are two statements, one labelled as <strong>Assertion (A)</strong> and other labelled as <strong>Reason (R).</strong> Select your answer from the codes given below :</p>\r\n\r\n<p><strong>Assertion (A) :</strong> The islands along the Mid-Atlantic Ridge are highly prone to volcanic activity</p>\r\n\r\n<p><strong>Reason (R) :</strong> The sea-floor spreading is the main cause of earthquakes in the Atlantic Ocean</p>\r\n\r\n<p><strong>Codes :</strong></p>','<p>In 1960, Professor Herry Hess and Robert W. Ditz introduce the concept. Seafloor spreading is a process that occurs at mid-ocean ridges, where new oceanic crust is formed through volcanic activity and then gradually moves away from the ridge.Constructive plate boundaries- Mid-oceanic ridge of Atlantic Ocean.</p>','0',1,'2020-08-29 15:36:21','2020-08-29 15:37:03'),(74,'<p>Given below are two statements, one labelled as <strong>Assertion (A)</strong> and other labelled as <strong>Reason (R).</strong> Select your answer from the codes given below :</p>\r\n\r\n<p><strong>Assertion (A) :</strong>&nbsp;&nbsp; Divergent plate margin cause sea floor spreading</p>\r\n\r\n<p><strong>Reason (R)&nbsp;&nbsp; :</strong>&nbsp;&nbsp; Construction plate margins result in the formation of faults</p>\r\n\r\n<p><strong>Codes :</strong></p>','<p>Destructive plate boundaries &ndash; Himalaya.Constructive plate boundaries- Mid-oceanic ridge of Atlantic Ocean</p>\r\n\r\n<p>Subduction: it is a geological process that takes place at destructive plate boundary.</p>','0',1,'2020-08-29 15:37:25','2020-08-29 15:38:07'),(75,'<p>The landscapes produced by a single dominant geomorphic process called as</p>','<p>William Morris Davis was an American Geomorphologist. In geology and geomorphology a base level is the lower limit for an erosion process. The modern term was introduced by John Wesley Powell in 1875. The term was subsequently appropriated by William Morris Davis who used it in his cycle of erosion theory.</p>\r\n\r\n<p>1)There is vertical upliftment of landmass. 2) There is rapid rate of upliftment of landmass. 3) During upliftment no erosion will be started. 4) Streams erode their valley rapidly downward until the graded condition is achieved.</p>','0',1,'2020-08-29 15:38:26','2020-08-29 15:40:22'),(76,'<p>Paternoster lakes are features typical of :</p>','<p>Paternoster lakes&nbsp;occur in alpine valleys, climbing one after the other to the valley&#39;s head, called a corrie, which often contains a cirque&nbsp;lake.&nbsp;Paternoster lakes&nbsp;are created by recessional moraines, or rock dams, that are formed by the advance and subsequent upstream retreat and melting of the ice</p>','0',1,'2020-08-29 15:40:44','2020-08-29 15:41:25'),(77,'<p>Which one of the following process typical to glacial erosion ?</p>','<p>There are three main types of&nbsp;glacial erosion&nbsp;- plucking, abrasion and freeze thaw. Plucking is when melt water from a&nbsp;glacier&nbsp;freezes around lumps of cracked and broken rock. When the ice moves downhill, rock is plucked from the back wall</p>','0',1,'2020-08-29 15:41:49','2020-08-29 15:42:30'),(78,'<p>The most fundamental principle of Earth Science &ldquo;Uniformitarianism&rdquo; for the first time presented in the book entitled</p>','<p>The same physical processes and laws that operate today operated throughout geologic time, although not necessarily with the same intensity as now (in 1785 Hutton&#39;s write principle of uniformitarianism in his book &ldquo;Theory of the Earth&rdquo;. In 1802, Play Fair believes &ldquo;Present is the key to past&rdquo;)</p>','0',1,'2020-08-29 15:42:53','2020-08-29 15:43:32'),(79,'<p>Which of the following phrased the concept &ldquo;Landscape is function of process, structure and stage&rdquo; ?</p>','<p><strong>According to Davis &ldquo;Landscape is the function of structure, process and time&rdquo;.&nbsp; These three factors are also called &ldquo;Trio of Davis&rdquo;.</strong></p>','0',1,'2020-08-29 15:44:11','2020-08-29 15:44:51'),(80,'<p>Hydration process belongs to</p>','<p>The process of deformation of rocks by atmospheric agents (temperature, Rainfall, humidity, chemical reaction etc.) is called Weathering.Physical weathering depends upon temperature, pressure etc.Chemical weathering depends upon low temperature, rainfall, humidity etc.</p>','0',1,'2020-08-29 15:45:14','2020-08-29 15:45:52'),(81,'<p>Who postulated the concept of Base level?</p>','<p>William Morris Davis was an American Geomorphologist. In geology and geomorphology a base level is the lower limit for an erosion process. The modern term was introduced by John Wesley Powell in 1875.</p>','0',1,'2020-08-29 15:46:13','2020-08-29 15:47:07'),(82,'<p>Ria is an example of:</p>','<p>A ria is a coastal inlet formed by the partial submergence of an unglaciated river valley. It is a drowned river valley that remains open to the sea.</p>','0',1,'2020-08-29 15:47:28','2020-08-29 15:48:12'),(83,'<p>Who wrote the book &ldquo;Illustration of the Huttonian Theory of the earth&rdquo;?</p>','<p>The same physical processes and laws that operate today operated throughout geologic time, although not necessarily with the same intensity as now (in 1785 Hutton&#39;s write principle of uniformitarianism in his book &ldquo;Theory of the Earth&rdquo;. In 1802, Play Fair believes &ldquo;Present is the key to past&rdquo;)</p>','0',1,'2020-08-29 15:48:34','2020-08-29 15:49:11'),(84,'<p>Which one of the following is unrelated to the denudational action of mass movement?</p>','<p>Mass wasting, also known as slope movement or mass movement, is the geomorphic process by which soil, sand, regolith, and rock move down slope typically as a solid, continuous or discontinuous mass, largely under the force of gravity, frequently with characteristics of a flow as in debris flows and mudflows.</p>','0',1,'2020-08-29 15:49:30','2020-08-29 15:50:04'),(85,'<p>Negative movements of baselevel produce:</p>','<p>W.M. Davis, Old stage: This stage is characterised by almost total absence of downward erosion but lateral erosion is still active. Thus height of water divide decreases rapidly. The entire valley became almost flat with concave valley side slopes. This type of landscape is called as peneplain. Sometimes hard rocks are stand over the peneplain, which resistant to erosion, known as Monadnocks.After end of old stage rejuvenation may require to start youth stage again.</p>','0',1,'2020-08-29 15:50:23','2020-08-29 15:51:03'),(86,'<p>Which one of the following features is formed when the roof of a limestone cavern collapses?</p>','<p>In 1918, Cvijic propound karst cycle of erosion. The cycle of erosion in karst regions has three phases. At first the upper parts of fractures are dissolved, enlarged and filled with water. Normal fluvial valleys develop on the surface, small poljes might exist. Subsequently, re-routing of water by the growth of a karst system disorganizes the fluvial drainage pattern, with valley bottoms developing large dolines and uvalas.</p>','0',1,'2020-08-29 15:51:40','2020-08-29 15:52:11'),(87,'<p>Normal Cycle of Erosion is associated with</p>','<p>W. M. Davis considered humid temperate areas as the most&nbsp;normal&nbsp;case for fluvial&nbsp;cycle of erosion&nbsp;but this claim is debatable. The&nbsp;normal cycle of erosion&nbsp;begins with the upliftment of any landmass with reference to sea level. As the land rises, the rivers are originated and their erosional work starts.</p>','0',1,'2020-08-29 15:52:29','2020-08-29 15:53:02'),(88,'<p>Crickmay while disagreeing with Davis supplemented peneplain with the terms</p>','<p>Crickmay has also been a bitter critic of Davis&rsquo; concept of peneplanation. He firmly believes that plantation by lateral erosion which begins in the stage of maturity of a river, and which continues long after valley deepening has stopped, must play a significant part in the late stages of the cycle of erosion.</p>','0',1,'2020-08-29 15:53:26','2020-08-29 15:54:01'),(89,'<p>Which of the following groups of scholars stressed the role of lateral planation by stream in the formation of pediments ?</p>','<p>The role of lateral planation by stream in the formation of pediments:</p>\r\n\r\n<p>Mc Gee, Paige, Johnson etc.</p>','0',1,'2020-08-29 15:54:22','2020-08-29 15:54:58'),(90,'<p>The fall in temperature in troposphere is known as:</p>','<p>the troposphere is bounded above by the tropopause, Here the normal lapse(temperature in Earth&#39;s atmosphere falls with altitude) rate -6.4 &deg;C/Kms.</p>','0',1,'2020-08-29 15:55:16','2020-08-29 15:55:53'),(91,'<p>At which of the following altitudinal ranges ozone is found in concentrated form ?</p>','<p><strong>Stratosphere:</strong></p>\r\n\r\n<p>The stratosphere extends from the top of the troposphere to about 50 km (31 miles i.e. Stratopause) above the ground. The infamous ozone layer is found within the stratosphere. The altitudinal range of the layer is 15 to 35 kilometers.</p>','0',1,'2020-08-29 17:08:37','2020-08-29 17:09:11'),(92,'<p>Which one of the locations listed below should have highest annual temperature range ?</p>','<p>The desert areas of Rajasthan have the highest range of temperature, and this includes the districts of Jaisalmer and Jodhpur. Siachen glacier and the region of Kashmir has the lowest range of temperatures. This is because Rajasthan has a desert climate without much rainfall in it while Kashmir has mountainous topography with huge mountains and so due to being in a higher altitude, it is cold.</p>','0',1,'2020-08-29 17:09:32','2020-08-29 17:10:23'),(93,'<p>Which one of the following is not a factor that affects wind ?</p>','<p><strong>a. Low- and high-pressure zones:</strong></p>\r\n\r\n<p>In the Northern Hemisphere, if a person stands with his back to the wind, the atmospheric pressure is low to the left, high to the right. This is because wind travels counterclockwise around low-pressure zones in the Northern Hemisphere.</p>\r\n\r\n<p>It is approximately true in the higher latitudes of the Northern Hemisphere and is reversed in the Southern Hemisphere, but the angle between the pressure gradient force and wind is not a right angle in low latitudes.</p>\r\n\r\n<p><strong>b. Pressure Gradient Force:</strong></p>\r\n\r\n<p>Pressure Gradient Force is created due to the difference in the atmospheric pressure, and it is directed from the high pressure to the low pressure.</p>\r\n\r\n<p><strong>c. The Coriolis effect :</strong></p>\r\n\r\n<p>All winds move towards their right in the northern hemisphere and towards their left in the southern hemisphere with respect to the rotating earth. Thus, in the northern hemisphere winds blow counter-clockwise along the centers of low pressure while clockwise in the southern hemisphere.</p>\r\n\r\n<p><strong>d.&nbsp;</strong>But magnetism is not a factor that affects wind.</p>','0',1,'2020-08-29 17:11:02','2020-08-29 17:12:19'),(94,'<p>What is the major wind related phenomenon responsible for summer drought in Mediterranean type of region ?</p>','<p>The Polar easterlies are dry, cold prevailing winds blowing from north-east to south-west direction in Northern Hemisphere and south-east to north-west in Southern Hemisphere. They blow from the polar high-pressure areas of the sub-polar lows.</p>\r\n\r\n<p>The main&nbsp;cause of Mediterranean, or dry&nbsp;summer&nbsp;climate, is the subtropical ridge which</p>\r\n\r\n<p>extends northwards during the&nbsp;summer&nbsp;and migrates south during the winter due to increasing</p>\r\n\r\n<p>north-south temperature differences.</p>','0',1,'2020-08-29 17:12:47','2020-08-29 17:13:25'),(95,'<p>When water evaporates the energy that was used to evaporate the water :</p>','<p>The heat required to convert a solid into a liquid or vapour, or a liquid into a vapour, without change of temperature.</p>\r\n\r\n<p>Sublimation&nbsp;is the transition of a substance directly from the solid to the gas phase, without passing through the intermediate liquid phase.</p>','0',1,'2020-08-29 17:13:45','2020-08-29 17:14:25'),(96,'<p>Coastal area greatly affected by storm surge is :</p>','<p>The two main&nbsp;meteorological&nbsp;factors contributing to a storm surge are a long&nbsp;fetch&nbsp;of winds spiraling inward toward the storm, and a low-pressure-induced dome of water drawn up under and trailing the storm&#39;s center.</p>\r\n\r\n<p>The coastal areas and off-shore islands of Bengal and adjoining Bangladesh are the most storm-surge prone, East coast of India between Paradip and Balasore in Orissa, Andhra coast between Bapatla and Kakinada holding estuaries of two major rivers Krishna and Godavari, Tamilnadu coast between Pamban and Nagapattinam, Gujarat along the west coast of India.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-08-29 17:14:44','2020-08-29 17:15:25'),(97,'<p>Which two global winds originate from the subtropical highs ?</p>','<p><strong>Trade Winds (tropical easterlies):</strong></p>\r\n\r\n<p>The trade winds or easterlies are the permanent east-to-west prevailing winds that flow in the Earth&#39;s equatorial region (between 30&deg;N and 30&deg;S latitudes).</p>\r\n\r\n<p><strong>Westerlies:</strong></p>\r\n\r\n<p>The westerlies are the winds blowing from the sub-tropical high pressure belts towards the sub polar low pressure belts. Shifting of trade wind belt towards poles is the essential for the formation of equatorial westerly.</p>','0',1,'2020-08-29 17:15:53','2020-08-29 17:16:27'),(98,'<p>The mean sea - level pressure of the atmosphere decreases by half at the altitude of :</p>','<p>Barometer is an instrument used for measuring the atmospheric air pressure. Air pressure at 8 kilometers above is half of the ground.</p>','0',1,'2020-08-29 17:16:44','2020-08-29 17:17:22'),(99,'<p>What would be the angle of the sun above the horizon at noon on March 20th if you were standing on the Tropic of Cancer?</p>','<p>The&nbsp;ecliptic plane&nbsp;can be defined as a two-dimensional flat surface that geometrically intersects the Earth&#39;s orbital path around the Sun. On this plane, the Earth&#39;s axis is not at right angles to this surface, but inclined at an angle of about 23.5&deg; from the&nbsp;perpendicular.</p>','0',1,'2020-08-29 17:17:48','2020-08-29 17:18:57'),(100,'<p>Which one of the following statements about polar jet stream is not true ?</p>','<p>Jet streams&nbsp;form when warm air masses meet cold air masses in the atmosphere. The Sun doesn&#39;t heat the whole Earth evenly. That&#39;s why areas near the equator are hot and areas near the poles are cold. Speeds this high usually happen in&nbsp;polar jet streams&nbsp;in the winter time.</p>','0',1,'2020-08-29 17:37:16','2020-08-29 17:38:00'),(101,'<p>A band of wind called &lsquo;Jet Stream&rsquo; is found in &ndash;</p>','<p>The jet stream is mainly found in the tropopause, at the transition between the troposphere (where temperature decreases with height) and the stratosphere (where temperature increases with height).</p>','0',1,'2020-08-29 17:38:38','2020-08-29 17:39:10'),(102,'<p>Which term is used to describe the conversion of a solid directly to a gas, without passing through the liquid State ?</p>','<p>Sublimation&nbsp;is the transition of a substance directly from the solid to the gas phase, without passing through the intermediate liquid phase.</p>','0',1,'2020-08-29 17:39:27','2020-08-29 17:39:58'),(103,'<p>The rain-fed and rain-shadow areas are the characteristics of the</p>','<p>Orographic precipitation, rain,&nbsp;snow, or other&nbsp;precipitation&nbsp;produced when moist&nbsp;air&nbsp;is lifted as it moves over a mountain range. As the air rises and cools, orographic clouds form and serve as the source of the precipitation, most of which falls upwind of the mountain ridge. Some also falls a short distance downwind of the ridge and is sometimes called&nbsp;spillover. On the lee side of the mountain range, rainfall is usually low, and the area is said to be in a&nbsp;rain shadow. Very heavy precipitation typically occurs upwind of a prominent mountain range that is oriented across a prevailing wind from a warm ocean.</p>','0',1,'2020-08-29 17:40:20','2020-08-29 17:40:55'),(104,'<p>Hurricane carries which of the following Beaufort Number ?</p>','<p>Hurricane-force winds are sometimes described as Beaufort scale 12 through 16, very roughly related to the respective category speeds of the&nbsp;Saffir&ndash;Simpson hurricane scale, by which actual&nbsp;hurricanes&nbsp;are measured, where Category 1 is equivalent to Beaufort 12. However, the extended Beaufort numbers above 13 do not match the Saffir&ndash;Simpson scale. F1&nbsp;tornadoes&nbsp;on the&nbsp;Fujita scale&nbsp;and T2&nbsp;TORRO scale&nbsp;also begin roughly at the end of level 12 of the Beaufort scale, but are independent scales&nbsp;&ndash; although the TORRO scale wind values are based on the 3/2 power law relating wind velocity to Beaufort force.</p>','0',1,'2020-08-29 17:43:46','2020-08-29 17:44:48'),(105,'<p>V. Bjerkne&rsquo;s model is related to</p>','<p>Bjerknes was part of a group of meteorologists led by his father, Vilhelm Bjerknes, at the university of Leipzig. Together they develop the model that explain the generation, intensification and ultimate decay of mid latitude cyclones, introducing the idea of fronts that sharply different boundaries between air masses. This concept is known as the Norwegien - cyclone model.</p>','0',1,'2020-08-29 17:45:07','2020-08-29 17:45:42'),(106,'<p>An air temperature of 50 &deg;F with actual vapour pressure of 4.6 hPa and saturation vapour pressure of 12.3 hPa would have a relative humidity of</p>','<p>The relative humidity is defined as the ratio between the amount of moisture in the air at a particular temperature to the maximum moisture air can withstand at the same temperature. The relative humidity is 100% during rainy seasons.</p>\r\n\r\n<p>RH= (actual vapour density/ saturation water density)x100%</p>','0',1,'2020-08-29 17:46:24','2020-08-29 17:47:08'),(107,'<p>The actual amount of water vapour in a given quantity of air is greatest for which of the following temperature-relative humidity combinations ?</p>','<p>If the water vapor content stays the same and the&nbsp;temperature&nbsp;drops, the&nbsp;relative humidity&nbsp;increases. If the water vapor content stays the same and the&nbsp;temperature&nbsp;rises, the&nbsp;relative humidity&nbsp;decreases. This is because colder air doesn&#39;t require as much moisture to become saturated as warmer air.</p>','0',1,'2020-08-29 17:47:28','2020-08-29 17:48:08'),(108,'<p>Which one of the following isotherms for the average temperature of the Warmest month is generally accepted as equator ward edge of the Tundra climate ?</p>','<p>The&nbsp;tundra is&nbsp;coldest of all the biomes with an&nbsp;annual&nbsp;average&nbsp;temperature&nbsp;less than 5&deg;C, and precipitation (mostly in the form of snow) less than 100 mm per year. Due to extremely cold&nbsp;temperatures, the layer just below the surface remains permanently frozen. This frozen layer of ground&nbsp;is&nbsp;called &#39;permafrost&#39;. In contrast, summers are generally mild, with daily maxima from 15 to 18 &deg;C (59 &deg;F to 64 &deg;F), although&nbsp;<strong>the mean temperature of the warmest month</strong>&nbsp;is less than 10 &deg;C (50 &deg;F).</p>','0',1,'2020-08-29 17:48:28','2020-08-29 17:49:06'),(109,'<p>Given below are two statements, one labelled as <strong>Assertion (A)</strong> and other labelled as</p>\r\n\r\n<p><strong>Reason (R)</strong>. Select&nbsp; your&nbsp; answer&nbsp; from&nbsp; the&nbsp; codes&nbsp; given&nbsp; below&nbsp; :</p>\r\n\r\n<p><strong>Assertion (A)</strong> : Presence of CO2 in the earth&rsquo;s atmosphere is essential.</p>\r\n\r\n<p><strong>Reason&nbsp; (R)</strong>&nbsp; : CO2 can absorb heat.</p>\r\n\r\n<p><strong>Codes :</strong></p>','<p>Human activity since the Industrial Revolution has increased the amount of greenhouse gases in the atmosphere, leading to increased radioactive forcing from CO2, methane, tropospheric ozone, CFCs, and nitrous oxide. It causes green-house effect.</p>','0',1,'2020-08-29 17:49:36','2020-08-29 17:50:12'),(110,'<p>Identify the correct statement pertaining to the Mid-Atlantic Ridge from the floor of Atlantic Ocean among the following:</p>','<p>The mid-ocean ridge wraps around the globe for more than 65,000 km like the seam of a baseball. The average depth to the crest (top) of the ridge is 2500 m, but it rises above sea-level in&nbsp;Iceland&nbsp;and is more than 4000 m deep in the Cayman Trough.</p>','0',1,'2020-08-29 18:10:45','2020-08-29 18:11:33'),(111,'<p>Which one of the following is the correct average slope angle of continental slope?</p>','<p>Continental slope. Compared with the relatively flat surface and gentle inclination of the&nbsp;continental&nbsp;shelf, the&nbsp;continental slope&nbsp;dips steeply into the ocean basins at an average angle of around 4&deg; although it may be much steeper locally (35 to 90&deg;.</p>','0',1,'2020-08-29 18:11:55','2020-08-29 18:12:34'),(112,'<p>The term &ldquo;brine&rdquo; is applicable to</p>','<p>Brines are commonly considered to be those waters more saline, or more concentrated in dissolved materials, than sea water (35 grams of dissolved constituents per kilogram of sea water).&nbsp;Brine&nbsp;can contain salt concentrations more than five times greater than the salt content of average sea water.</p>','0',1,'2020-08-29 18:13:01','2020-08-29 18:13:37'),(113,'<p>Identify the correct statement regarding variation in density of ocean water and air at the same temperature.</p>','<h3>Water&nbsp;is about&nbsp;800 times denser than air, and the first effect noticed by&nbsp;most&nbsp;people is the increased effort required to move while in the&nbsp;water. But this is just one effect of&nbsp;water&nbsp;density. Objects appear differently, sounds are&nbsp;more&nbsp;pronounced, and you get cold&nbsp;faster.</h3>\r\n\r\n<h3>Therefore, at sea level, air is&nbsp;784 times&nbsp;less dense than water. Expressed in another way, a volume of air at sea level has 0.1275% of the density of the same volume of water.</h3>','0',1,'2020-08-29 18:13:56','2020-08-29 18:15:03'),(114,'<p>Which one of the followings is the correct average range of worldwide variations in sea water salinity?</p>','<p>The&nbsp;salinity&nbsp;of the&nbsp;ocean varies&nbsp;from place to place, especially at the surface. Much of the&nbsp;ocean&nbsp;has&nbsp;salinity&nbsp;between 34 ppt and 36 ppt, but there are places that tend to be higher or lower.</p>','0',1,'2020-08-29 18:15:28','2020-08-29 18:16:01'),(115,'<p>The sea attained its present level during the geological period</p>','<p>During&nbsp;the most recent ice age (at its maximum about 20,000 years ago) the world&#39;s&nbsp;sea level was&nbsp;about 130 m lower than today, due to the large amount of&nbsp;sea&nbsp;water that&nbsp;had&nbsp;evaporated and been deposited as snow and ice, mostly in the Laurentide Ice Sheet.</p>','0',1,'2020-08-29 18:16:29','2020-08-29 18:17:05'),(116,'<p>The subsidence theory related to the coral reef was propounded by:</p>','<p>The subsidence&nbsp;hypothesis of&nbsp;coral reef&nbsp;development was proposed by Charles Darwin and was formulated during his voyage on the Beagle. It envisaged that fringing&nbsp;reefs, barrier&nbsp;reefs, and atolls represent successive stages in an evolutionary sequence.</p>','0',1,'2020-08-29 18:17:39','2020-08-29 18:18:30'),(117,'<p>Which one of the following temperatures of sea water is favorable for the formation of coral reefs?</p>','<p>Many grow optimally in&nbsp;water temperatures&nbsp;between 73&deg; and 84&deg; Fahrenheit (23&deg;&ndash;29&deg;Celsius), but some can tolerate&nbsp;temperatures&nbsp;as high as 104&deg; Fahrenheit (40&deg; Celsius) for short periods. Most&nbsp;reef-building&nbsp;corals&nbsp;also require very saline (salty)&nbsp;water&nbsp;ranging from 32 to 42 parts per thousand.</p>','0',1,'2020-08-29 18:18:51','2020-08-29 18:19:48'),(118,'<p>Which one of the following is not the form of Coral Reefs?</p>','<p>A lagoon is a shallow body of water separated from a larger body of water by barrier islands or reefs. Lagoons are commonly divided into coastal lagoons and atoll lagoons. They have also been identified as occurring on mixed-sand and gravel coastlines. It is not the form of Coral Reefs.</p>','0',1,'2020-08-29 18:20:12','2020-08-29 18:20:45'),(119,'<p>The Challenger Expedition of 1874 was headed by the country:</p>','<p>The Challenger Expedition of 1874 was headed by United Kingdom. Modern oceanography began with the&nbsp;Challenger Expedition&nbsp;between 1872 and 1876. It&nbsp;was&nbsp;the first&nbsp;expedition&nbsp;organized specifically to gather data on a wide range of ocean features, including ocean temperatures seawater chemistry, currents, marine life, and the geology of the seafloor.</p>','0',1,'2020-08-29 18:21:15','2020-08-29 18:21:48'),(120,'<p>Which one of the following types of sea floor sediments includes calcareous and siliceous oozes?</p>','<p>Biogenic&nbsp;ooze, also called biogenic&nbsp;sediment, any pelagic&nbsp;sediment&nbsp;that&nbsp;contains&nbsp;more than 30 percent skeletal material. These sediments&nbsp;can be made up of either carbonate (or calcareous) ooze or siliceous ooze.</p>','0',1,'2020-08-29 18:22:15','2020-08-29 18:22:50'),(121,'<p>Which one of the following is responsible for the greatest movements of all the tides?</p>','<p>High&nbsp;tides&nbsp;and low&nbsp;tides&nbsp;are caused by the Moon. The Moon&#39;s gravitational pull generates something called the&nbsp;tidal&nbsp;force. The&nbsp;tidal&nbsp;force&nbsp;causes&nbsp;Earth and its water to bulge out on the side closest to the Moon and the side farthest from the Moon. These bulges of water are high&nbsp;tides.</p>','0',1,'2020-08-29 18:23:07','2020-08-29 18:23:39'),(122,'<p>&lsquo;Negative Southern Oscillation Index&rsquo; refers to which of the following?</p>','<p>The&nbsp;negative&nbsp;phase of the&nbsp;Southern Oscillation&nbsp;occurs during El Ni&ntilde;o episodes, and&nbsp;refers&nbsp;to the situation when abnormally high air pressure covers Indonesia and the western tropical Pacific and abnormally low air pressure covers the eastern tropical Pacific.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-08-29 18:23:57','2020-08-29 18:24:32'),(123,'<p>Identify the correct sequence from land to sea</p>','<p>Swash, or for wash in geography, is a turbulent layer of water that washes up on the beach after an incoming wave has broken. The swash action can move beach materials up and down the beach, which results in the cross-shore sediment exchange.</p>\r\n\r\n<p>A transition is a word or phrase that shows the relationship between paragraphs or sections of a text or speech. Transitions provide greater cohesion by making it more explicit or signaling how ideas relate to one another. Transitions are &quot;bridges&quot; that &quot;carry a reader from section to section.&quot;</p>\r\n\r\n<p>Surfing is a surface water pastime in which the wave rider, referred to as a surfer, rides on the forward part, or face, of a moving wave, which usually carries the surfer towards the shore breaker zone. The nearshore&nbsp;zone&nbsp;between the outermost&nbsp;breakers&nbsp;and the bore area where wave water rushes onto the beach. The water in the&nbsp;breaker zone&nbsp;is shallow, usually between 5 and 10 m (16 and 33 ft) deep; therefore, most waves there are unstable. Also called the surf&nbsp;zone.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-08-29 18:24:58','2020-08-29 18:26:03'),(124,'<p>Surface circulation of ocean water is driven by:</p>','<p>Winds drive&nbsp;ocean currents&nbsp;in the upper 100 meters of the&nbsp;ocean&#39;s surface. However,&nbsp;ocean currents&nbsp;also flow thousands of meters below the&nbsp;surface. These deep-ocean currents&nbsp;are&nbsp;driven&nbsp;by differences in the&nbsp;water&#39;s&nbsp;density, which is controlled by temperature (thermo) and salinity (haline).</p>','0',1,'2020-08-29 18:26:22','2020-08-29 18:26:58'),(125,'<p>Which of the following is a cold current?</p>','<p>The&nbsp;Benguela Current&nbsp;is the eastern boundary&nbsp;current&nbsp;of the South Atlantic subtropical gyre. The&nbsp;Benguela Current&nbsp;flows through a strong, biologically productive upwelling region, and advects cool waters to the tropics. This water is&nbsp;warmed&nbsp;and is one of the source waters for the South Equatorial&nbsp;Current.</p>','0',1,'2020-08-29 18:27:19','2020-08-29 18:27:56'),(126,'<p>Ocean waves obtain their energy from:</p>','<p>Ocean waves&nbsp;contain tremendous&nbsp;energy&nbsp;potential.&nbsp;Wave&nbsp;power device extract energy&nbsp;directly from the surface motion of&nbsp;ocean waves. In many areas of the world, the wind blows with enough consistency and force to provide continuous&nbsp;waves&nbsp;along the shoreline.</p>','0',1,'2020-08-29 18:28:14','2020-08-29 18:28:48'),(127,'<p>Which one of the following lakes/seas has the highest salinity in the world?</p>','<p>With a salinity level over 40 percent, Don Juan is significantly saltier than most of the other&nbsp;hypersaline lakes&nbsp;around the world.&nbsp;The Dead Sea&nbsp;has a salinity of 34 percent; the Great Salt Lake varies between 5 and 27 percent. Earth&#39;s oceans have an average salinity of 3.5 percent.</p>','0',1,'2020-08-29 18:29:08','2020-08-29 18:29:40'),(128,'<p>Given below are two statements, one labeled as <strong>Assertion (A)</strong> and the other labeled as</p>\r\n\r\n<p><strong>Reason (R)</strong>. Select your answer from the codes given below:</p>\r\n\r\n<p><strong>Assertion (A)</strong>: The Sahara Desert enjoys a dry climate.</p>\r\n\r\n<p><strong>Reason (R)</strong>: The eastern side of the ocean in sub-tropics along with the cold oceanic current.</p>\r\n\r\n<p><strong>Codes:</strong></p>','<p>Deserts&nbsp;are&nbsp;hot&nbsp;primarily because of a lack of water. When the sun shines on the ground, all of the absorbed sunlight goes into raising the ground&#39;s temperature.&nbsp;DESERTS&nbsp;ARE COLD AT NIGHT: Because of the lack of water in the ground, and little water vapor in the air, most&nbsp;deserts&nbsp;can get quite cool at night.</p>\r\n\r\n<p>Boundary currents are&nbsp;ocean currents&nbsp;with dynamics determined by the presence of a coastline. Subtropical eastern&nbsp;boundary currents flow equatorward, transporting&nbsp;cold&nbsp;water from higher latitudes to the principal west&nbsp;side&nbsp;currents (such as the Gulf Stream of the North Atlantic&nbsp;Ocean) are stronger than those opposite.</p>','0',1,'2020-08-29 18:30:09','2020-08-29 18:30:57'),(129,'<p>Which one of the following groups of natural elements in living matters make up more than 99% of Earth&rsquo;s biomass?</p>','<p>The six most common elements in living things are&nbsp;carbon,&nbsp;hydrogen,&nbsp;oxygen,&nbsp;nitrogen,&nbsp;phosphorus, and sulfur. Atoms of these elements combine and form thousands of large molecules. These large molecules make up the structures of cells and carry out many processes essential to life.</p>','0',1,'2020-08-29 18:31:16','2020-08-29 18:31:50'),(130,'<p>Which one of the following terms is appropriate for the mixing zone of two biomes ?</p>','<p>Ecocline means a broad transition between two different ecosystems of mainly plant communities. In fact an ecocline represents gradient along which biotic communities mainly plant community and abiotic conditions change.</p>','0',1,'2020-08-29 18:32:16','2020-08-29 18:32:50'),(131,'<p>Which one of the following terms is appropriate for plants that endure seasonal climatic fluctuations from year to year ?</p>','<p>Plant That endure seasonal climatic fluctuation from year to year called is annual</p>','0',1,'2020-08-29 18:33:11','2020-08-29 18:33:45'),(132,'<p>The transition zone between two ecosystems is called</p>','<p>Ecocline means a broad transition between two different ecosystems of mainly plant communities. Infact an ecocline represents gradient along which biotic communities mainly plant community and abiotic conditions change.</p>\r\n\r\n<p>An&nbsp;ecotone&nbsp;is a transition area between two biological communities, where two communities meet and integrate. It may be narrow or wide, and it may be local (the zone between a field and forest) or regional (the transition between forest and grassland ecosystems).</p>','0',1,'2020-08-29 18:34:02','2020-08-29 18:34:36'),(133,'<p>Which one of the following is located in the Bastar region ?</p>','<p>Indravati National Park is the finest and most famous wildlife parks of Chhattisgarh. It is one among the three project tiger sites in Chhattisgarh along with Udanti-sitanadi, Indravati National Park is located in Bijapur district of Chhattisgarh. The park derives its name from the Indravati River, which flows from east to west and forms the northern boundary of the reserve with the Indian state of Maharashtra. With a total area of approximately 2799.08&nbsp;km2, Indravati attained the status of a national park in 1975 and a tiger reserve in 1983 under the famous&nbsp;Project Tiger&nbsp;of India, to become one of the most famous tiger reserves of India.</p>','0',1,'2020-08-29 18:34:55','2020-08-29 18:35:28'),(134,'<p>Vast numbers of herbivorous animals and carnivorous such as lions, Jackals and hyenas are found in</p>','<p>Vast numbers of herbivorous animals and carnivorous such as lions,&nbsp;Jackals and hyenas are found&nbsp;in Savannas of Africa or the tropical grasslands.</p>','0',1,'2020-08-29 18:35:47','2020-08-29 18:37:00'),(135,'<p>Which one of the following marine ecosystems has the highest primary production ?</p>','<p>The seas occupy the greater part (70%) of the earth&#39;s surface, but their total net primary production is less than that of the land. Depletion of nutrients in the lighted surface waters is responsible for low productivities of most of the open ocean; higher productivities occur in coastal waters and areas of upwelling. A recent estimate of total production for the marine plankon is 50&times;10&nbsp;9&nbsp;metric tons of dry matter per year; the total with benthic production may be 55&times;109&nbsp;tons/year. The value for the plankton may be too low; there are persistent problems in measuring productivity with the radiocarbon technique. Because harvestable fish populations are concentrated in a limited area of more productive waters, where they are subject to overharvest and pollution effects, major increase in food production from the seas is not likely.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-08-29 18:37:22','2020-08-29 18:38:13'),(136,'<p>The concept of ecological pyramid was first given by whom?</p>','<p>The structure of ecosystems can be visualized with&nbsp;ecological pyramids, which were&nbsp;first&nbsp;described by the pioneering studies of Charles Elton in the 1920s.&nbsp;Ecological pyramids&nbsp;show the relative amounts of various parameters (such as number of organisms, energy, and&nbsp;biomass) across&nbsp;trophic&nbsp;levels.</p>','0',1,'2020-08-29 18:38:31','2020-08-29 18:39:08'),(137,'<p>The pyramid of biomass is inverted in case of</p>','<p>The English Channel ecosystem exhibits an&nbsp;inverted biomass pyramid&nbsp;since the primary producers make up less&nbsp;biomass&nbsp;than the primary consumers.&nbsp;Pyramid&nbsp;ecosystem modeling can also be used to show energy flow through the trophic levels;&nbsp;pyramids&nbsp;of energy are always upright since energy decreases at each trophic level.</p>','0',1,'2020-08-29 18:39:40','2020-08-29 18:40:27'),(138,'<p>The endemic species of India are mainly found in</p>','<p>Almost 60% of&nbsp;the endemic species&nbsp;in&nbsp;India&nbsp;are&nbsp;found&nbsp;in the Himalayas and the Western Ghats.&nbsp;Endemic species&nbsp;are&nbsp;mainly&nbsp;concentrated on the regions of North-East&nbsp;India, North-west Himalayas, Western Ghats, and Andaman and the Nicobar Islands.</p>','0',1,'2020-08-29 18:40:53','2020-08-29 18:42:14'),(139,'<p>Tropical Evergreen Forests are found in the areas of rainfall ranging between</p>','<p>Tropical evergreen forests&nbsp;are dense, multi-layered, and harbour many types of plants and animals. These&nbsp;forests are found in the areas&nbsp;receiving heavy&nbsp;rainfall&nbsp;(more than 200 cm annual&nbsp;rainfall). They are very dense. Even the sunlight does not reach the ground.</p>','0',1,'2020-08-29 18:43:22','2020-08-29 18:43:55'),(140,'<p>The place where an organism or community of organisms lives is called :</p>','<p>In ecology, a habitat is the type of natural environment in which a particular species of organism lives. A species&rsquo; habitat is those places where the species can find food, shelter, protection and mates for reproduction. It is characterized by both physical and biological features.</p>','0',1,'2020-08-29 18:44:49','2020-08-29 18:45:26'),(141,'<p>Alpine vegetation from mean sea level is found at an altitude(metres) of:</p>','<p>At high&nbsp;altitudes, generally more than 3,600&nbsp;metres&nbsp;above&nbsp;sea level,&nbsp;alpine vegetation&nbsp;is&nbsp;found. Silver fir, jumpers, pines and birches are the common trees of these forests.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-08-29 18:45:50','2020-08-29 18:46:25'),(142,'<p>The main source of carbon-monoxides, as air pollutants, is</p>','<p>Carbon monoxide&nbsp;(CO)&mdash;a colorless, odorless, tasteless, and toxic&nbsp;air pollutant&mdash;is produced in the incomplete combustion of&nbsp;carbon-containing fuels, such as gasoline, natural gas, oil, coal, and wood.&nbsp;The largest&nbsp;anthropogenic&nbsp;source of CO&nbsp;in the United States is vehicle emissions.</p>','0',1,'2020-08-29 18:58:10','2020-08-29 18:58:56'),(143,'<p>&lsquo;Montreal Protocol&rsquo; is related to</p>','<p>The&nbsp;Montreal Protocol, finalized in 1987, is a global agreement to protect the stratospheric ozone layer by phasing out the production and consumption of ozone-depleting substances (ODS).</p>','0',1,'2020-08-29 18:59:27','2020-08-29 19:00:04'),(144,'<p>The objective of Kyoto Protocol was to reduce green-house gas emission by :</p>','<p>The&nbsp;Kyoto Protocol&nbsp;implemented the&nbsp;objective&nbsp;of the UNFCCC to&nbsp;reduce&nbsp;the onset of global warming by&nbsp;reducing greenhouse gas&nbsp;concentrations in the atmosphere to &quot;a level that would&nbsp;prevent&nbsp;dangerous anthropogenic interference with the climate system&quot;&nbsp;.</p>','0',1,'2020-08-29 19:03:43','2020-08-29 19:04:23'),(145,'<p>Given below are the two statements, one labelled as Assertion (A) and the other labelled as Reason (R). Select your answer from the code given below:</p>\r\n\r\n<p>Assertion (A): Energy flow shifts from production to respiration in the entropic stage, with oxygen demand exceeding oxygen availability.</p>\r\n\r\n<p>Reason (R): Stratospheric ozone layer depletion causes skin diseases.</p>\r\n\r\n<p>Code:</p>','<p>Solar radiation is the basic input of energy which enters the ecosystem. This solar energy passes through the hierarchy of trophic levels in a food chain and food web and ultimately becomes output from the ecosystem as energy is lost through respiration from each trophic level. Biosynthesis is the process of the formation of organic tissue which represents the transformation of solar or light energy into chemical or food energy. Biodegradation is the process of breakdown and decomposition of organic matter and thus this process refers to the release of nutrients and food (chemical) energy in the form of heat. The energy flow (transfer of organic molecules) in the ecosystem is unidirectional and is non-cyclic (is not available again for reuse).</p>\r\n\r\n<p>The radiant solar energy or light (of the sun) energy is trapped by green plants (primary producers or autotrophs) and is used to prepare food (chemical organic matter) through the process of photosynthesis. Thus autotrophic (or phototrophic) green plants transform a part of solar energy into food or chemical energy which is used by the green plants (primary producers at trophic level 1) to develop their tissues and thus it is stored in the primary producers or autotrophs at the bottom of trophic levels (i.e. trophic level 1)</p>','0',1,'2020-08-29 19:04:58','2020-08-29 19:06:04'),(146,'<p>Hekistothermal plants are found in</p>','<p><strong>Hekistotherm</strong>&nbsp;a cold-tolerant plant of polar regions, according to A. L. P. de&nbsp;Candolle&#39;s&nbsp;(1874) classic temperature-based scheme of world vegetation zones.</p>','0',1,'2020-08-29 19:07:09','2020-08-29 19:07:42'),(147,'<p>The Milankovitch cycle refers to</p>','<p>Milankovitch cycles&nbsp;describe the collective effects of changes in the Earth&#39;s movements on its climate over thousands of years. Now, materials on Earth that have been unchanged for millennia (obtained via ice, rock, and deep ocean cores) are being studied to indicate the history of Earth&#39;s climate.</p>','0',1,'2020-08-29 19:09:42','2020-08-29 19:10:19'),(148,'<p>The ratio between Biological Oxygen Demand (BOD) and Chemical Oxygen Demand (COD) should always be</p>','<p>BOD&nbsp;analysis is similar in function to&nbsp;chemical oxygen demand&nbsp;(COD) analysis, in that both measure the amount&nbsp;of&nbsp;organic compounds in water. However,&nbsp;COD&nbsp;analysis is less specific, since it measures everything that can be chemically oxidized, rather than just levels&nbsp;of&nbsp;biologically oxidized organic matter.</p>','0',1,'2020-08-29 19:10:41','2020-08-29 19:11:17'),(149,'<p>Which one of the following states in India recorded the lowest sex ratio as per 2011 census?</p>','<p>According to the 2011 Census of India, the total population of the state of Tamil Nadu stood at&nbsp;72,147,039, with&nbsp;36,137,975&nbsp;males,&nbsp;36,009,055&nbsp;females, a sex ratio of 996 females per 1000 males, literacy rate of 80.09%, 10.51% of the population below seven years and a population density of 555.</p>\r\n\r\n<p>Sex Ratio&nbsp;in&nbsp;West Bengal&nbsp;is 950 i.e. for each 1000 male, which is below national average of 940 as&nbsp;per census 2011.</p>\r\n\r\n<p>Uttarakhand:&nbsp;Sex Ratio as per Census 2011. In&nbsp;Uttarakhand, the&nbsp;sex ratio as per census 2011&nbsp;is 963 females&nbsp;per&nbsp;1000 males.&nbsp;Sex ratio&nbsp;(rural) was 1000 females&nbsp;per&nbsp;1000 males and&nbsp;Sex ratio&nbsp;(urban) was 884 females&nbsp;per&nbsp;1000 males.</p>\r\n\r\n<p>In&nbsp;Himachal Pradesh, the&nbsp;sex ratio as per census 2011&nbsp;is 972 females&nbsp;per&nbsp;1000 males</p>','0',1,'2020-08-29 19:11:42','2020-08-29 19:12:17'),(150,'<p>Which one of the following countries recorded highest population density as per&nbsp;&nbsp;&nbsp;U.N. Demographic Year Book, 2010?</p>','<p>Population density of Bangladesh 1007 which is the highest population density of the world in 2010.</p>','0',1,'2020-08-29 19:12:46','2020-08-29 19:13:16'),(151,'<p>Which one of the following groups of states in Indian recorded Sex Ratio higher than 950 according to the year 2011 census?</p>','<p>As per&nbsp;Census 2011, top five&nbsp;states/Union territories which have the highest&nbsp;sex ratio&nbsp;are Kerela (1,084) followed by Puducherry (1,038), Tamil Nadu (995), Andhra Pradesh (992) and Chhattisgarh (991).</p>','0',1,'2020-08-29 19:13:39','2020-08-29 19:14:13'),(152,'<p>Which one of the following statements indicates to the potential use of a service at a location according to Gravity Model?</p>','<p>The&nbsp;Gravity Model&nbsp;holds that the interaction between two places can be determined by the product of the population of both places, divided by the square of their distance from one another. The primary implication of this&nbsp;model&nbsp;is that distance is not the only determining factor in the interaction between two cities.</p>','0',1,'2020-08-29 19:14:36','2020-08-29 19:15:17'),(153,'<p>Which one of the following statements represents Population Pyramid with Wide base:</p>','<p>A&nbsp;wide base means&nbsp;there are lots of young people, and suggests a high birth rate. A narrow&nbsp;base means&nbsp;a smaller proportion of young people, suggesting a low birth rate. A&nbsp;wide&nbsp;middle, tall&nbsp;pyramid means&nbsp;an ageing&nbsp;population, suggesting that there is a long life expectancy.</p>','0',1,'2020-08-29 19:15:33','2020-08-29 19:16:07'),(154,'<p>Which one of the following does not have role in push factors that seem to be operative in rural India?</p>','<p>It&#39;s&nbsp;important&nbsp;to understand why people move, or the&nbsp;push&nbsp;and&nbsp;pull factors&nbsp;that cause them to move.&nbsp;Push factors&nbsp;&ldquo;push&rdquo; people away from their home and include things like war.&nbsp;Pull factors&nbsp;&ldquo;pull&rdquo; people to a new home and include things like better opportunities.</p>','0',1,'2020-08-29 19:16:28','2020-08-29 19:17:11'),(155,'<p>Which of the following conditions is characterized by the second stage of Demographic Transition?</p>','<p>Stage 2&nbsp;of the&nbsp;Demographic Transition&nbsp;Model (DTM) is&nbsp;characterized&nbsp;by a rapid decrease in a country&#39;s death rate while the birth rate remains high. As such, the total&nbsp;population&nbsp;of a country in&nbsp;Stage 2&nbsp;will rise because births outnumber deaths, not because the birth rate is rising.</p>','0',1,'2020-08-29 19:18:01','2020-08-29 19:18:47'),(156,'<p>The census of India (2011) states that maximum density of population is found in which of the following Union Territories?</p>','<p>Urban&nbsp;states&nbsp;and&nbsp;union territories&nbsp;in&nbsp;India&nbsp;have the&nbsp;highest population density&nbsp;among&nbsp;states&nbsp;and&nbsp;union territories&nbsp;in terms of this measure, with the most being in Delhi as per the&nbsp;2011 Census, followed by Chandigarh, Puducherry, and Daman &amp; Diu in that order. Delhi has a&nbsp;population density&nbsp;of 11,297 persons per sq km.</p>','0',1,'2020-08-29 19:19:08','2020-08-29 19:19:39'),(157,'<p>Which one of the following authors used the formula d<em>x </em>= do e&ndash;b<em>x </em>where, d<em> </em>represents population density (d) at a distance <em>x </em>from the city centre, do the centre density, e an exponent of distance and b the density radiant, to describe the pattern of population density in any city?</p>','<p>C.&nbsp;Clark&#39;s&nbsp;model of urban&nbsp;population densities&nbsp;indicating that&nbsp;population density&nbsp;varies with distance from the center of the city according to the equation Dx=D0e-bx where Dx is the&nbsp;population density&nbsp;at distance x from the center.</p>','0',1,'2020-08-29 19:20:15','2020-08-29 19:20:47'),(158,'<p>Which one of the following criteria is used by Census of India 2011 to define the town?</p>','<p>All other places which satisfied the following criteria known as&nbsp;Census Town: A&nbsp;minimum population&nbsp;of 5,000; At least 75&nbsp;per&nbsp;cent of the male main workers engaged in non-agricultural pursuits; A density of&nbsp;population&nbsp;of at least 400&nbsp;per&nbsp;sq. Km.</p>','0',1,'2020-08-29 19:21:08','2020-08-29 19:21:42'),(159,'<p>Out of the following cities, whose population is less than 10 lakhs as per Census of India 2011?</p>','<p>According to the&nbsp;2011&nbsp;census, there were 46&nbsp;million-plus&nbsp;cities in India,&nbsp;with&nbsp;Mumbai, Delhi and Kolkata having populations over 10&nbsp;million. There&nbsp;are&nbsp;53 urban agglomerations in&nbsp;India with&nbsp;a population of 1&nbsp;million&nbsp;or more as of&nbsp;2011&nbsp;against 35 in 2001 inciuding Ambala.</p>','0',1,'2020-08-29 19:22:00','2020-08-29 19:22:35'),(160,'<p>How physiological density of population is defined?</p>','<p>The&nbsp;physiological density&nbsp;or real&nbsp;population density&nbsp;is the number of people per unit area of arable land. A higher&nbsp;physiological density&nbsp;suggests that the available&nbsp;agricultural&nbsp;land is being used by more and may reach its output limit sooner than a country that has a lower&nbsp;physiological density.</p>','0',1,'2020-08-29 19:23:41','2020-08-29 19:24:17'),(161,'<p>Which of the following exhibits &ldquo;cumulative percentages of population</p>\r\n\r\n<p>against cumulative percentages of area&rdquo;?</p>','<p>a graph on which the cumulative percentage of total national income (or some other variable) is plotted against the cumulative percentage of the corresponding population (ranked in increasing size of share). The extent to which the curve sags below a straight diagonal line indicates the degree of inequality of distribution.</p>','0',1,'2020-08-29 19:24:37','2020-08-29 19:25:11'),(162,'<p>Who developed the theory of demographic transition?</p>','<p>The &quot;Demographic Transition&quot; is a model that describes population change over time. It is based on an interpretation begun in 1929 by the American demographer&nbsp;Warren Thompson, of the observed changes, or transitions, in birth and death rates in industrialized societies over the past two hundred years or so.</p>','0',1,'2020-08-29 19:25:29','2020-08-29 19:25:59'),(163,'<p>Which one of the following density is calculated using following formula: ED5&nbsp; NK <em>,</em>&nbsp;where SKN is the number of inhabitants, K is per capita quantity of requirement, S is area in square kilometers, and K&rsquo; is the quantity of resources produced per km2.</p>','<p>Arithmetic density, also known as real&nbsp;density, is very simply the total number of people divided by the total land area.&nbsp;Physiological density&nbsp;is the number of people per unit area of arable land.</p>','0',1,'2020-08-29 19:26:26','2020-08-29 19:27:01'),(164,'<p>Which one of the following forces has expansionary momentum emanating from the centres of economic expansion to other regions?</p>','<p>In&nbsp;Newtonian mechanics, the&nbsp;centrifugal force&nbsp;is an&nbsp;inertial force&nbsp;(also called a &quot;fictitious&quot; or &quot;pseudo&quot; force) that appears to act on all objects when viewed in a&nbsp;rotating frame of reference. It is directed away from an axis which is parallel to the&nbsp;axis of rotation&nbsp;and passing through the coordinate system&#39;s origin. If the axis of rotation passes through the coordinate system&#39;s origin, the centrifugal force is directed radially outwards from that axis.</p>','0',1,'2020-08-29 19:27:33','2020-08-29 19:28:04'),(165,'<p>Which one of the following depicts correct statement of Population Threshold for any service?</p>','<p>In&nbsp;geography, a threshold population is the minimum number of people necessary before a particular&nbsp;good&nbsp;or service can be provided in an area. The concept is equivalent to the &quot;range&quot; in&nbsp;central place theory&nbsp;and&nbsp;retailing, which delineates the&nbsp;market&nbsp;area of a central place for a particular good or service, and is dependent on the&nbsp;spatial distribution&nbsp;of population and the willingness of&nbsp;consumers&nbsp;to travel a given distance to purchase particular goods or services</p>','0',1,'2020-08-29 19:28:32','2020-08-29 19:29:21'),(166,'<p>Which one of the following principles denotes K-4 of Christaller&rsquo;s Model of central places?</p>','<h3><strong><em>K</em>&nbsp;= 4 transport/traffic principle</strong></h3>\r\n\r\n<p>According to&nbsp;<em>K</em>&nbsp;= 4 transport principle, the market area of a higher-order place includes a half of the market area of each of the six neighbouring lower-order places, as they are located on the edges of hexagons around the high-order settlements. This generates a hierarchy of central places which results in the most efficient transport network. There are maximum central places possible located on the main transport routes connecting the higher order center. The transportation principle involves the minimization of the length of roads connecting central places at all hierarchy levels. In this system of nesting, the lower order centres are all located along the roads linking the higher order centres. This alignment of places along a road leads to minimization of road length. However, for each higher order centre, there are now four centres of immediate lower order, as opposed to three centres under the marketing principle.</p>','0',1,'2020-08-29 19:29:48','2020-08-29 19:30:23'),(167,'<p>A process of population deconcentration away from large urban settlements to non-metropolitan areas are termed as:</p>','<p>At the height of the Cold War, the sprawling, decentralized suburban landscape of the United States was seen by many military planners as a form of spatial self-defense. As historian David Krugler explains in&nbsp;<em>This Is Only a Test: How Washington D.C. Prepared for Nuclear War</em>, &ldquo;urban dispersal&rdquo; was viewed as a defensive military tactic, one that would greatly increase the nation&rsquo;s chance of survival in the event of nuclear attack.</p>','0',1,'2020-08-29 19:30:44','2020-08-29 19:31:34'),(168,'<p>Among the following theories, which one is concerned with the discovery of order in the spacing of population clusters and settlements?</p>','<p>Central place&nbsp;theory is&nbsp;concerned&nbsp;with the size, number, functional characteristics, and spacing of settlements, which are nodal points for the distribution of goods and services to surrounding market areas.</p>','0',1,'2020-08-29 19:31:55','2020-08-29 19:32:26'),(169,'<p><strong>Read the following passage carefully and answer questions:</strong></p>\r\n\r\n<p>Some 2000 km down south of the Amazon, and about the same time when the tidal waves were at their highest as a consequence of the big clash of sea and freshwater at the Amazon delta most vigorously in March and April (2018), more than 40,000 people were talking about the power of water. Brasilia hosted the eighth edition of the World Water Forum (WWF &ndash; 8), where heads of states, civil societies, and private sector gathered to discuss the present and future of mankind&rsquo;s most valuable resource. This year&rsquo;s theme was &lsquo;Sharing Water&rsquo;, and the government authorities expectedly put forth a political declaration, aimed at raising awareness about threats and opportunities associated with water resources. Deliberations here would play a decisive role in the periodic assessment of the sustainable development goals of Agenda 2030.</p>\r\n\r\n<p>Brazil has established a solid institutional and legal framework for water management, based on the principle of multi-stakeholder participation. Brazil has also been conducting one of the boldest river inter-linking projects in which 500 km of canals will transfer abundant waters from the S?o Francisco basin to small rivers and weirs in one of Brazil&rsquo;s most arid areas, benefitting more than 12 million people in almost 400 municipalities.</p>\r\n\r\n<p>India, too, has a large variety of water resources. An institutional framework consisting of regional river boards and river cleansing missions has been set up, while successive Central Governments have made efforts to address the dire needs of irrigation and mitigation of groundwater depletion. As in the case of Brazil, a lot remains to be done in India.</p>\r\n\r\n<p>Adequate treatment of industrial waste-water, the fight against contamination of riverbeds, and assistance to drought-affected areas are high priority topics for both New Delhi and Brasilia. Due to these commonalities, there is ample room for bilateral co-operation. Water is a local, regional, and global common, and as such, collaboration is key to address most of its associated threats.</p>\r\n\r\n<p>Today, mankind is faced with two facts: water is too powerful a force to be fought over, and too valuable a resource to be lost. To harmonies, these two conflicting aspects, sharing water is perhaps the only meaningful motto for the ages to come.</p>\r\n\r\n<p><strong>As per the text of the passage, the eighth edition of the World Water Forum was concerned with:</strong></p>','<p>As per the passage, the eight edition of the World Water Forum was concerned with the power of water. The distribution and sharing of water in Amazon delta are bone of contention between nations.</p>','0',1,'2020-08-31 19:10:54','2020-08-31 19:12:01'),(170,'<p><strong>Read the following passage carefully and answer questions:</strong></p>\r\n\r\n<p>Some 2000 km down south of the Amazon, and about the same time when the tidal waves were at their highest as a consequence of the big clash of sea and freshwater at the Amazon delta most vigorously in March and April (2018), more than 40,000 people were talking about the power of water. Brasilia hosted the eighth edition of the World Water Forum (WWF &ndash; 8), where heads of states, civil societies, and private sector gathered to discuss the present and future of mankind&rsquo;s most valuable resource. This year&rsquo;s theme was &lsquo;Sharing Water&rsquo;, and the government authorities expectedly put forth a political declaration, aimed at raising awareness about threats and opportunities associated with water resources. Deliberations here would play a decisive role in the periodic assessment of the sustainable development goals of Agenda 2030.</p>\r\n\r\n<p>Brazil has established a solid institutional and legal framework for water management, based on the principle of multi-stakeholder participation. Brazil has also been conducting one of the boldest river inter-linking projects in which 500 km of canals will transfer abundant waters from the S?o Francisco basin to small rivers and weirs in one of Brazil&rsquo;s most arid areas, benefitting more than 12 million people in almost 400 municipalities.</p>\r\n\r\n<p>India, too, has a large variety of water resources. An institutional framework consisting of regional river boards and river cleansing missions has been set up, while successive Central Governments have made efforts to address the dire needs of irrigation and mitigation of groundwater depletion. As in the case of Brazil, a lot remains to be done in India.</p>\r\n\r\n<p>Adequate treatment of industrial waste-water, the fight against contamination of riverbeds, and assistance to drought-affected areas are high priority topics for both New Delhi and Brasilia. Due to these commonalities, there is ample room for bilateral co-operation. Water is a local, regional, and global common, and as such, collaboration is key to address most of its associated threats.</p>\r\n\r\n<p>Today, mankind is faced with two facts: water is too powerful a force to be fought over, and too valuable a resource to be lost. To harmonies, these two conflicting aspects, sharing water is perhaps the only meaningful motto for the ages to come.</p>\r\n\r\n<p><strong>Deliberations on the theme &lsquo;Sharing Water&rsquo; should facilitate:</strong></p>','<p>As per the passage, the theme of SDG was &lsquo;Sharing Water&rsquo;, and the government authorities expectedly put forth a political declaration, aimed at raising awareness about threats and opportunities associated with water resources.</p>','0',1,'2020-08-31 19:12:25','2020-08-31 19:13:18'),(171,'<p><strong>Read the following passage carefully and answer questions:</strong></p>\r\n\r\n<p>Some 2000 km down south of the Amazon, and about the same time when the tidal waves were at their highest as a consequence of the big clash of sea and freshwater at the Amazon delta most vigorously in March and April (2018), more than 40,000 people were talking about the power of water. Brasilia hosted the eighth edition of the World Water Forum (WWF &ndash; 8), where heads of states, civil societies, and private sector gathered to discuss the present and future of mankind&rsquo;s most valuable resource. This year&rsquo;s theme was &lsquo;Sharing Water&rsquo;, and the government authorities exp