\n			<td>\r\n			<p>62</p>\r\n			</td>\r\n			<td>\r\n			<p>55</p>\r\n			</td>\r\n			<td>\r\n			<p>88</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>Sohan</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>50</p>\r\n			</td>\r\n			<td>\r\n			<p>78</p>\r\n			</td>\r\n			<td>\r\n			<p>70</p>\r\n			</td>\r\n			<td>\r\n			<p>58</p>\r\n			</td>\r\n			<td>\r\n			<p>88</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>Mohini</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>55</p>\r\n			</td>\r\n			<td>\r\n			<p>82</p>\r\n			</td>\r\n			<td>\r\n			<p>65</p>\r\n			</td>\r\n			<td>\r\n			<p>66</p>\r\n			</td>\r\n			<td>\r\n			<p>110</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>Mohan</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>42</p>\r\n			</td>\r\n			<td>\r\n			<p>96</p>\r\n			</td>\r\n			<td>\r\n			<p>64</p>\r\n			</td>\r\n			<td>\r\n			<p>72</p>\r\n			</td>\r\n			<td>\r\n			<p>104</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Find the sum of marks obtained by Rohan in all the subjects.</strong></p>\r\n\r\n<p>&nbsp;</p>','<p>Sum of marks obtained by Rohan in all the subjects = 60 + 52 + 62 + 55 + 88 = 317</p>','0',1,'2020-08-31 19:26:29','2020-08-31 19:26:57'),(179,'<p>Under non- cooperative games, it is</p>','<p>The outcome of the game will depend on the acts of all the players. A fundamental characteristic of non-cooperative games is that it is not possible to sign contracts between players. That is, there is no external institution (for example, courts of justice) capable of enforcing the agreements</p>','0',1,'2020-09-03 13:56:28','2020-09-03 13:57:46'),(180,'<p>Which of the following statements are true regarding the Cobb-Douglas production function?</p>\r\n\r\n<p><strong>Select the correct option: </strong></p>',NULL,'1',1,'2020-09-03 13:59:06','2020-09-03 13:59:06'),(181,'<p>Which of the following methods of selecting strategies is consistent with risk averting behavior?</p>','<p>In economics and finance, risk aversion is the behavior of humans (especially consumers and investors), who, when exposed to uncertainty, attempt to lower that uncertainty.</p>','0',1,'2020-09-03 14:03:01','2020-09-03 14:03:47'),(182,'<p>General&nbsp;equilibrium&nbsp;analysis determines</p>','<p>General equilibrium analyzes the economy as a whole, rather than analyzing single markets like with partial equilibrium analysis. General equilibrium shows how supply and demand interact and tend toward a balance in an economy of multiple markets working at once</p>','0',1,'2020-09-03 14:05:23','2020-09-03 14:06:30'),(183,'<p>The firms are competitive and profit maximizing the demand curve for labour is determined by</p>','<p>Firms may choose to demand many different kinds of inputs. The two most common are labor and capital. The demand and supply of labor are determined in the labor market. The participants in the labor market are workers and firms. Workers supply labor to firms in exchange for wages. Firms demand labor from workers in exchange for wages.</p>\r\n\r\n<p>The firm&#39;s demand for labor is a derived demand; it is derived from the demand for the firm&#39;s output. If demand for the firm&#39;s output increases, the firm will demand more labor and will hire more workers. If demand for the firm&#39;s output falls, the firm will demand less labor and will reduce its work force. When the firm knows the level of demand for its output, it determines how much labor to demand by looking at the marginal revenue product of labor. The marginal revenue product of labor (or any input) is the additional revenue the firm earns by employing one more unit of labor. The marginal revenue product of labor is related to the marginal product of labor. In a perfectly competitive market, the firm&#39;s marginal revenue product of labor is the value of the marginal product of labor.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-03 14:13:08','2020-09-03 14:13:53'),(184,'<p>Pareto&rsquo;s marginal condition for efficiency in composition of output (product-mix) requires</p>',NULL,'0',1,'2020-09-03 14:15:21','2020-09-03 14:15:21'),(185,'<p>Which of the following is an example of public good?</p>','<p>In economics, a public good refers to a commodity or service that is made available to all members of a society. Examples of public goods include law enforcement, national defence, and the rule of law. Public goods also refer to more basic goods, such as access to clean air and drinking water.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-03 14:17:08','2020-09-03 14:17:44'),(186,'<p>The excess supply of a commodity above the no-trade equilibrium price given one nation&rsquo;s?</p>','<p>The excess supply of a commodity above the no-trade equilibrium price gives one nation export supply of the commodity. On the other hand, the excess demand of a commodity below the no-trade equilibrium price gives the other nation import demand for the commodity.</p>','0',1,'2020-09-03 14:18:14','2020-09-03 14:18:53'),(187,'<p>As income falls, consumption declines but proportionately less than the decrease in income because the consumer desires to sustain previous standard of living. This is called?</p>','<p>The ratchet effect, a Keynesian theory, states that once prices have risen in lockstep to a rise in aggregate demand, they do not always reverse when that demand falls.</p>','0',1,'2020-09-03 14:20:17','2020-09-03 14:20:55'),(188,'<p>Which one is NOT axioms of inequality measures?</p>','<p>Axioms, in inequality measurement, are desirable properties of inequality measures. Using axioms may help to choose among inequality indexes. When an inequality index is chosen because it respects some desirable properties, it is said that inequality measurement follows an axiomatic approach.</p>\r\n\r\n<p>Five main axioms will be considered:</p>\r\n\r\n<ul>\r\n	<li>the principle of transfers (also known as the Pigou-Dalton principle)</li>\r\n	<li>cale invariance</li>\r\n	<li>translation invariance</li>\r\n	<li>the principle of population</li>\r\n	<li>decomposability</li>\r\n</ul>','0',1,'2020-09-03 14:21:36','2020-09-03 14:22:19'),(189,'<p>The concept of fiscal deficit implies which of the following?</p>','<p>A fiscal deficit is a shortfall in a government&#39;s income compared with its spending. The government that has a fiscal deficit is spending beyond its means. A fiscal deficit is calculated as a percentage of gross domestic product (GDP), or simply as total dollars spent in excess of income.</p>','0',1,'2020-09-03 14:22:45','2020-09-03 14:23:31'),(190,'<p>Liquidity approach is also known by the name</p>','<p>The latest approach in this respect, which has become popular after Keynes is the &ldquo;Liquidity Theory of Money&rdquo;. This approach became popular in UK after the suggestions of Radcliffe Committee published in July 1959. As a result of the Radcliffe Committee&rsquo;s Report on the Working of the Monetary System in Great Britain and the views of some contemporary European monetary economists like R.S. Sayers of England, Schmolders of Germany and J.G. Gurley and E.S. Shaw of United States, a new theory has been developed, concerning the role of liquid assets on the supply of money and general economic activity popularly called the &lsquo;Liquidity Theory of Money&rsquo;.</p>','0',1,'2020-09-03 14:24:02','2020-09-03 14:24:45'),(191,'<p>Vertical equity in taxation means that</p>','<p>Vertical equity is a method of collecting income tax in which the taxes paid increase with the amount of earned income. The driving principle behind vertical equity is that those who have the ability to pay more taxes should contribute more than those who are not.</p>\r\n\r\n<p>This can be contrasted with horizontal equity, whereby individuals with similar income and assets should pay the same amount in taxes.</p>','0',1,'2020-09-03 14:25:31','2020-09-03 14:26:09'),(192,'<p>The commodity or Net Barter Terms of trade are represented by the formula</p>','<p>In the contemporary world, the concept of net barter terms of trade was introduced by F.W. Taussig. This concept was called as commodity terms of trade by Jacob Viner. It is defined as ratio of export prices to import prices. It can be expressed as: TC = PX/PM</p>\r\n\r\n<p>Here TC = commodity terms of trade or net barter terms of trade, PX = export price, PM = import price. If the net barter terms of trade are to be applied to more than one export and import commodities and the changes in terms of trade over a given period are to be computed, the index numbers of export and import prices rather than prices of individual commodities are taken into account.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-03 14:26:39','2020-09-03 14:29:44'),(193,'<p>The long term chronic unemployment arising from imbalance between the skills and other characteristics of workers in the market and the need of employers is known as</p>','<p>Structural unemployment is a longer-lasting form of unemployment caused by fundamental shifts in an economy and exacerbated by extraneous factors such as technology, competition, and government policy. Structural unemployment occurs because workers&#39; lack the requisite job skills or workers live too far from regions where jobs are available and cannot move closer. Jobs are available, but there is a serious mismatch between what companies need and what workers can offer.</p>','0',1,'2020-09-03 14:30:28','2020-09-03 14:31:05'),(194,'<p>According to Marshall &ndash; Lerner condition for the foreign exchange market to be stable, the sum of the elasticities of demand for imports and the demand for exports should be</p>','<p>The Marshall&ndash;Lerner condition (after Alfred Marshall and Abba P. Lerner) is satisfied if the absolute sum of a country&#39;s export and import demand elasticities (demand responsiveness to price) is greater than one.</p>','0',1,'2020-09-03 14:43:30','2020-09-03 14:44:18'),(195,'<p>In J. Robinson&rsquo;s growth model, capital accumulation depends on</p>','<p>In Harrod-Domar model, the capital accumulation depends upon saving ratio and capital productivity but in Robinson Model, it depends upon the profit wage relation and labour productivity bringing her theory closer to a real market economy.</p>','0',1,'2020-09-03 14:44:53','2020-09-03 14:45:27'),(196,'<p>Which of the following is NOT the method of debt redemption?</p>','<p>Redemption of debt refers to the repayment of a public loan. Although public debt should be paid, debt redemption is desirable too. In order to save the government from bank&shy;ruptcy and to raise the confidence of lenders, the government has to redeem its debts from time to time.</p>\r\n\r\n<p>Sometimes, the government may resort to an extreme step, such as repudiation of debt. This extreme step is, of course, violation of the contract. Use of repudiation of debt by the government is economically unsound.</p>\r\n\r\n<p>Some important method of debt redemption as follows:&nbsp; Refunding, Conversion, Sinking Fund, Capital Levy, Terminal Annuity, Budget Surplus, Additional Taxation, Compulsory Reduction in the Rate of Interest.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-03 14:46:08','2020-09-03 14:46:48'),(197,'<p>A tax is said to be direct, when</p>','<p>A direct tax is a tax an individual or organization pays directly to the imposing entity. A taxpayer, for example, pays direct taxes to the government for different purposes, including real property tax, personal property tax, income tax, or taxes on assets.</p>','0',1,'2020-09-03 14:47:23','2020-09-03 14:48:01'),(198,'<p>In the Balance of Payment Account, the transfer payments are included in which one of the following?</p>','<p>The balance of payments divides transactions in two accounts: the current account and the capital account. Sometimes the capital account is called the financial account, with a separate, usually very small, capital account listed separately. The current account includes transactions in goods, services, investment income, and current transfers.</p>','0',1,'2020-09-03 14:48:45','2020-09-03 14:49:18'),(199,'<p>Which one of the following items is included in the Capital Account of the balance of payment of a country?</p>','<p>The capital account of a country consists of its transaction in financial assets in the form of short-term and long-term lending and borrowings and private and official investments. There are two types of transactions in the capital account-private and government. Private transactions include all types of investments-direct and portfolio and short-term. Government transactions consist of loans to and from foreign official agencies.</p>','0',1,'2020-09-03 15:21:52','2020-09-03 15:22:26'),(200,'<p>Which of the following factors is NOT the cause for &lsquo;market failure&rsquo;?</p>','<p>Reasons for market failure include: positive and negative externalities, environmental concerns, lack of public goods, underprovision of merit goods, overprovision of demerit goods, and abuse of monopoly power.</p>','0',1,'2020-09-03 15:22:54','2020-09-03 15:23:25'),(201,'<p>&lsquo;Immiserizing growth&rsquo; is the term given by</p>','<p>Immiserizing growth is a theoretical situation first proposed by Jagdish Bhagwati, in 1958, where economic growth could result in a country being worse off than before the growth. If growth is heavily export-based it might lead to a fall in the terms of trade of the exporting country.</p>','0',1,'2020-09-03 15:24:28','2020-09-03 15:25:06'),(202,'<p>In efficiency wage model, the real wage is set to</p>',NULL,'0',1,'2020-09-03 15:25:32','2020-09-03 15:25:32'),(203,'<p>Which of the following is NOT the function of a capital market?</p>','<p>Functions of Capital Market:</p>\r\n\r\n<ul>\r\n	<li>It acts in linking investors and savers</li>\r\n	<li>Facilitates the movement of capital to be used more profitability and productively to boost the national income</li>\r\n	<li>Boosts economic growth</li>\r\n	<li>Mobilization of savings to finance long term investment</li>\r\n	<li>Facilitates trading of securities</li>\r\n	<li>Minimization of transaction and information cost</li>\r\n	<li>Encourages a massive range of ownership of productive assets</li>\r\n	<li>Quick valuations of financial instruments</li>\r\n	<li>Through derivative trading, it offers insurance against market or price threats</li>\r\n	<li>Facilitates transaction settlement</li>\r\n	<li>Improvement in the effectiveness of capital allocation</li>\r\n	<li>Continuous availability of funds</li>\r\n</ul>','0',1,'2020-09-03 15:26:30','2020-09-03 15:27:22'),(204,'<p>Which one of the following growth models takes technology as exogenous variable?</p>','<p>In Solow Model, Technological Progress is exogenous because it is determined outside the model, not as a consequence of agents actions. Usually g is a parameter denoting the exogenous rate of technological progress.</p>','0',1,'2020-09-03 15:27:48','2020-09-03 15:28:21'),(205,'<p>Three&nbsp;pillars&nbsp;of&nbsp;the&nbsp;&nbsp;Asia&nbsp;&ndash;Pacific Economic Cooperation (APEC) are</p>\r\n\r\n<p><strong>Choose the correct option:</strong></p>','<p>The Three Pillars of APEC&#39;s agenda focus on :</p>\r\n\r\n<p>1. Trade and Investment Liberalization : APEC members take actions to reduce tariff and non-tariff barriers to trade and investment that boosts job creation, incomes and growth. Collaboration is guided by APEC&#39;s Regional Economic Integration agenda and includes the advancement of bilateral and regional trade agreements and the long-term goal of a Free Trade Area of the Asia-Pacific (FTAAP).</p>\r\n\r\n<p>2. Business Facilitation : APEC members pursue measures to reduce the time, cost and uncertainty of doing business in the region and open new economic opportunities including for small firms, women and youth. APEC&#39;s Structural Reform agenda supports the development and harmonization of policies that improve market access and efficiency, and uphold public interest such as the safeguarding of health and safety.</p>\r\n\r\n<p>3. Economic and Technical Cooperation (ECOTECH) : ECOTECH builds the technical capacity of APEC&#39;s diverse members to promote trade, investment and robust, secure and sustainable economic growth that widely benefits the region&#39;s people. Priorities include strengthening anti-corruption, cross-border education and skills training, emergency preparedness, energy security, environmental protection, defense against pandemics and infrastructure development, among others.</p>','1',1,'2020-09-03 15:29:11','2020-09-03 15:30:39'),(206,'<p>During recession which of the following measures is initiated?</p>','<p>Recessions generally occur when there is a widespread drop in spending (an adverse demand shock). This may be triggered by various events, such as a financial crisis, an external trade shock, an adverse supply shock, the bursting of an economic bubble, or a large-scale natural or anthropogenic disaster (e.g. a pandemic). There was basically need to Increasing&nbsp;&nbsp;&nbsp; tax&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; rates&nbsp;&nbsp;&nbsp;&nbsp; and&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; keeping government spending constant.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-03 15:31:31','2020-09-03 15:32:12'),(207,'<p>A toll tax is a tax based on which of the following?</p>','<p>The benefit principle is a concept in the theory of taxation from public finance. It bases taxes to pay for public-goods expenditures on a politically-revealed willingness to pay for benefits received. The principle is sometimes likened to the function of prices in allocating private goods</p>\r\n\r\n<p>Here are a few of the public services that are currently funded, in some part, on the basis of the benefit principle...</p>\r\n\r\n<p>l Public college tuition (only paid by the people who attend public colleges)</p>\r\n\r\n<p>l National park admission fees (only paid by the people who visit public parks)</p>\r\n\r\n<p>l Fuel taxes (only paid by the people who purchase fuel)</p>\r\n\r\n<p>l Bus fares (only paid by the people who take the bus)</p>\r\n\r\n<p>l Bridge tolls (only paid by people who use the bridge)</p>','0',1,'2020-09-03 15:32:36','2020-09-03 15:39:11'),(208,'<p>Match the following</p>\r\n\r\n<p><strong>Choose the correct option</strong></p>',NULL,'2',1,'2020-09-03 15:39:47','2020-09-03 15:42:59'),(209,'<p>By &lsquo;financial crowding out&rsquo; economist mean</p>','<p><strong>:</strong> A situation when increased interest rates lead to a reduction in private investment spending such that it dampens the initial increase of total investment spending is called crowding out effect.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Description: Sometimes, government adopts an expansionary fiscal policy stance and increases its spending to boost the economic activity. This leads to an increase in interest rates. Increased interest rates affect private investment decisions. A high magnitude of the crowding out effect may even lead to lesser income in the economy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>With higher interest rates, the cost for funds to be invested increases and affects their accessibility to debt financing mechanisms. This leads to lesser investment ultimately and crowds out the impact of the initial rise in the total investment spending. Usually the initial increase in government spending is funded using higher taxes or borrowing on part of the government.</p>','0',1,'2020-09-03 15:43:36','2020-09-03 15:45:29'),(210,'<p>Which of the following is NOT part of Wiseman and Peacock hypothesis?</p>','<p>Peacock and Jack Wiseman advanced the study of growth of public expenditure through Peacock Wiseman Hypothesis by their study of public expenditure at Great Britain during 1890 to 1955.</p>\r\n\r\n<p>Peacock Wiseman Hypothesis focused on the pattern of public expenditure and stated that public expenditure does not follow a smooth or continuous trend but the increase in public expenditure takes place in jerks or steps. They gave separate concepts to justify the hypothesis, they are:</p>\r\n\r\n<p>l Displacement Effect</p>\r\n\r\n<p>l Inspection Effect</p>\r\n\r\n<p>l Concentration effect</p>','0',1,'2020-09-03 15:45:57','2020-09-03 15:46:39'),(211,'<p>Which consideration a commercial bank does NOT keep in mind to manage its assets and liabilities?</p>','<p>A commercial bank has to manage its assets and liabilities with three considerations in mind, namely, liquidity, profitability, and solvency.</p>','0',1,'2020-09-03 18:16:58','2020-09-03 18:17:36'),(212,'<p>External drains leave which type of impact on commercial bank?</p>','<p>The most important factor, according to Whittlesey, which restricts credit expansion, is &quot;external drain&quot;. As we have seen, on the basis of the excess reserve, commercial banks can expand their credit by creating demand deposits. Some of the borrowers from these banks are likely to withdraw part of their deposits in currency. Every rupee in cash that is withdrawn from the banking system lowers the reserves of the banks, and thus checks further deposit expansion.</p>','0',1,'2020-09-03 18:18:05','2020-09-03 18:18:39'),(213,'<p>Assumes that an economy begins in macroeconomic equilibrium, then taxes are significantly decreased. As a result of this change</p>','<p>Tax rate cuts may encourage individuals to work, save, and invest, but if the tax cuts are not financed by immediate spending cuts, they will likely also result in an increased federal budget deficit, which in the long-term will reduce national saving and raise interest rates.</p>','0',1,'2020-09-03 18:23:31','2020-09-03 18:24:11'),(214,'<p>An increase in money supply will increase the demand for goods and services by</p>','<p>The increase in the money supply is mirrored by an equal increase in nominal output, or Gross Domestic Product (GDP). In addition, the increase in the money supply will lead to an increase in consumer spending. This increase will shift the aggregate demand curve to the right.</p>','0',1,'2020-09-03 18:24:34','2020-09-03 18:25:09'),(215,'<p>The provision under the membership clause of the IMF is that any country can become a member if</p>','<p>When a country borrows from the IMF, its government agrees to adjust its economic policies to overcome the problems that led it to seek financial aid. These policy adjustments are conditions for IMF loans and serve to ensure that the country will be able to repay the IMF. This system of conditionality is designed to promote national ownership of strong and effective policies.</p>','0',1,'2020-09-03 18:25:37','2020-09-03 18:26:32'),(216,'<p>Match the following</p>\r\n\r\n<p><strong>Choose the correct option</strong></p>\r\n\r\n<p>&nbsp;</p>',NULL,'0',1,'2020-09-03 18:27:58','2020-09-03 18:27:58'),(217,'<p>Match the following</p>\r\n\r\n<p><strong>Choose the correct option</strong></p>\r\n\r\n<p>&nbsp;</p>',NULL,'2',1,'2020-09-03 18:28:07','2020-09-03 18:28:07'),(218,'<p>A foreign exchange risk involves the transaction exposure, the accounting exposure and</p>','<p>Growth of international business has led to an increasing exposure to foreign exchange risk for many companies. Foreign exchange dealing results in three major kinds of exposure including transaction exposure, economic exposure and translation exposure.</p>','0',1,'2020-09-03 18:30:49','2020-09-03 18:31:27'),(219,'<p>Which is NOT the main objective of credit control?</p>','<p>In recent years, the principal objective of credit control is to have growth with stability. The aim of credit control is to help in achieving full employment and accelerated growth with stability in the economy without inflationary pressures and balance of payments deficits.</p>','0',1,'2020-09-03 18:32:23','2020-09-03 18:33:07'),(220,'<p>Match the following List-I</p>\r\n\r\n<p><strong>Choose the correct option:</strong></p>',NULL,'2',1,'2020-09-03 18:34:12','2020-09-03 18:34:12'),(221,'<p>According to Marxian analysis the surplus value depends upon</p>','<p>Surplus value is a central concept in Karl Marx&#39;s critique of political economy. Marx&#39;s solution was to distinguish between labor-time worked and labor power. A worker who is sufficiently productive can produce an output value greater than what it costs to hire him. Although his wage seems to be based on hours worked, in an economic sense this wage does not reflect the full value of what the worker produces. Effectively it is not labour which the worker sells, but his capacity to work. Thus according to Marxian analysis the surplus value depends upon surplus and necessary labour time.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-03 18:35:54','2020-09-03 18:36:33'),(222,'<p>The liquidity aggregates are classified as</p>','<p>Aggregate liquidity refers to the ease of execution for financial transactions for everyone in the entire market which is highly dependent on the availability of credit in the markets and the size of the money supply in a country. The following Liquidity aggregates have been formulated for monitoring the state of liquidity in an economy.</p>\r\n\r\n<p>L1=M3+Postal Deposits (excluding National Saving Certificate)</p>\r\n\r\n<p>L2= L1+Term Money Borrowings, Certificate of Deposits and Term Deposits of Financial Institutions like IDBI, IFCI, Exim Bank, NABARD, SIDBI etc.</p>\r\n\r\n<p>L3= L2+ Public Deposit with non-banking financial institutions.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-03 18:37:01','2020-09-03 18:37:56'),(223,'<p>During a depression which of the following policy instruments should be used?</p>','<p>During a depression, a deficit budget can be created in the following ways :</p>\r\n\r\n<p>(i) The level of public expenditure is kept unchanged but the taxation rates are reduced.</p>\r\n\r\n<p>(ii) Taxation rates are kept unchanged but public expenditure is increased.</p>\r\n\r\n<p>The second method is regarded as more significant as an anti-depressionary measure. This excess of expenditure may be financed through public borrowings plus deficit financing, i.e., creation of new money.</p>','0',1,'2020-09-03 18:38:27','2020-09-03 18:39:00'),(224,'<p>Which one of the following does NOT determine the amount of years of schooling demanded by an individual to qualify for modern job?</p>','<p>Expansion of healthcare infrastructure in urban sector is depended on Government allocation and its different central schemes and the amount of years of schooling demanded by an individual to qualify for modern job.</p>','0',1,'2020-09-03 18:39:26','2020-09-03 18:40:00'),(225,'<p>Who among the following is not associated with the endogenous growth theory?</p>','<p>In the mid-1980s, a group of growth theorists became increasingly dissatisfied with common accounts of exogenous factors determining long-run growth. They favored a model that replaced the exogenous growth variable (unexplained technical progress) with a model in which the key determinants of growth were explicit in the model. The work of Kenneth Arrow (1962), Hirofumi Uzawa (1965), and Miguel Sidrauski (1967) formed the basis for this research. Paul Romer (1986), Robert Lucas (1988), Sergio Rebelo (1991) and Ortigueira and Santos (1997) omitted technological change; instead, growth in these models is due to indefinite investment in human capital which had a spillover effect on the economy and reduces the diminishing return to capital accumulation.</p>','0',1,'2020-09-03 18:40:35','2020-09-03 18:41:37'),(226,'<p>Under which system the central bank is authorized by law to issue a fixed amount of notes against government securities and any excess is to be fully backed by gold/silver?</p>','<p>Under the fixed fiduciary system, the central bank is authorised to issue only a fixed amount of currency notes against government securities. All notes issued in excess of this limit should be fully backed by gold and silver reserves. Fiduciary issue means the issue of currency notes without the backing of gold and silver. This system was first introduced in England under the Bank Charter Act of 1844 and still prevails there. India followed this system between 1862 to 1920.</p>','0',1,'2020-09-03 18:42:22','2020-09-03 18:42:55'),(227,'<p>The rational expectations hypothesis suggests that the forcasts that people make concerning future inflation rates</p>','<p>Rational expectations &ndash; an economic theory that states &ndash; when making decisions, individual agents will base their decisions on the best information available and learn from past trends. Rational expectations suggest that although people may be wrong some of the time, on average they will be correct. In particular, rational expectations assumes that people learn from past mistakes.</p>','0',1,'2020-09-03 18:43:37','2020-09-03 18:44:15'),(228,'<p>In an open economy input output model, the viability is examined by</p>','<p>The Hawkins-Simon condition refers to a result in mathematical economics, attributed to David Hawkins and Herbert A. Simon, that guarantees the existence of a non-negative output vector that solves the equilibrium relation in the input-output model where demand equals supply. More precisely, it states a condition for [I &ndash; A] under which the input-output system</p>\r\n\r\n<p>[I &ndash; A].x = d</p>\r\n\r\n<p>has a solution&nbsp; for any . Here I is the identity matrix and A is called the input-output matrix or Leontief after Wassily Leontief, who empirically estimated it in the 1940s.</p>\r\n\r\n<p>The Hawkins-Simon Condition therefore is to check for the Viability of an Open Economy.</p>','0',1,'2020-09-03 18:44:57','2020-09-03 18:45:32'),(229,'<p>When the null hypothesis is there as an equality the level of significance is the probability of making</p>','<p><strong>Null Hypothesis ( H0 )</strong> : Statement of zero or no change. If the original claim includes equality (&lt;=, =, or &gt;=), it is the null hypothesis. If the original claim does not include equality (&lt;, not equal, &gt;) then the null hypothesis is the complement of the original claim. The null hypothesis always includes the equal sign. The decision is based on the null hypothesis.</p>\r\n\r\n<p><strong>Alternative Hypothesis ( H1 or Ha ):</strong> Statement which is true if the null hypothesis is false. The type of test (left, right, or two-tail) is based on the alternative hypothesis.</p>\r\n\r\n<p><strong>Type I error</strong></p>\r\n\r\n<p>Rejecting the null hypothesis when it is true (saying false when true). Usually the more serious error.</p>\r\n\r\n<p><strong>Type II error</strong></p>\r\n\r\n<p>Failing to reject the null hypothesis when it is false (saying true when false).</p>\r\n\r\n<p><strong>Significance level ( alpha ): </strong>The probability of rejecting the null hypothesis when it is true. alpha = 0.05 and alpha = 0.01 are common. If no level of significance is given, use alpha = 0.05. The level of significance is the complement of the level of confidence in estimation.</p>','0',1,'2020-09-03 18:45:55','2020-09-03 18:46:29'),(230,'<p>In 2011 the proportion of urban population was more than 40% in the states of</p>','<p>People in Tamil Nadu have moved from rural to urban areas the last 10 years compared to other states, according to the 2011 Census data. Tamil Nadu tops the list of urbanised states with 48.45% of its population living in urban areas, followed by Kerala, Maharashtra and Gujarat</p>','0',1,'2020-09-03 18:46:55','2020-09-03 18:47:29'),(231,'<p>Which age structure is important for demographic dividend?</p>','<p>Demographic dividend, as defined by the United Nations Population Fund (UNFPA) means, &quot;the economic growth potential that can result from shifts in a population&rsquo;s age structure, mainly when the share of the working-age population (15 to 64) is larger than the non-working-age share of the population (14 and younger, and 65 and older)&quot;.[1] In other words, it is &ldquo;a boost in economic productivity that occurs when there are growing numbers of people in the workforce relative to the number of dependents.&rdquo; UNFPA stated that, &ldquo;A country with both increasing numbers of young people and declining fertility has the potential to reap a demographic dividend.</p>','0',1,'2020-09-03 18:47:58','2020-09-03 18:52:06'),(232,'<p>The RBI made Indian rupee fully convertible in current account transactions related to goods and services in the year</p>','<p>Prior to the First World War the whole world was having gold standard under which the currency in circulation was allowed to get converted either in gold or other currencies based on the gold standard.&nbsp; But after the failure of Bretton woods system in 1971 this system changed. Presently convertibility of money implies a system where a country&#39;s currency becomes convertible in foreign exchange and vice versa. Since 1994, Indian rupee has been made fully convertible in current account transactions.</p>','0',1,'2020-09-03 18:52:37','2020-09-03 18:53:14'),(233,'<p>The IRR is the discount rate that equates the project NPV to _ and benefit- cost ratio to _.</p>','<p>The internal rate of return (IRR) of a project is the discount rate that would yield a net present value (NPV) of zero, i.e., the rate of interest which makes the present value of the estimated cash inflow equal to the present value of the cash outflow required by the investment.</p>\r\n\r\n<p>Profitability Index (PI) is a capital budgeting technique to evaluate the investment projects for their viability or profitability. Discounted cash flow technique is used in arriving at the profitability index. It is also known as a benefit-cost ratio. Calculation of profitability index is possible with a simple formula with inputs as &ndash; discount rate, cash inflows, and outflows. PI greater than or equal to 1 is interpreted as a good and acceptable criterion.</p>\r\n\r\n<p>Hence, the correct answer is NPV should be 0 and benefit-cost ratio 1.</p>','0',1,'2020-09-03 18:53:42','2020-09-03 18:54:14'),(234,'<p>Under TRIPS protection for copyrights is for</p>','<p>TRIPS requires member states to provide strong protection for intellectual property rights. For example, under TRIPS: Copyright terms must extend at least 50 years, unless based on the life of the author.</p>','0',1,'2020-09-03 18:54:59','2020-09-03 18:55:39'),(235,'<p>Second National Commission on labour has recommended a three-tier system including</p>','<p>The Second&nbsp; National Commission has recommended a three-tier system of Lok Adalats, Labour Courts and the Labour Relation Commission. While the Lok Adalats and Labour Courts deal with individual grievances and complaints, the Labour Relations Commission has been empowered to deal with both individual problems and those of collective bargaining a settlement cannot be reached through bilateral negotiations.</p>','0',1,'2020-09-03 18:56:03','2020-09-03 18:56:38'),(236,'<p>Arrange in chronological order the following economists in relation to the contribution to the theory of consumer behaviour.</p>\r\n\r\n<p>Choose the correct answers</p>','<p><strong>A. Marshal</strong> (1931) has developed the theory of cardinal utility measure, which implies that utility is a measurable and quantifiable entity. The breakthrough occurred when a theory of&nbsp;ordinal utility&nbsp;was put together by&nbsp;<strong>John Hicks&nbsp;and&nbsp;Roy Allen</strong>&nbsp;in 1934. They have tried to measure utility by the Indifference curve analysis. <strong>P. Samuelson and R. Stone</strong> have developed Revealed Preference Theory in 1948, Which postulate that Consumer theory depends on the existence of&nbsp;preferences&nbsp;which materialise into&nbsp;utility functions.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-03 19:10:00','2020-09-03 19:10:47'),(237,'<p>Assertion (A): For certain goods, the expenditure by the consumer decreases.</p>\r\n\r\n<p>Reason (B): For such goods, the income elasticity of demand is high</p>','<p>Income elasticity of demand measures the responsiveness of&nbsp;demand&nbsp;for a particular good to changes in consumer income. The higher the income elasticity of demand in absolute terms for a particular good, the bigger consumers&#39; response in their purchasing habits&mdash;if their real income changes.&nbsp;</p>','0',1,'2020-09-03 19:11:54','2020-09-03 19:12:42'),(238,'<p>Assertion (A): CES production function covers large class of production functions</p>\r\n\r\n<p>Reason (R): CES production function has the property of constancy of elasticity of factor substitution</p>','<p>Arrow, Chenery, Minhas and Solow in their new famous paper of 1961 developed the Constant Elasticity of Substitution (CES) function. Q = A [aC-&theta;+ (l-&alpha;)L-&theta;]&nbsp;-1/&theta;. where Q is the total output, ? is capital, and L is labour. A is the efficiency parameter indicating the state of technology and organisational aspects of production.</p>\r\n\r\n<p>Properties of CES:</p>\r\n\r\n<ol>\r\n	<li>The CES production function is homogeneous of degree one.</li>\r\n	<li>The elasticity of substitution is constant but not necessarily equal to unity.</li>\r\n	<li>The parameter (&theta;) in the CES production function determines the elasticity of substitution. In this function, the elasticity of substitution, &sigma; = 1/ 1 + &theta;</li>\r\n</ol>\r\n\r\n<p>This shows that the elasticity of substitution is a constant whose magnitude depends on the value of the parameter &theta;. If &theta; =0, then &sigma; = 1. If &theta; = &infin;, then &sigma; =0. If &theta; = -1, then &sigma; =&infin;. This reveals that when &sigma; = 1, the CES production function becomes the Cobb-Douglas production function. So, the elasticity of substitution ranges from 0 to &infin;.</p>\r\n\r\n<ul>\r\n	<li>The last property reveals that CES function is large class of function which determine by the Parameter &theta; with constancy of elasticity of factor substitution.&nbsp;</li>\r\n</ul>','0',1,'2020-09-03 19:13:32','2020-09-03 19:14:15'),(239,'<p>Which of the following is the correct sequence in the ascending order of the magnitude?</p>','<p><strong>Repo Rate</strong> was introduced in Dec. 1992, by RBI. It is the rate, at which RBI lends short-term money to the Banks against securities.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Reverse Repo Rate </strong>is the interest rate at which the RBI borrows money from banks for the short term is defined as Reverse Repo Rate.&nbsp;Which generally determine by the basic of Repo Rate and its always lower then Repo Rate. It was introduced in Nov. 1996.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>MSFR(Marginal Standing Facility Rate)</strong> Scheme came into effect in 2011. It was very short-term borrowing scheme for scheduled commercial banks. MSFR is the rate which these banks can borrow funds overnight from RBI against government securities. The MSF rate is pegged 100 basis points or a percentage point above the repo rate.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>SLR( Statutory Liquidity Rate) </strong>Statutory Liquidity Ratio (SLR) is the govt term for the reserve demand that commercial banks are required to maintain in the form of cash, gold reserves and Reserve Bank of India (RBI) approved securities before giving credit to the customers. SLR is always high with compared to above mention three rate.</p>','0',1,'2020-09-03 19:14:43','2020-09-03 19:15:23'),(240,'<p>Match the following</p>\r\n\r\n<p><strong>Choose the correct option:</strong></p>\r\n\r\n<p>&nbsp;</p>','<p><strong>Forward Exchange</strong> involves an agreement today to buy or sell a specified amount of a foreign currency at a specified future date at a rate agreed upon today, this is called forward rate.<strong> </strong></p>\r\n\r\n<p><strong>Arbitrage: </strong>This refers to the purchase of a currency in the monetary center where it is cheaper, for immediate resale in the monetary center where it is more expensive, in order to make a profit. The exchange rate between any two currencies is kept the same in different monetary centers by arbitrage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hedging</strong>: Foreign exchange risk is the threat of financial loss as a result of changes to foreign exchange rates. The risk can occur when a financial transaction takes place using a currency that&rsquo;s different to the base currency of the company or individual, and value is lost before the transaction is completed.<strong> </strong>Hedging is refers to the avoidance of a foreign exchange risk, or the covering of an open position.</p>\r\n\r\n<p><strong>Specie Point: </strong>The movement of exchange rate between two limits set by the cost of moving gold from one country to another</p>','2',1,'2020-09-03 19:16:50','2020-09-03 19:19:09'),(241,'<p>The &lsquo;Compensation Criterion&rsquo; which says that state A is socially preferable to state B, if those who gain from the change can compensate the looser and yet end up with surplus welfare gain is attributed to :</p>','<p>In&nbsp;welfare economics, compensation criteria or the compensation principle is known as a rule of decision for selecting between two alternative states. According to <strong>Kaldor </strong>compensation principle, Two states will be compared; if one state provides an improvement for one part but causes deterioration in the state of the other, it will be chosen if the winner can compensate the loser&rsquo; losses until they situation is at least as good as in the initial situation.</p>','0',1,'2020-09-03 19:19:40','2020-09-03 19:20:19'),(242,'<p>Which amongst the following market forms leads to most efficient allocation of resources?</p>','<p>Allocative efficiency: Allocative efficiency occurs when the value consumers put on the good or service equals the cost of producing the product or service. In other words, when price = marginal cost or P = MC. This condition only possible in perfect competitive market. &nbsp;&nbsp;</p>','0',1,'2020-09-03 19:20:44','2020-09-03 19:21:22'),(243,'<p>For oil-importing countries, the increase in oil prices in the 1970&rsquo;s and mid-2000 contributed to which of the following:</p>\r\n\r\n<p><strong>Choose the correct option</strong></p>','<p>In the post-World War II&nbsp;period there have been two major oil crises. The first occurred in 1973, when Arab members of&nbsp;OPEC&nbsp;(Organization of the Petroleum Exporting Countries) decided to quadruple the price of oil to almost $12 a barrel. Oil exports to the United States, Japan, and Western Europe, which together consumed more than half the world&rsquo;s energy, were also prohibited. OPEC&rsquo;s decision was made in retaliation for Western support of Israel against Egypt and Syria during the&nbsp;Yom Kippur War&nbsp;(1973) and in response to a persistent decline in the value of the U.S. dollar (the denominated currency for oil sales), which had eroded the export earnings of OPEC states. With the global capitalist economy already experiencing difficulties, these actions precipitated a steep recession accompanied by rising inflation. This forced capitalist countries to embark on a process of economic restructuring in order to reduce their dependency on oil and prompted fears that the United States might take military action in order to secure free access to its energy supplies. Although the oil embargo was lifted in 1974, oil prices remained high, and the capitalist world economy continued to stagnate throughout the 1970s.</p>\r\n\r\n<p>Another major oil crisis occurred in 1979, a result of the&nbsp;Iranian Revolution&nbsp;(1978&ndash;79). High levels of social unrest severely damaged the Iranian oil industry, leading to a large loss of output and a corresponding rise in prices. The situation worsened following the outbreak of the&nbsp;Iran-Iraq War&nbsp;(1980&ndash;88), which further added to the level of instability throughout the region. In 1981 the price of oil was stabilized at $32 per barrel. By 1983, however, major capitalist economies had adopted more-efficient methods of production, and the problems of the 1970s had been transformed into a relative oversupply of oil rather than a shortage.</p>','1',1,'2020-09-03 19:22:02','2020-09-03 19:23:11'),(244,'<p>Match the following</p>\r\n\r\n<p><strong>Choose the correct answer:</strong></p>\r\n\r\n<p>&nbsp;</p>',NULL,'1',1,'2020-09-03 19:24:09','2020-09-03 19:24:09'),(245,'<p>Match the following</p>\r\n\r\n<p><strong>Choose the correct answer:</strong></p>\r\n\r\n<p>&nbsp;</p>','<p>By far the most widely-used measure is the headcount index, which simply measures the proportion of the population that is counted as poor.</p>\r\n\r\n<p>The poverty gap (PG) is defined as the&nbsp;extent to which individuals on average fall below the poverty line, and expresses it as a percentage of the poverty line, or, in other words, the average difference between poor households&#39; income and the poverty line.</p>\r\n\r\n<p>To construct a measure of poverty that takes into account inequality among the poor, some researchers use the squared poverty gap index. This is simply a weighted sum of poverty gaps (as a proportion of the poverty line), where the weights are the proportionate poverty gaps themselves.</p>\r\n\r\n<p>The Multidimensional Poverty Index (MPI) identifies multiple deprivations at the household and individual level in health, education and standard of living.</p>','2',1,'2020-09-03 19:24:33','2020-09-03 19:26:18'),(246,'<p>The phenomenon of &lsquo;Demographic Dividend&rsquo; is related to which of the following?</p>','<p>According to&nbsp;United Nations Population Fund (UNFPA),&nbsp;demographic dividend means,&nbsp;&quot;the economic growth potential that can result from shifts in a population&rsquo;s age structure, mainly when the share of the working-age population (15 to 64) is larger than the non-working-age share of the population (14 and younger, and 65 and older)&quot;.</p>','0',1,'2020-09-03 19:26:48','2020-09-03 19:27:23'),(247,'<p>Heckscher - Ohlin trade&nbsp;&nbsp;&nbsp;&nbsp; model maintains that:</p>','<p><strong>Heckscher&ndash; Ohlin theorem as follows:</strong> A nation will export the commodity whose production requires the intensive use of the nation&rsquo;s relatively abundant and cheap factor and import the commodity whose production requires the intensive use of the nation&rsquo;s relatively scarce and expensive factor. In short, the relatively labor-rich nation exports the relatively labor-intensive commodity and imports the relatively capital-intensive commodity.</p>\r\n\r\n<p>Now, Nation 1 exports commodity X because commodity X is the L-intensive commodity and L is the relatively abundant and cheap factor in Nation 1. Conversely, Nation 2 exports commodity Y because commodity Y is the K-intensive commodity and K is the relatively abundant and cheap factor in Nation 2.</p>\r\n\r\n<p>The H&ndash;O theorem isolates the difference in relative factor abundance, or factor endowments, among nations as the basic cause or determinant of comparative advantage and international trade. For this reason, the H&ndash;O model is often referred to as the factor-proportions or factor-endowment theory. That is, each nation specializes in the production and export of the commodity intensive in its relatively abundant and cheap factor and imports the commodity intensive in its relatively scarce and expensive factor.</p>','0',1,'2020-09-03 19:27:49','2020-09-03 19:28:28'),(248,'<p>Which among the following is not associated with the Optimum Theory of Population?</p>','<p>The optimum theory of population was propounded by <strong>Edwin Cannan</strong> in his book Wealth published in 1924 and popularised by <strong>Robbins, Dalton </strong>and<strong> Carr-Saunders</strong>. The optimum population is the ideal population which combined with the other available resources or means of production of the country will yield the maximum returns or income per head.</p>','0',1,'2020-09-03 19:28:55','2020-09-03 19:29:35'),(249,'<p>Arrange&nbsp;the following&nbsp;events&nbsp; in chronological order+</p>\r\n\r\n<p>Choose the correct option:</p>','<p>In India, Nationalization of banks was done in 2 phases. The first phase of nationalization commenced in the year 1955 when the former Imperial Bank of India became the State Bank of India with the Act of parliament.</p>\r\n\r\n<p>The Narasimham Committee submitted its report in November, 1991 and the report was placed before the parliament on December 17, 1991. In its report the Narasimham Committee has acknowledged the success of the public sector banks in respect of branch expansion, deposit mobilization in household sector, priority sector lending and removal of regional disparities in banking.&nbsp;</p>\r\n\r\n<p>In the budget of 1997-98, the government had proposed to replace FERA-1973, by FEMA (Foreign Exchange management act). FEMA was proposed by the both house of the parliament in Dec. 1999. After the approval of president, FEMA 1999 has come into force in June, 2000. Under the FEMA, provisions related to foreign exchange have been modified and liberalized so as to simplify foreign trade. Government hopes that the FEMA will make favourable development in the foreign money market.</p>\r\n\r\n<p>Export-Import Bank of India (EXIM Bank) is a specialized financial institution, wholly owned by Government of India, set up in 1982, for financing, facilitating and promoting foreign trade of India.</p>','1',1,'2020-09-03 19:30:18','2020-09-03 19:31:31'),(250,'<p>On which date and year GST become effective in India?</p>','<p>GST implemented in India from 1st&nbsp; July 2017 GST, which was publicised as &lsquo;one nation, one tax&rsquo; by the government, aims to provide a simplified, single tax regime in line with the tax framework applicable in several major economies across the Globe. This single tax has helped streamline various indirect taxes and brought in more efficiencies in business. GST law in India is a&nbsp;comprehensive,&nbsp;multi-stage,&nbsp;destination-based tax&nbsp;that is levied on every&nbsp;value addition.</p>\r\n\r\n<p>The GST rate in India for various goods and services is divided under 4 slabs; these are&nbsp;5%&nbsp;GST, 12% GST,&nbsp;18%&nbsp;GST, and&nbsp;28%&nbsp;GST.</p>','0',1,'2020-09-03 19:32:17','2020-09-03 19:33:01'),(251,'<p>Choose the correct option for which the allocation of inputs is technically efficient?</p>\r\n\r\n<p><strong>Choose the correct option:</strong></p>','<p>Technical efficiency is the effectiveness with which a given set of inputs is used to produce an output. A firm is said to be technically efficient if a firm is producing the maximum output from the minimum quantity of inputs, such as labour, capital, and technology. This concept is solely associate with the production process therefore, option b and c is not sustained. This is the situation a firm is producing the maximum output. So, output of one good cannot be decreased without increasing the output of another good</p>','1',1,'2020-09-03 19:33:42','2020-09-03 19:35:14'),(252,'<p>Which among the following are the main pillars of the BASEL III norms?</p>\r\n\r\n<p><strong>Choose the correct option:</strong></p>','<p>Basel III or Basel 3 released in December, 2010 is the third in the series of Basel Accords. These accords deal with risk management aspects for the banking sector.</p>\r\n\r\n<p>Basel III measures aim to:</p>\r\n\r\n<ol>\r\n	<li>Improve the banking sector&#39;s ability to absorb ups and downs arising from financial and economic instability</li>\r\n	<li>Improve risk management ability and governance of banking sector</li>\r\n</ol>\r\n\r\n<p>Strengthen banks&#39; transparency and disclosures</p>','1',1,'2020-09-03 19:35:56','2020-09-03 19:37:10'),(253,'<p><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>T</mi><mi>h</mi><mi>e</mi><mo>&#160;</mo><mi>e</mi><mi>l</mi><mi>e</mi><mi>m</mi><mi>e</mi><mi>n</mi><mi>t</mi><mi>s</mi><mo>&#160;</mo><mi>g</mi><mi>i</mi><mi>v</mi><mi>e</mi><mi>n</mi><mo>&#160;</mo><mi>b</mi><mi>e</mi><mi>l</mi><mi>o</mi><mi>w</mi><mo>&#160;</mo><mi>a</mi><mi>r</mi><mi>e</mi><mo>&#160;</mo><mi>s</mi><mi>o</mi><mi>m</mi><mi>e</mi><mo>&#160;</mo><mi>o</mi><mi>f</mi><mo>&#160;</mo><mi>t</mi><mi>h</mi><mi>e</mi><mo>&#160;</mo><mi>p</mi><mi>a</mi><mi>r</mi><mi>t</mi><mi>s</mi><mo>&#160;</mo><mi>o</mi><mi>f</mi><mo>&#160;</mo><mi>t</mi><mi>h</mi><mi>e</mi><mo>&#160;</mo><msub><mi>M</mi><mn>4</mn></msub><mo>&#160;</mo><mi>m</mi><mi>o</mi><mi>n</mi><mi>e</mi><mi>y</mi><mo>&#160;</mo><mi>s</mi><mi>u</mi><mi>p</mi><mi>p</mi><mi>l</mi><mi>y</mi><mo>&#160;</mo><mi>o</mi><mi>f</mi><mo>&#160;</mo><mi>I</mi><mi>n</mi><mi>d</mi><mi>i</mi><mi>a</mi><mi>n</mi><mo>&#160;</mo><mi>e</mi><mi>c</mi><mi>o</mi><mi>n</mi><mi>o</mi><mi>m</mi><mi>y</mi><mspace linebreak=\"newline\"/><mi>C</mi><mi>h</mi><mi>o</mi><mi>o</mi><mi>s</mi><mi>e</mi><mo>&#160;</mo><mi>t</mi><mi>h</mi><mi>e</mi><mo>&#160;</mo><mi>c</mi><mi>o</mi><mi>r</mi><mi>r</mi><mi>e</mi><mi>c</mi><mi>t</mi><mo>&#160;</mo><mi>o</mi><mi>p</mi><mi>t</mi><mi>i</mi><mi>o</mi><mi>n</mi><mo>&#160;</mo><mi>w</mi><mi>h</mi><mi>i</mi><mi>c</mi><mi>h</mi><mo>&#160;</mo><mi>c</mi><mi>o</mi><mi>n</mi><mi>s</mi><mi>t</mi><mi>i</mi><mi>t</mi><mi>u</mi><mi>t</mi><mi>e</mi><mo>&#160;</mo><msub><mi>M</mi><mn>4</mn></msub></math></p>','<ol>\r\n	<li>Reserve Money (M0):&nbsp;It is also known as High-Powered Money, monetary base, base money etc.<br />\r\n	M0 = Currency in Circulation + Bankers&rsquo; Deposits with RBI + Other deposits with RBI<br />\r\n	It is the monetary base of economy.</li>\r\n	<li>Narrow Money (M1):<br />\r\n	M1 = Currency with public + Demand deposits with the Banking system (current account, saving account) + Other deposits with RBI</li>\r\n	<li>M2 = M1 + Savings deposits of post office savings banks</li>\r\n	<li>Broad Money (M3)<br />\r\n	M3 = M1 + Time deposits with the banking system</li>\r\n	<li>M4 = M3 + All deposits with post office savings banks</li>\r\n</ol>','1',1,'2020-09-03 21:22:49','2020-09-03 21:25:40'),(254,'<p>Which trade policy results in the government levying both a specific tariff and an advalorem tariff on imported goods?</p>','<p><strong>Types of Tariff</strong></p>\r\n\r\n<p>The following types of tariff duties are levied: (i) ad valorem tariff, (ii) specific tariff. (iii) compound tariff, and (iv) sliding scale tariff</p>\r\n\r\n<p><strong>(i) Ad Valorem Tariff</strong>: The most common type of import duty is the ad valorem tariff Ad valorem import duty is imposed as a percentage of the value of the imported commodity. The import duty is a fixed percentage of the C.I.F. (cost, insurance and freight) value of commodity.</p>\r\n\r\n<p><strong>(ii) Specific Duty:</strong> Specific import duty is imposed by the government on the basis of number of units imported. In other words, specific duty is levied per physical unit of the imported commodity.</p>\r\n\r\n<p><strong>(iii) Compound Tariff:</strong> Compound import duty is a combination of the ad valorem and the specific duties. In this case, a specific duty is imposed on each unit of the commodity plus a percentage of ad valorem also.</p>\r\n\r\n<p><strong>(iv)Sliding Scale Tariff:</strong> Sliding tariff is imposed on ad valorem basis or on specific basis. Sliding import duties van&#39; with the prices of commodities imported.</p>','0',1,'2020-09-03 21:26:04','2020-09-03 21:26:41'),(255,'<p>Kaldor&rsquo;s growth model incorporates some of the following assumptions</p>\r\n\r\n<p><strong>Choose the correct option:</strong></p>','<p>Assumption of kaldor growth model:</p>\r\n\r\n<p>1. There are two factors of production capital and labour (K and L) and thus only two types of income profits and wages (P and W). All profits are saved and all wages are consumed.</p>\r\n\r\n<p>2. There are constant returns to scale and production function remains unchanged over time. Capital and labour are complementary.</p>\r\n\r\n<p>3. There is perfect competition as such the rates of wages and profits are same over different places.</p>\r\n\r\n<p>4. The marginal propensity to consume of workers is greater than that of capitalists.</p>\r\n\r\n<p>5. The investment-income (output) into (I/Y) is an independent variable.</p>\r\n\r\n<p>6. There is a state of full employment so that total output or income (Y) is given.</p>\r\n\r\n<p>7. There is an unlimited supply of labour at a constant wage in terms of wage goods.</p>','1',1,'2020-09-03 21:28:26','2020-09-03 21:29:59'),(256,'<p>Assertion (A): Intellectual Property Rights were brought into the Uruguay Round Trade Negotiations</p>\r\n\r\n<p>Reason (R): International trade restrictions can be used to discourage the violation of intellectual property rights</p>','<p>The WTO&rsquo;s&nbsp;<strong>Agreement on Trade-Related Aspects of Intellectual Property Rights (TRIPS)</strong>, negotiated during the 1986-94 in Uruguay Round, introduced intellectual property rules into the multilateral trading system for the first time. Violation of intellectual property rights briefly discussed in Doha round.&nbsp;</p>','0',1,'2020-09-03 21:30:29','2020-09-03 21:31:15'),(257,'<p>Which is correct chronological order of Economists contributing to input - output analysis?</p>','<p>The preliminary version of input- output analysis was attributed by Francois Quesnay 1758. He had developed a cruder version of this technique called&nbsp;Tableau &eacute;conomique. Wassily Leontief&#39;s(1936) work in the input&ndash;output model was influenced by the works of the classical economists&nbsp;Karl Marx(1885)&nbsp;and&nbsp;Jean Charles L&eacute;onard de Sismondi. Karl Marx&#39;s economics provided an early outline involving a set of tables where the economy consisted of two interlinked departments.</p>\r\n\r\n<p>Hawkins &ndash; Simon(1949) prescribed a specific criterion on Leontif Input &ndash; output model. This is popular as a Hawkins &ndash; Simon condition.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-03 21:31:45','2020-09-03 21:33:15'),(258,'<p>Consider the following statements</p>\r\n\r\n<p><strong>Which of the statements is/are true?</strong></p>','<p>A risk averse investor is an investor who prefers lower returns with known risks rather than higher returns with unknown risks. In other words, among various investments giving the same return with different level of risks, this investor always prefers the alternative with least interest. Therefore, risk averse people always prefer certain income.</p>','1',1,'2020-09-03 21:33:55','2020-09-03 21:34:59'),(259,'<p>Arrange in chronological order of the following contributions of economists in theory of consumer behabiour. Choose the correct answer</p>','<p>Cardinal theory: It has developed by the A. Marshal (1931), which implies that utility is a measurable and quantifiable entity.</p>\r\n\r\n<p>The&nbsp;Ordinal Utility&nbsp;approach is based on the fact that the utility of a commodity cannot be measured in absolute quantity, but however, it will be possible for a consumer to tell subjectively whether the commodity derives more or less or equal satisfaction when compared to another. John Hicks&nbsp;and&nbsp;Roy Allen&nbsp;in 1934 have tried to measure utility in this way by the Indifference curve analysis.</p>\r\n\r\n<p>Revealed Preference Theory has developed by P. Samuelson and R. Stone in 1948, postulate that Consumer theory depends on the existence of&nbsp;preferences&nbsp;which materialise into&nbsp;utility functions.</p>\r\n\r\n<p>A linear Expenditure System model was suggested by R. Stone in 1954 which deals with groups of commodities rather than individual commodities.&nbsp;</p>','0',1,'2020-09-03 21:35:40','2020-09-03 21:36:27'),(260,'<p>The whole burden of tax will be borne by the consumer if</p>','<p>Typically, the incidence, or burden, of a tax falls both on the consumers and producers of the taxed good. But if we want to predict which group will bear most of the burden, all we need to do is examine the elasticity of demand and supply.</p>\r\n\r\n<p>If demand is more inelastic than supply, consumers bear most of the tax burden. But, if supply is more inelastic than demand, sellers bear most of the tax burden.</p>\r\n\r\n<p>For example, when the demand is inelastic, consumers are not very responsive to price changes, and the quantity demanded remains relatively constant when the tax is introduced. In the case of smoking, the demand is inelastic because consumers are addicted to the product. The seller can then pass the tax burden along to consumers in the form of higher prices without much of a decline in the equilibrium quantity.</p>','0',1,'2020-09-03 21:38:38','2020-09-03 21:40:37'),(261,'<p>Match the following</p>\r\n\r\n<p><strong>Choose the correct option</strong></p>','<p>The optimum theory of population was propounded by Edwin Cannan in his book Wealth published in 1924. It implies that Optimum population is that which gives the maximum income per head.</p>\r\n\r\n<p>The transaction cost approach to the theory of the firm was created by Ronald Coase. Transaction cost refers to the cost of providing for some good or service through the market rather than having it provided from within the firm.&nbsp;</p>\r\n\r\n<p>The demographic transition theory is a generalised description of the changing pattern of mortality, fertility and growth rates as societies move from one demographic regime to another. The term was first coined by the American demographer Frank W. Notestein in the mid-twentieth century.</p>\r\n\r\n<p>Sustainable development&nbsp;is a concept that appeared for the first time in 1987 with the publication of the&nbsp;Brundtland Report, Sustainability is development that satisfies the needs of the present generation without compromising the capacity of future generations.</p>','2',1,'2020-09-03 21:41:27','2020-09-03 21:43:12'),(262,'<p>Match the test with their purpose</p>\r\n\r\n<p><strong>Choose the correct option</strong></p>','<p>In&nbsp;statistics, the&nbsp;Dickey&ndash;Fuller test&nbsp;tests the&nbsp;null hypothesis&nbsp;that a&nbsp;unit root&nbsp;is present in an&nbsp;autoregressive&nbsp;model. The&nbsp;alternative hypothesis&nbsp;is different depending on which version of the test is used, but is usually&nbsp;stationarity&nbsp;or&nbsp;trend-stationarity. It is named after the&nbsp;statisticians David Dickey&nbsp;and&nbsp;Wayne Fuller, who developed the test in 1979.</p>\r\n\r\n<p>The Box-Jenkins Model is a mathematical model designed to forecast data ranges based on inputs from a specified time series. The Box-Jenkins Model can analyze many different types of time series data for forecasting.</p>\r\n\r\n<p>In&nbsp;statistics, the&nbsp;Glejser test&nbsp;for&nbsp;heteroscedasticity, developed by&nbsp;Herbert Glejser, regresses the&nbsp;residuals&nbsp;on the&nbsp;explanatory variable&nbsp;that is thought to be related to the heteroscedastic variance.</p>\r\n\r\n<p>The&nbsp;Granger causality test&nbsp;is a&nbsp;statistical hypothesis test&nbsp;for determining whether one&nbsp;time series&nbsp;is useful in&nbsp;forecasting&nbsp;or not, first proposed in 1969.</p>','2',1,'2020-09-03 21:45:00','2020-09-03 21:47:05'),(263,'<p>Autonomous investment could be attributed to</p>\r\n\r\n<p><strong>Choose the correct option</strong></p>','<p>The autonomous investment is made for the welfare of the society and not for generating profits out of such investments. These investments are independent of the level of income or profit, and hence, any change in the income or profit levels will have no effect on the autonomous investment.&nbsp;The firms can make these investments with the purpose of introducing new technology, new inventions or increasing the demand potential (expectation of demand) in case of an economic recession and unemployment, etc. Generally, these investments are made by the government in the form of construction of roads, buildings, flyovers, etc.&nbsp;On other way, government expenditure is based upon the level of national income.</p>','1',1,'2020-09-03 21:47:56','2020-09-03 21:49:06'),(264,'<p>In which of the following products, problem of adverse selection is encountered?</p>','<p>Adverse selection occurs when there is&nbsp;asymmetric (unequal) information&nbsp;between buyers and sellers. This unequal information distorts the market and leads to market failure.</p>\r\n\r\n<p>For example, buyers of insurance may have better information than sellers. Those who want to buy insurance are those most likely to make a claim. Therefore firms are reluctant to sell insurance.</p>\r\n\r\n<p>Similarly, in market of credit, the debtor has more information about himself rather than creditor.</p>','0',1,'2020-09-03 21:50:43','2020-09-03 21:51:26'),(265,'<p>Consider the following statements</p>\r\n\r\n<p><strong>Which of the following statements is/are correct?</strong></p>','<p>The Sixth Trade Policy Review of India by the WTO was held in Geneva on 2nd and 4th June, 2015, as a part of the WTO&rsquo;s Trade Policy Review Mechanism that aims at achieving greater transparency in and understanding of the trade policies and practices of WTO members. India&rsquo;s trade policy review takes place once every 4 years, as determined in terms of its share in world trade.</p>','1',1,'2020-09-03 21:52:06','2020-09-03 21:53:07'),(266,'<p>Consider the following statements about the social cost - benefit analysis for viability of projects. Which of the following statements are true for this analysis?</p>\r\n\r\n<p><strong>Choose the correct option</strong></p>','<p>The Net Present Value (NPV): NPV is equal to the present value of benefit minus the present of operating and maintenance cost minus initial outlay.</p>\r\n\r\n<p>NPV = (Gross present Value of benefit &ndash; Gross present value of cost)</p>\r\n\r\n<p>So, NPV &gt; 0, then the project is valuable.</p>\r\n\r\n<p>NPV = 0, this is indifferent situation.</p>\r\n\r\n<p>NPV &lt; 0, then project is not valuable.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Internal Rate of Return (IRR): The Internal Rate of Return (IRR) is the discount rate that makes the&nbsp;net present value (NPV)&nbsp;of a project zero. In other words, it is the expected compound annual rate of return that will be earned on a project or investment.</p>\r\n\r\n<p>IRR &gt; Discount rate then, NPV &gt; 0</p>\r\n\r\n<p>IRR = Discount rate then, NPV = 0</p>\r\n\r\n<p>IRR &lt; Discount rate then, NPV &lt; 0</p>\r\n\r\n<p>For the viability of project have should be IRR&gt; discount rate.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Shadow prices reflect true values for factors and products for the calculation or estimations of prices in social cost-benefit analysis. J. Tinbergen defines them,&nbsp;&ldquo;Shadow prices are prices indicating the intrinsic or true value of a factor or product in the sense of equilibrium prices. These prices may be different for different time periods as well as geographically separate areas and various occupations (in the case of labour). They may deviate from market prices.&rdquo;</p>','1',1,'2020-09-03 21:55:29','2020-09-03 21:57:00'),(267,'<p>Assertion (A): Disguised unemployment is present in India</p>\r\n\r\n<p>Reason (R): Agricultural productivity at margin is close to zero</p>','<p>Disguised unemployment is primarily traced in the agricultural and the unorganised sectors of the economy. As the primary sector of the Indian economy, Agriculture provides employment to almost 51% of the total population. However, the sector&rsquo;s contribution to the country&rsquo;s GDP is just 12-13%. This data has shown that in India having huge level of disguised unemployment. Disguised unemployment is a kind of unemployment where some people seem to be employed but are not. This usually occurs when there is over-employment in a particular sector. In agriculture sector in India huge level of disguised unemployment implies that productivity of labour is close to zero.</p>','0',1,'2020-09-03 21:57:29','2020-09-03 21:58:09'),(268,'<p>Match the Economists with their field of contribution in Mathematical economics</p>\r\n\r\n<p><strong>Choose the right combination</strong></p>\r\n\r\n<p>&nbsp;</p>',NULL,'1',1,'2020-09-03 21:59:02','2020-09-03 21:59:02'),(269,'<p>Match the Economists with their field of contribution in Mathematical economics</p>\r\n\r\n<p><strong>Choose the right combination</strong></p>\r\n\r\n<p>&nbsp;</p>','<p>During 1946&ndash;1947, George B.&nbsp;Dantzig&nbsp;independently developed general linear programming formulation to use for planning problems in the US Air Force.</p>\r\n\r\n<p>In&nbsp;economics, an&nbsp;input&ndash;output model&nbsp;is a quantitative economic&nbsp;model&nbsp;that represents the interdependencies between different sectors of a national economy or different regional economies.&nbsp;(1906&ndash;1999) is credited with developing this type of analysis and earned the&nbsp;Nobel Prize in Economics&nbsp;for his development of this model.</p>\r\n\r\n<p>John Hicks and Eugene Slutsky have greatly contributed to western economics as a whole and more specifically the understanding of consumer behaviour/consumer choice in microeconomics. John Hicks created the Hicksian Demand Function and Slutsky created the Slutsky equation, which linked both Hicksian demand with Marshallian demand.</p>\r\n\r\n<p>Arrow, Chenery, Minhas and Solow in their new famous paper of 1961 developed the Constant Elasticity of Substitution (CES) function. Q = A [aC-&theta;+ (l-&alpha;)L-&theta;]&nbsp;-1/&theta;. where Q is the total output, ? is capital, and L is labour. A is the efficiency parameter indicating the state of technology and organisational aspects of production.</p>','2',1,'2020-09-03 21:59:33','2020-09-03 22:01:32'),(270,'<p>Who among the following economists are associated with the &lsquo;Balanced Growth&rsquo; doctrine?</p>\r\n\r\n<p><strong>Choose the correct option</strong></p>','<p>Balanced Growth concept was endorsed by <strong>Rosenstein Rodan</strong> in one of his articles titled &ldquo;Problems of Industrialisation of Eastern and South Eastern Europe.&rdquo; <strong>Prof. Nurkse, Prof. Lewis </strong>and <strong>Stovasky</strong> have examined this concept of balance of growth on different bases. It implies that, Planning with balanced growth indicates that all sectors of the economy will expand in same proportion, so that consumption, investment and income will grow at the same rates</p>','1',1,'2020-09-03 22:02:18','2020-09-03 22:03:33'),(271,'<p>Assertion (A): Parties to a dispute over property rights will be able to negotiate an economically optimal solution</p>\r\n\r\n<p>Reason (R): There are efficient, competitive markets and there are no transactions cost</p>','<p>This question is based on Coase Theorem. Coase Theorem is a legal and economic theory developed by&nbsp;economist&nbsp;Ronald Coase&nbsp;that affirms that where there are complete competitive markets with no transactions costs, an efficient set of inputs and outputs to and from production-optimal distribution will be selected, regardless of how&nbsp;property rights&nbsp;are divided. Further, the Coase Theorem asserts that if conflict arises over property rights under these assumptions, then parties will tend to settle on the efficient set of inputs and output.</p>','0',1,'2020-09-03 22:04:26','2020-09-03 22:05:13'),(272,'<p>When the market rate of interest falls which one of the following will happen?</p>','<p>Bond yield&nbsp;is the&nbsp;return&nbsp;an investor realizes on a&nbsp;bond. Bond Yield&nbsp;is a function of the bond&#39;s price and its coupon or&nbsp;interest&nbsp;payment, which will be more accurate than the coupon yield if the price of the bond is different than its&nbsp;face value.</p>','0',1,'2020-09-03 22:05:39','2020-09-03 22:06:50'),(273,'<p>Assertion (A): Geometric mean is theoretically considered as the best average to construct index numbers</p>\r\n\r\n<p>Reason (R): Geometric mean is used if the ranges of observations are extremely large</p>','<p>The best average for construction of index number is&nbsp;Geometric mean.&nbsp;Index number is a statistical tool that helps in measuring change in data over a period of time. It may be change in price of commodity, quantity etc.&nbsp;Geometric mean&nbsp;is better than arithmetic mean for calculation of index number because it the calculated by taking Nth root of the multiplied values and hence is a better representative of the data. On the other hand arithmetic average is simply calculated by finding sum of the observation and then dividing it by total number of observation.</p>','0',1,'2020-09-03 22:07:21','2020-09-03 22:08:09'),(274,'<p>Assertion (A): In classical model investment demand is regarded as autonomous of changes in income or employment</p>\r\n\r\n<p>Reason (R): It is wage price flexibility which brings full employment in the classical model</p>','<p>In the classical model investment is depend on national level income and full employment level. So, assertion is false.</p>\r\n\r\n<p>The classical theory proposes that all markets reequilibrate because of adjustments in prices and wages which are flexible. For instance, if an excess in the labor force or products exist, the wage or price of these will adjust to absorb the excess.</p>','0',1,'2020-09-03 22:08:45','2020-09-03 22:09:27'),(275,'<p>Which amongst the following is not the source of the income of RBI?</p>','<p>The RBI earns money in a variety of ways.</p>\r\n\r\n<p>1. Open market operations, wherein a central bank purchases or sells bonds in the open market in order to regulate money supply in the economy, are a major source of income for the RBI.</p>\r\n\r\n<p>2. Apart from the interest received from these bonds, the RBI may also profit from favourable changes in bond prices.</p>\r\n\r\n<p>3. Dealings in the foreign exchange market that the RBI engages in may also contribute to the bank&rsquo;s profits. The RBI, for instance, may buy dollars cheaply and sell them dear in the future to pocket profits.</p>\r\n\r\n<p>&nbsp;It should be noted, however, that unlike commercial banks, the primary mandate of the RBI is not to earn profits but to preserve the value of the rupee.</p>','0',1,'2020-09-03 22:10:02','2020-09-03 22:10:57'),(276,'<p>Who is the author of the book &lsquo;freedom as development&rsquo;?</p>','<p>Development as Freedom (1999)&nbsp;is a popular summary of economist Amartya Sen&#39;s work on development. In it he explores the relationship between freedom and development, the ways in which freedom is both a basic constituent of development in itself and an enabling key to other aspects.</p>','0',1,'2020-09-03 22:12:40','2020-09-03 22:13:46'),(277,'<p>Among normal cost curves which one of the following curve does not have a minimum point?</p>','<p>Average cost, Marginal cost and Average Variable cost are can be describe in three phase along with quantity increase. In the first phase when quantity increases cost curve sharply goes to down. 2nd phase is minimum point of the cost curve and 3rd phase describe as if quantity increase then cost increases.</p>\r\n\r\n<p>On the other hand Average fixed cost (i.e. fixed cost/quantity) it continuously fall with quantity of production increase because this cost is fixed in production.&nbsp;&nbsp;</p>','0',1,'2020-09-03 22:14:56','2020-09-03 22:15:38'),(278,'<p>Which of the following is not an example of &lsquo;market failure&rsquo;?</p>','<p><strong>Market Failure</strong> &ndash;&nbsp;This occurs when there is an inefficient allocation of resources in a free market. Market failure can occur due to a variety of reasons, such as monopoly (higher prices and less output), negative externalities (over-consumed and costs to third party) and public goods (usually not provided in a free market)</p>\r\n\r\n<p>Types of market failure</p>\r\n\r\n<ol>\r\n	<li>Positive externalities&nbsp;&ndash; Goods/services which give benefit to a third party, e.g. less congestion from cycling.</li>\r\n	<li>Negative externalities &nbsp;&ndash; Goods/services which impose a cost on a third party, e.g. cancer from passive smoking.</li>\r\n	<li><a href=\"https://www.economicshelp.org/micro-economic-essays/marketfailure/public-goods/\">&nbsp;</a>Public goods &ndash; Goods which are non-rival and non-excludable &ndash; e.g. police, national defence. Public goods are often not provided in a free market.</li>\r\n	<li>Monopoly Power&nbsp;&ndash; when a firm controls the market (with high market share) and can set higher prices.</li>\r\n	<li>Inequality&nbsp;&ndash; unfair distribution of resources in free market, e.g. some experiencing poverty and homelessness</li>\r\n	<li>Information failure&nbsp;&ndash; where there is a lack of information to make an informed choice.</li>\r\n</ol>','0',1,'2020-09-03 22:16:32','2020-09-03 22:17:21'),(279,'<p>Which one of the following is an example of positive externality?</p>','<p>A&nbsp;positive externality&nbsp;exists if the production and consumption of a good or service benefits a third party not directly involved in the market transaction. For example, education directly benefits the individual and also provides benefits to society as a whole through the provision of more informed and productive citizens.</p>\r\n\r\n<p>When government provide the vaccine for free in all individual then it have obviously help the common people who are not involve in the direct market transaction. So, a public immunization is an example of positive externality.</p>','0',1,'2020-09-03 22:17:47','2020-09-03 22:18:34'),(280,'<p>Choose the correct characteristic of Non-Probability Sampling-</p>\r\n\r\n<p><strong>Codes:</strong></p>','<p>In a non-probability sample, individuals are selected based on non-random criteria, and not every individual has a chance of being included. This type of sample is easier and cheaper to access, but it has a higher risk of&nbsp;sampling bias, and you can&rsquo;t use it to make valid statistical inferences about the whole population. Non-probability sampling techniques are often appropriate for exploratory and&nbsp;qualitative research. In these types of research, the aim is not to test a&nbsp;hypothesis&nbsp;about a broad population, but to develop an initial understanding of a small or under-researched population.</p>','1',1,'2020-09-04 13:53:30','2020-09-04 13:56:54'),(281,'<p>Which of the following is not tool of grounded theory?</p>','<p>Grounded theory is a well-known methodology employed in many research studies. Qualitative and quantitative data generation techniques can be used in a grounded theory study. Grounded theory sets out to discover or construct theory from data, systematically obtained, and analyzed using comparative analysis. While the grounded theory is inherently flexible, it is a complex methodology. Thus, novice researchers strive to understand the discourse and the practical application of grounded theory concepts and processes. This process involves theoretical sampling, coding, and constant comparison. External validity is not included in it.</p>','0',1,'2020-09-04 13:57:13','2020-09-04 13:58:25'),(282,'<p>The essential qualities of the researcher is/are</p>','<p>According to Clifford Woody, &ldquo;Research comprises defining and redefining problems, formulating a hypothesis, collecting, organizing and evaluating data, making deductions and research conclusions and at last carefully testing conclusions to determine whether they fit the formulating of hypothesis&rdquo;. A researcher is a person who is conducting research. The Success of research work to a great extend depends upon the qualities of the researcher. Qualities of a good researcher are mentioned below:</p>\r\n\r\n<ul>\r\n	<li>Scientific mind</li>\r\n	<li>Seeker of knowledge</li>\r\n	<li>Alertness, insightful and imaginative</li>\r\n	<li>Quick power of understanding</li>\r\n	<li>Ability to explain</li>\r\n	<li>Trained and educated</li>\r\n	<li>Patience</li>\r\n	<li>Knowledge of subjects</li>\r\n	<li>Personal taste in study</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-04 13:58:44','2020-09-04 13:59:56'),(283,'<p>In a Ph.D. thesis which one is the correct sequence for showing scheme of Chapterisation?</p>','<p>The sequence of chapterisation as follows:&nbsp; Introduction, Survey of related studies, Design of study, Data-presentation; analysis &amp; Interpretation, Formulation of generalization &amp; Conclusions, Suggestions for further research, References &amp; Appendix.</p>','0',1,'2020-09-04 14:00:18','2020-09-04 14:01:01'),(284,'<p>&quot;Internal validity&quot; refers to:</p>','<p><strong>Internal Validity</strong>&nbsp;is the approximate truth about inferences regarding cause-effect or causal relationships. Thus, internal validity is only relevant in studies that try to establish a causal relationship. It&rsquo;s not relevant in most observational or descriptive studies, for instance. But for studies that assess the effects of social programs or interventions, internal validity is perhaps the primary consideration</p>','0',1,'2020-09-04 14:01:24','2020-09-04 14:02:06'),(285,'<p>A teacher believes that one group of learners is very bright and that a second group is below average in ability. Actually, the groups are identical, but the first group progresses more rapidly than the second. This demonstrates:</p>','<p>The&nbsp;self-fulfilling prophecy&nbsp;is a circular pattern. In school, students&#39; actions toward others impact&nbsp;teachers&#39; beliefs about them, which dictates the&nbsp;teachers&#39; actions toward the students, which then reinforces the students&#39; beliefs about themselves.</p>','0',1,'2020-09-04 14:02:24','2020-09-04 14:03:06'),(286,'<p>&ldquo;This method was discovered by Dr. H.E. Armstrong. It is an approach to problem-solving, learning, or discovery that employs a practical method but instead sufficient for reaching an immediate goal.&rdquo;- this is the description true regarding&mdash;</p>','<p>The term &ldquo;Heuristic&rdquo; refers to Armstrong who was the exponent of this strategy. Pollion and Dankar (1945) called it &ldquo;problem solving&rdquo;. It is based on the psychological principles of &ldquo;trial and error&rdquo; theory. Logical and imaginative thinking are perquisites for his type of teaching strategy. It is an economical and speedy strategy. A problem is placed before the learners and they are asked to find the solution of the problem through various literacy means, like library, laboratory, and workshops etc. Teacher&rsquo;s role is to initiate the learning and pupils are active throughout the learning process. By using their creative thinking and imaginative power, they try to find out the relevant solutions based on some logic. They learn by self-experience.</p>','0',1,'2020-09-04 14:03:26','2020-09-04 14:04:09'),(287,'<p><strong>Assertion (A)</strong> - &ldquo;Evaluation is a wider concept than testing and measurement&rdquo;.</p>\r\n\r\n<p>&nbsp;<strong>Reason(R)</strong> - &ldquo;It is supposed to judge the worth of all educational outcomes in the teaching-learning process&rdquo;.</p>','<p>Assessment is the systematic process of documenting and using empirical data on the knowledge, skills, attitudes and beliefs. By taking the assessment, teachers try to improve student learning.&nbsp;Test and assessment are used interchangeably, but they do mean something different. A test is a &ldquo;product&rdquo; that measures a particular behavior or set of objectives. Meanwhile assessment is seen as a procedure instead of a product. Assessment is used during and after the instruction has taken place.&nbsp;</p>','0',1,'2020-09-04 14:04:36','2020-09-04 14:05:22'),(288,'<p>Which of the following is/are correct about National Policy on Education (NPE) 2020?</p>','<p>Recently, the&nbsp;National Education Policy (NEP) 2020)&nbsp;was announced by the Ministry of Human Resource Development (soon to be called the Ministry of Education). The policy is aimed at transforming the Indian education system to meet the needs of the 21st&nbsp;Century.</p>\r\n\r\n<p>The new policy seeks rectification of poor literacy and numeracy outcomes associated with primary schools, reduction in dropout levels in middle and secondary schools and adoption of the multi-disciplinary approach in the higher education system. The goal of NEP to spent 6% of GDP on education sector. The draft of the National Policy on Education has been formulated by a committee under the chairmanship K. Kasturirangan.</p>','1',1,'2020-09-04 14:05:54','2020-09-04 14:07:12'),(289,'<p>The&nbsp;<strong>Ministry of Human Resource Development</strong>&nbsp;has launched an initiative named <strong>---------</strong><strong>&nbsp;</strong>to help systematically assimilate technologies having commercial potential and information related to incubated startups in higher education institutions.</p>','<p>The&nbsp;Ministry of Human Resource Development&nbsp;has launched an initiative&nbsp;&lsquo;YUKTI 2.0&rsquo;&nbsp;to help systematically assimilate technologies having commercial potential and information related to incubated startups in higher education institutions. YUKTI 2.0 is&nbsp;an extension&nbsp;of&nbsp;&lsquo;YUKTI (Young India combating Covid with Knowledge, Technology and Innovation) Portal&rsquo;&nbsp;which was launched to identify ideas relevant in&nbsp;Covid pandemic. The Ministry has invited students, faculty members, startups and other stakeholders of higher education institutions to register on the YUKTI 2.0 portal and share their technologies and innovations.</p>','0',1,'2020-09-04 14:07:41','2020-09-04 14:08:21'),(290,'<p><strong>Read the passage carefully and answer the question from 11 to 15.</strong></p>\r\n\r\n<p>Today, if you order a coffee in any of the premium coffee shops, you&rsquo;ll find it in a cup with some words of caution on it, stating that the item is hot. It all started with the famous Stella Liebeck and McDonald&rsquo;s lawsuit. In 1992, Stella Liebeck of Albuquerque, New Mexico, was in the passenger seat of her grandson&rsquo;s car, when she ordered a coffee at a local McDonalds&rsquo; drive-through. Liebeck held the cup between her legs and while removing the lid, the coffee spilled on her leg, causing a severe burn injury. To claim the amount that she had to spend for her treatment, Stella Liebeck filed a lawsuit that compelled McDonald&rsquo;s to pay her a hefty amount as settlement. While the justification of such a case can be debated, to an Indian this is no more than a bedtime story. You&rsquo;ll hardly come across an Indian who can even imagine going to court for such lapses in the day to day life &mdash; train not reaching on time, exam results delayed, cable connection getting disrupted without notice, nursing staff not replacing the saline bottle on time, so on and so forth. Since Independence, we Indians have been &lsquo;ok&rsquo; with things the way we got them. Though with globalization, our consciousness has improved, our compromising attitude towards quality &mdash; both at the delivery and the receiving end &mdash; leaves us in a world of mediocrity. There are surely some exceptions discretely available. In the Airports Council International&#39;s Airport Service Quality survey 2016, the Hyderabad International Airport grabbed the first position in the 5-15 million passengers per annum (MPPA) category. While this is no mean achievement, one must admit that this is something of an exception resulting from a huge amount of concentrated effort, which doesn&rsquo;t really bespeak the quality of other services in our day to day life. The people in India see the ability to tolerate undesired service lapses as a virtue of character. Which would have been alright had we not looked forward and welcomed the supernatural age of digital intelligence we&rsquo;re about to witness strongly. With robotics and machine-learning creeping in, the quality of services associated with the objects of our use will have a critical role in determining the quality of our life.</p>\r\n\r\n<p><strong>What does author mean by &lsquo;&hellip;..we Indians have been &lsquo;ok&rsquo; with things the way we got them&rsquo;? </strong></p>','<p>This passage shows that we, Indian, are ready to compromise with quality of product or services. It is because of red tapism and delaying process judiciary, we ready to abide by any situation.</p>','0',1,'2020-09-04 14:09:45','2020-09-04 14:10:29'),(291,'<p><strong>Read the passage carefully and answer the question from 11 to 15.</strong></p>\r\n\r\n<p>Today, if you order a coffee in any of the premium coffee shops, you&rsquo;ll find it in a cup with some words of caution on it, stating that the item is hot. It all started with the famous Stella Liebeck and McDonald&rsquo;s lawsuit. In 1992, Stella Liebeck of Albuquerque, New Mexico, was in the passenger seat of her grandson&rsquo;s car, when she ordered a coffee at a local McDonalds&rsquo; drive-through. Liebeck held the cup between her legs and while removing the lid, the coffee spilled on her leg, causing a severe burn injury. To claim the amount that she had to spend for her treatment, Stella Liebeck filed a lawsuit that compelled McDonald&rsquo;s to pay her a hefty amount as settlement. While the justification of such a case can be debated, to an Indian this is no more than a bedtime story. You&rsquo;ll hardly come across an Indian who can even imagine going to court for such lapses in the day to day life &mdash; train not reaching on time, exam results delayed, cable connection getting disrupted without notice, nursing staff not replacing the saline bottle on time, so on and so forth. Since Independence, we Indians have been &lsquo;ok&rsquo; with things the way we got them. Though with globalization, our consciousness has improved, our compromising attitude towards quality &mdash; both at the delivery and the receiving end &mdash; leaves us in a world of mediocrity. There are surely some exceptions discretely available. In the Airports Council International&#39;s Airport Service Quality survey 2016, the Hyderabad International Airport grabbed the first position in the 5-15 million passengers per annum (MPPA) category. While this is no mean achievement, one must admit that this is something of an exception resulting from a huge amount of concentrated effort, which doesn&rsquo;t really bespeak the quality of other services in our day to day life. The people in India see the ability to tolerate undesired service lapses as a virtue of character. Which would have been alright had we not looked forward and welcomed the supernatural age of digital intelligence we&rsquo;re about to witness strongly. With robotics and machine-learning creeping in, the quality of services associated with the objects of our use will have a critical role in determining the quality of our life.</p>\r\n\r\n<p><strong>Which of the following is true with respect to the passage? </strong></p>','<p>The sentence- &ldquo;You&rsquo;ll hardly come across an Indian who can even imagine going to court for such lapses in the day to day life &mdash; train not reaching on time, exam results delayed, cable connection getting disrupted without notice, nursing staff not replacing the saline bottle on time, so on and so forth.&rdquo;- best exemplifies this.</p>','0',1,'2020-09-04 14:11:02','2020-09-04 14:11:46'),(292,'<p><strong>Read the passage carefully and answer the question from 11 to 15.</strong></p>\r\n\r\n<p>Today, if you order a coffee in any of the premium coffee shops, you&rsquo;ll find it in a cup with some words of caution on it, stating that the item is hot. It all started with the famous Stella Liebeck and McDonald&rsquo;s lawsuit. In 1992, Stella Liebeck of Albuquerque, New Mexico, was in the passenger seat of her grandson&rsquo;s car, when she ordered a coffee at a local McDonalds&rsquo; drive-through. Liebeck held the cup between her legs and while removing the lid, the coffee spilled on her leg, causing a severe burn injury. To claim the amount that she had to spend for her treatment, Stella Liebeck filed a lawsuit that compelled McDonald&rsquo;s to pay her a hefty amount as settlement. 