an be debated, to an Indian this is no more than a bedtime story. You&rsquo;ll hardly come across an Indian who can even imagine going to court for such lapses in the day to day life &mdash; train not reaching on time, exam results delayed, cable connection getting disrupted without notice, nursing staff not replacing the saline bottle on time, so on and so forth. Since Independence, we Indians have been &lsquo;ok&rsquo; with things the way we got them. Though with globalization, our consciousness has improved, our compromising attitude towards quality &mdash; both at the delivery and the receiving end &mdash; leaves us in a world of mediocrity. There are surely some exceptions discretely available. In the Airports Council International&#39;s Airport Service Quality survey 2016, the Hyderabad International Airport grabbed the first position in the 5-15 million passengers per annum (MPPA) category. While this is no mean achievement, one must admit that this is something of an exception resulting from a huge amount of concentrated effort, which doesn&rsquo;t really bespeak the quality of other services in our day to day life. The people in India see the ability to tolerate undesired service lapses as a virtue of character. Which would have been alright had we not looked forward and welcomed the supernatural age of digital intelligence we&rsquo;re about to witness strongly. With robotics and machine-learning creeping in, the quality of services associated with the objects of our use will have a critical role in determining the quality of our life.</p>\r\n\r\n<p><strong>The credit of displaying caution note on the coffee cup goes to---</strong></p>','<p>The credit of displaying caution note on the coffee cup goes to Stella Liebeck as it was done on her complain.</p>','0',1,'2020-09-04 14:24:58','2020-09-04 14:25:37'),(296,'<p>Denotations and Connotations are &hellip;&hellip;&hellip;.. barrier in communication process</p>','<p>The Semantic barrier in communication can be defined as the misunderstanding and interpretation of meaning which restrict effective communication. It can be in form of language, sign and symbol. The word semantic is credited to the Greek word &ldquo;semantikos&rdquo; which indicates &ldquo;significant&rdquo;. Semantics is a broad interdisciplinary study which deals with philosophical and logical understanding behind the language. The Semantic barrier can be caused in every type of communication. The variations of meaning in language are visible between individuals in minor and cultures in major. Denotations and connotations are the part of semantic barriers of communication process.</p>','0',1,'2020-09-04 14:25:57','2020-09-04 14:26:37'),(297,'<p>During presentation using an OHP. One can read information line by line using an opaque sheet to cover the transparency with a view to minimize distraction. This technology is called _________</p>',NULL,'0',1,'2020-09-04 14:27:35','2020-09-04 14:27:35'),(298,'<p>What is the difference between reflecting and paraphrasing?</p>','<p>The&nbsp;difference between paraphrasing&nbsp;and&nbsp;reflective&nbsp;listening is that in&nbsp;paraphrasing&nbsp;you are only summarizing what the victim has said. With&nbsp;reflective&nbsp;listening, you are going beyond summarizing to identifying feelings that the person may not have identified, but their words and attitudes point to such feelings</p>','0',1,'2020-09-04 16:45:46','2020-09-04 16:46:26'),(299,'<p>A series of the recorded audio episodes to which audience can subscribe, is known as</p>','<p>A&nbsp;podcast&nbsp;is an&nbsp;episodic&nbsp;series of spoken word&nbsp;digital audio&nbsp;files&nbsp;that a user can&nbsp;download&nbsp;to a personal device for easy listening. Streaming applications and podcasting services provide a convenient, integrated way to manage a personal consumption queue across many podcast sources and playback devices</p>','0',1,'2020-09-04 16:46:44','2020-09-04 16:47:25'),(300,'<p>Which journalist in India got the most prestigious Ramon Magsaysay Award (2019)&nbsp;for &quot;harnessing journalism to give voice to the voiceless&quot;?</p>','<p>Journalist&nbsp;Ravish Kumar&nbsp;on Friday was awarded this year&#39;s Ramon Magsaysay Award, regarded as the Asian version of the Nobel Prize. Kumar, 44, who is NDTV India&#39;s senior executive editor is one of India&#39;s most influential TV journalists, the award citation said. He is among five individuals who were declared winners of the award. Kumar&#39;s &quot;Prime Time&quot; programme &quot;deals with real-life, under-reported problems of ordinary people&quot;, it added.</p>','0',1,'2020-09-04 16:47:44','2020-09-04 16:48:23'),(301,'<p>A father tells his son, &quot;I was of your present age when you were born&quot;. If the father is 36 now, how old was the boy five years back?</p>','<p>Suppose the father&#39;s age be x and the son&#39;s age be y.</p>\r\n\r\n<p>Then, x - y = y or x = 2y,</p>\r\n\r\n<p>Now, x = 36. So, 2y = 36 or y = 18.</p>\r\n\r\n<p>Therefore, Son&#39;s present age = 18 years.</p>\r\n\r\n<p>So, son&#39;s age 5 years ago = 13 years.</p>','0',1,'2020-09-04 16:48:43','2020-09-04 16:49:14'),(302,'<p>What is the next number in this sequence?</p>\r\n\r\n<p>1, 3, 8, 19, 42, 89, &hellip;?</p>','<p><math xmlns=\"http://www.w3.org/1998/Math/MathML\" class=\"wrs_chemistry\"><mo>(</mo><mn>1</mn><mo>&#160;</mo><mo>&#215;</mo><mo>&#160;</mo><mn>2</mn><mo>)</mo><mo>&#160;</mo><mo>+</mo><mo>&#160;</mo><mn>1</mn><mo>&#160;</mo><mo>=</mo><mo>&#160;</mo><mn>3</mn><mo>&#160;</mo><mo>&#160;</mo><mspace linebreak=\"newline\"/><mo>(</mo><mn>3</mn><mo>&#160;</mo><mo>&#215;</mo><mo>&#160;</mo><mn>2</mn><mo>)</mo><mo>&#160;</mo><mo>+</mo><mo>&#160;</mo><mn>2</mn><mo>&#160;</mo><mo>=</mo><mo>&#160;</mo><mn>8</mn><mo>&#160;</mo><mspace linebreak=\"newline\"/><mo>&#160;</mo><mo>(</mo><mn>8</mn><mo>&#160;</mo><mo>&#215;</mo><mo>&#160;</mo><mn>2</mn><mo>)</mo><mo>&#160;</mo><mo>+</mo><mo>&#160;</mo><mn>3</mn><mo>&#160;</mo><mo>=</mo><mo>&#160;</mo><mn>19</mn><mo>&#160;</mo><mo>&#160;</mo><mspace linebreak=\"newline\"/><mo>(</mo><mn>19</mn><mo>&#160;</mo><mo>&#215;</mo><mo>&#160;</mo><mn>2</mn><mo>)</mo><mo>&#160;</mo><mo>+</mo><mo>&#160;</mo><mn>4</mn><mo>&#160;</mo><mo>=</mo><mo>&#160;</mo><mn>42</mn><mo>&#160;</mo><mspace linebreak=\"newline\"/><mo>&#160;</mo><mo>(</mo><mn>42</mn><mo>&#160;</mo><mo>&#215;</mo><mo>&#160;</mo><mn>2</mn><mo>)</mo><mo>&#160;</mo><mo>+</mo><mo>&#160;</mo><mn>5</mn><mo>&#160;</mo><mo>=</mo><mo>&#160;</mo><mn>89</mn><mo>&#160;</mo><mo>&#160;</mo><mspace linebreak=\"newline\"/><mo>(</mo><mn>89</mn><mo>&#160;</mo><mo>&#215;</mo><mo>&#160;</mo><mn>2</mn><mo>)</mo><mo>&#160;</mo><mo>+</mo><mo>&#160;</mo><mn>6</mn><mo>&#160;</mo><mo>=</mo><mo>&#160;</mo><mn>184</mn></math></p>','0',1,'2020-09-04 16:49:35','2020-09-04 16:50:54'),(303,'<p>In certain code &ldquo;&rsquo;FORGIVE&rdquo; is written as &ldquo;DPPHGCW&rdquo;. How would &ldquo;REQUEST&rdquo; be written in that code?</p>','<p>The letter moves -2, +1, alternately R-2 = P, E + 1 =F, Q -2 = O, U +1 =V and so on. So, code of REQUEST will be PFOVCTR.</p>','0',1,'2020-09-04 16:51:13','2020-09-04 16:51:51'),(304,'<p>The length of a rectangle is reduced by 30%. By what percent would the width have to be increased to maintain the original area?</p>','<p><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>S</mi><mi>u</mi><mi>p</mi><mi>p</mi><mi>o</mi><mi>s</mi><mi>e</mi><mo>&#160;</mo><mi>l</mi><mi>e</mi><mi>n</mi><mi>g</mi><mi>t</mi><mi>h</mi><mo>&#160;</mo><mi>o</mi><mi>f</mi><mo>&#160;</mo><mi>r</mi><mi>e</mi><mi>c</mi><mi>tan</mi><mi>g</mi><mi>l</mi><mi>e</mi><mo>&#160;</mo><mi>i</mi><mi>s</mi><mo>&#160;</mo><mn>50</mn><mo>&#160;</mo><mi>m</mi><mo>&#160;</mo><mi>a</mi><mi>n</mi><mi>d</mi><mo>&#160;</mo><mi>w</mi><mi>i</mi><mi>d</mi><mi>t</mi><mi>h</mi><mo>&#160;</mo><mi>i</mi><mi>s</mi><mo>&#160;</mo><mn>20</mn><mo>&#160;</mo><mi>m</mi><mspace linebreak=\"newline\"/><mo>&#160;</mo><mi>S</mi><mi>o</mi><mo>,</mo><mo>&#160;