n>58</mn><mo>&#160;</mo><mi>m</mi><mo>&#160;</mo><mspace linebreak=\"newline\"/><mi>P</mi><mi>e</mi><mi>r</mi><mi>c</mi><mi>e</mi><mi>n</mi><mi>t</mi><mi>a</mi><mi>g</mi><mi>e</mi><mo>&#160;</mo><mi>i</mi><mi>n</mi><mi>c</mi><mi>r</mi><mi>e</mi><mi>a</mi><mi>s</mi><mi>e</mi><mo>&#160;</mo><mo>(</mo><mo>(</mo><mn>28</mn><mo>.</mo><mn>58</mn><mo>-</mo><mn>20</mn><mo>)</mo><mo>/</mo><mn>20</mn><mo>)</mo><mo>&#160;</mo><mo>&#215;</mo><mo>&#160;</mo><mn>100</mn><mo>&#160;</mo><mo>=</mo><mo>&#160;</mo><mn>8</mn><mo>.</mo><mn>58</mn><mo>/</mo><mn>20</mn><mo>&#160;</mo><mo>&#215;</mo><mo>&#160;</mo><mn>100</mn><mo>&#160;</mo><mo>=</mo><mo>&#160;</mo><mn>42</mn><mo>.</mo><mn>90</mn><mo>%</mo></math></p>','0',1,'2020-09-04 16:52:07','2020-09-04 16:53:21'),(305,'<p>If A is the brother of B; B is the sister of C; and C is the father of D, how D is related to A?</p>','<p>If D is Male, the answer is Nephew.</p>\r\n\r\n<p>If D is Female, the answer is Niece.</p>\r\n\r\n<p>As the sex of D is not known, hence, the relation between D and A cannot be determined.</p>\r\n\r\n<p>Note: Niece - A daughter of one&#39;s brother or sister, or of one&#39;s brother-in-law or sister-in-law. Nephew - A son of one&#39;s brother or sister, or of one&#39;s brother-in-law or sister-in-law.</p>','0',1,'2020-09-04 16:53:40','2020-09-04 16:54:23'),(306,'<p>The knowledge of a thing by means of Hetu, according to the Jain&rsquo;s Known as</p>','<p>The followers of the&nbsp;Jain&nbsp;School of Thought consider knowledge as emanating from the soul to be&nbsp;Pratyaksha&nbsp;(direct cognition) and the knowledge which is inherited from the senses,&nbsp;Paroksha&nbsp;(indirect cognition); Paroksha-knowledge is gained with the help of the mind and senses (Mati) or through what is heard or learnt (Shruti).</p>','0',1,'2020-09-04 16:54:41','2020-09-04 16:55:22'),(307,'<p>The postulation of a fact by the impossibility of its opposite is known as---</p>','<p>Arthapatti&nbsp;is a Sanskrit term meaning &quot;presumption&quot; or &quot;implication.&quot; In the yogic philosophy of the&nbsp;Advaita Vedanta&nbsp;system and the&nbsp;Bhatta&nbsp;school of&nbsp;Purva-Mimamsa, it is said to be one of the six&nbsp;pranamas, or means of obtaining knowledge.</p>\r\n\r\n<p>Arthapatti refers to the way in which knowledge is derived from a set of circumstances. It is analogous in contemporary logic to the concept of circumstantial implication. It generally requires an observation of fact(s) and postulation based on such fact(s) to arrive at the information.</p>','0',1,'2020-09-04 16:55:38','2020-09-04 16:56:19'),(308,'<p>The main objective against Samkhya concept of liberation is based upon</p>','<p>Samkhya&nbsp;is one of the six&nbsp;?stika&nbsp;schools of&nbsp;Hindu philosophy.&nbsp;It is most related to the&nbsp;Yoga&nbsp;school of&nbsp;Hinduism, and it was influential on other schools of Indian philosophy.&nbsp;S?mkhya is an&nbsp;enumerationist&nbsp;philosophy whose&nbsp;epistemology&nbsp;accepts three of six&nbsp;<em>pramanas</em>&nbsp;(proofs) as the only reliable means of gaining knowledge.</p>','0',1,'2020-09-04 16:56:35','2020-09-04 16:57:25'),(309,'<p><strong>Statement:</strong> Should all the infrastructure development projects in India be handed over to the private sector?</p>\r\n\r\n<p><strong>Arguments</strong>:</p>\r\n\r\n<p>(I) No. The private sector entities are not equipped to handle such projects.</p>\r\n\r\n<p>(II) Yes. Such projects are handled by private sector in the developed countries</p>\r\n\r\n<p><strong>Choose the correct options:</strong></p>','<p>Clearly, such projects if handed over to the private sector shall be given to a competent authority. So, argument I is vague. Also, imitating a policy on the basis that it worked out successfully in other countries holds no relevance. Thus, argument II also does not hold strong</p>','0',1,'2020-09-04 16:58:08','2020-09-04 16:58:51'),(310,'<p><strong>Statement</strong>: Some tables are golden. All Teaks are table.</p>\r\n\r\n<p><strong>Conclusion:</strong></p>\r\n\r\n<p>(I) Some Teaks are golden.</p>\r\n\r\n<p>&nbsp;(II) Some golden are Teak.</p>\r\n\r\n<p>Assuming that the given statements are true even if they are at variance with commonly known facts, pick up one of the following answer choices which you think correct.</p>','<p><strong>Conclusion I</strong>: Some teak may or may be golden. So, ambiguity is there. So, Conclusion I does not follow.</p>\r\n\r\n<p><strong>Conclusion II:</strong> Similarly, some golden may or may not be teak. So, Conclusion II does not follow.</p>\r\n\r\n<p><img alt=\"\" src=\"https://teachinns.com/storage/uploads/banner/1.JPG\" style=\"height:212px; width:604px\" /></p>','0',1,'2020-09-04 16:59:20','2020-09-04 17:26:41'),(311,'<p><img alt=\"\" src=\"https://teachinns.com/storage/uploads/banner/2.JPG\" style=\"height:585px; width:645px\" />The number of adults in the city Y is approximate what percent of the number of males in the city X?</p>','<p>Total number of people in the city Y = (<em>2800000&times;21</em><em>100</em> ) = 588000</p>\r\n\r\n<p>Total number of people in the city X =<em>2800000&times;21</em><em>100</em> ) = 588000</p>\r\n\r\n<p>Total number of adults in the city Y = <em>(</em><em>588000&times;72</em><em>100</em> ) = 423360</p>\r\n\r\n<p>Total numbers of male in the city X =<em> (</em><em>588000&times;3</em><em>7</em> ) = 252000</p>\r\n\r\n<p>So, the percentage of adult in city Y is (<em>252000</em><em>423360</em> )&times; 100 = 59.52% = 60% approx.</p>','0',1,'2020-09-04 17:29:37','2020-09-04 17:30:38'),(312,'<p><img alt=\"\" src=\"https://teachinns.com/storage/uploads/banner/5f51f3aa96007.JPG\" style=\"height:585px; width:645px\" />What is the difference between the total number of males and females in the city V?</p>','<p>Total population in the city V is (<em>2800000&times;9</em><em>100</em> ) = 252000</p>\r\n\r\n<p>So, the difference between male and female in city V is (<em>252000&times;3</em><em>19</em> ) = 39789</p>','0',1,'2020-09-04 17:30:47','2020-09-04 17:32:28'),(313,'<p><img alt=\"\" src=\"https://teachinns.com/storage/uploads/banner/5f51f3b852968.JPG\" style=\"height:585px; width:645px\" />What is the number of females in the city U who are adults?</p>','<p>Total number of people in the city U = (<em>2800000&times;20</em><em>100</em> ) = 560000</p>\r\n\r\n<p>Total number of females in the city U = (<em>560000&times;5</em><em>11</em> ) = 254545.45</p>\r\n\r\n<p>Total number of adult females cannot be determined because there is percentage of adult is given&hellip;there is no segregation of adult percentage among male and female.</p>','0',1,'2020-09-04 17:32:53','2020-09-04 17:33:36'),(314,'<p><img alt=\"\" src=\"https://teachinns.com/storage/uploads/banner/5f51f3c6a7cba.JPG\" style=\"height:585px; width:645px\" />What is the total number of male populations in the city Z?</p>','<p>Total number of people in the city Z = (<em>2800000&times;14</em><em>100</em> ) = 392000</p>\r\n\r\n<p>Total number of males in the city Z = (<em>392000&times;4</em><em>7</em> ) = 224000</p>','0',1,'2020-09-04 17:34:03','2020-09-04 17:34:54'),(315,'<p><img alt=\"\" src=\"https://teachinns.com/storage/uploads/banner/2.JPG\" style=\"height:585px; width:645px\" />What is the number of the persons in the city W who are not adult?</p>','<p>Total number of people in the city W = (<em>2800000&times;17</em><em>100</em> ) = 476000</p>\r\n\r\n<p>Total number of persons in the city W who are not adult is (100-68) % =32% of total population.</p>\r\n\r\n<p>So, <em>476000&times;32</em><em>100</em> ) = 152320</p>','0',1,'2020-09-04 17:35:17','2020-09-04 17:36:07'),(316,'<p>To receive email, you need an email provider, a connection to your provider and an email client application. If your Internet Service Provider (ISP) has a POP server; you have a wide choice of email applications. What does the acronym POP stand for?</p>','<p>Post Office Protocol&nbsp;(POP) means that all of your email is downloaded from your Internet Service Provider to your own personal computer and (usually) deleted from the server. If you created folders in your email program, those folders are only accessible on your own personal computer.</p>','0',1,'2020-09-04 17:36:25','2020-09-04 17:37:02'),(317,'<p>An Information and Communication System can be defined as:</p>','<p>An&nbsp;information and communication system is a formal, sociotechnical, organizational system designed to collect, process, store, and distribute&nbsp;information. In a&nbsp;sociotechnical&nbsp;perspective, information systems are composed by four components: task, people, structure (or roles), and technology</p>','0',1,'2020-09-04 17:37:20','2020-09-04 17:37:58'),(318,'<p>Which of the following is not a Programming Language?</p>','<p>(1)&nbsp; Ruby is an interpreted, high-level, general-purpose programming language. It was designed and developed in the mid-1990s by Yukihiro &quot;Matz&quot; Matsumoto in Japan.&nbsp;&nbsp;</p>\r\n\r\n<p>(2) PHP is a general-purpose scripting language that is especially suited to web development. It was originally created by Danish-Canadian programmer Rasmus Lerdorf in 1994; the PHP reference implementation is now produced by The PHP Group.</p>\r\n\r\n<p>(3) Python is an interpreted, high-level, general-purpose programming language. Created by Guido van Rossum and first released in 1991, Python&#39;s design philosophy emphasizes code readability with its notable use of significant whitespace.</p>','0',1,'2020-09-04 17:38:18','2020-09-04 17:38:59'),(319,'<p>PNG stands for</p>','<p>Portable Network Graphics&nbsp;(PNG) is a&nbsp;raster-graphics&nbsp;file&nbsp;format&nbsp;that supports&nbsp;lossless data compression. PNG was developed as an improved, non-patented replacement for&nbsp;Graphics Interchange Format&nbsp;(GIF)</p>','0',1,'2020-09-04 17:39:32','2020-09-04 17:40:18'),(320,'<p>The Union Ministry of Human Resource and Development (HRD) has launched&hellip;&hellip;... Portal for providing digital platform to teacher to make their lifestyle more digital and to be equipped with advanced digital technology</p>','<p>DIKSHA is National Digital Infrastructure launched for teachers. It acts as a platform for the teachers to learn and train themselves. It will help them in creating in-class resources, training content, assessment aids and also stay connected with another teacher community</p>','0',1,'2020-09-04 17:40:40','2020-09-04 17:41:19'),(321,'<p>Consider the following statement:</p>\r\n\r\n<p>Which of the above statement is/are correct?</p>','<p>Biome is the larger part as it is the combination of several ecosystem. Desert, grassland, Savana and Trundra are the types of biome.</p>\r\n\r\n<p>Biodiversity decreases as we move from equator towards poles with maximum concentrated in equator region.</p>','1',1,'2020-09-04 17:41:48','2020-09-04 17:42:49'),(322,'<p>The Biological Diversity Act, 2002 has made provisions for the establishment of the Biodiversity Management Committees. In this context, consider the following statements:</p>\r\n\r\n<p><strong>Which among the above statements is / are correct?</strong></p>','<p>Every local body shall constitute a Biodiversity Management Committee within its area for the purpose of promoting conservation, sustainable use and documentation of biological diversity including preservation of habitats, conservation of land races, folk varieties and cultivars, domesticated stocks and breeds of animals and microorganisms and chronicling of knowledge relating to biological diversity.</p>','1',1,'2020-09-04 17:43:54','2020-09-04 17:45:05'),(323,'<p>Arrange the following greenhouse gases in decreasing order of their Global Warming Potential (GWP)</p>','<p>Global warming potential&nbsp;(GWP) is the heat absorbed by any greenhouse gas in the atmosphere, as a multiple of the heat that would be absorbed by the same mass of&nbsp;carbon dioxide&nbsp;(CO2). GWP is 1 for CO2. For other gases it depends on the gas and the time frame. For methane GWP is 86 in 20 years. For Nitrous Oxide, GWP is 268 in 20 years. For Sulphur Hexafluoride, GWP is 16300 in 20 years.</p>','1',1,'2020-09-04 17:45:25','2020-09-04 17:46:58'),(324,'<p>Which is the first Biosphere Reserve in India?</p>','<p>Nilgiri Biosphere Reserve (Tamilnadu, Kerala and Karnataka) is the first biosphere reserve in India, which was formed in 2000</p>','0',1,'2020-09-04 17:48:01','2020-09-04 17:49:27'),(325,'<p>Which among the following radioactive material is largely associated with bone cancer?</p>','<p>Strontium- 90 is referred to as a &quot;bone seeker,&quot; and exposure will increase the risk for several diseases including bone&nbsp;cancer,&nbsp;cancer&nbsp;of the soft tissue near the bone, and&nbsp;leukemia. Risks from exposure depend on the concentration of strontium-90 in air, water, and soil.</p>','0',1,'2020-09-04 17:49:44','2020-09-04 17:50:46'),(326,'<p>Sankhya Theory of education is known as:</p>','<p>The&nbsp;Samkhya&nbsp;school of philosophy, which follows&nbsp;Prakrti&nbsp;&ndash; Parinama-vada, describes the origination and evolution of universe through its theory of&nbsp;Satkaryavada which is the theory of causation. According to this theory, the manifested effect is pre-existent in the cause; and the original cause of everything that is perceived (Prakriti) is&nbsp;Purusha, which is eternal consciousness.</p>','0',1,'2020-09-04 17:51:12','2020-09-04 17:51:55'),(327,'<p>Which of the following commission recommended the inclusion of applied science and technology in the university courses?</p>','<p>The Sadler Commission (1917) observed, &ldquo;It is an important and indeed, a necessary function of the university to include applied science and technology in its courses and to recognize their systematic and practical study by degrees and diplomas.&rdquo;</p>','0',1,'2020-09-04 17:52:11','2020-09-04 17:52:51'),(328,'<p>Vayu, the World&rsquo;s first Yoga University outside India is inaugurated in Los Angles (USA). It is named after which great Indian scholar?</p>','<p>As part of the 6th International Yoga Day commemorations, the world&#39;s first yoga university outside India has been launched in Los Angeles, offering programmes that combine scientific principles and modern research approaches to the ancient Indian practice of yoga.</p>\r\n\r\n<p>The Vivekananda Yoga University (VaYU) was jointly launched on Tuesday by Minister of State for External Affairs V. Muraleedharan and Chairperson of the Standing Committee on External Affairs P. P. Chaudhary during a virtual event held at the Consulate General of India in New York.</p>','0',1,'2020-09-04 17:53:08','2020-09-04 17:53:49'),(329,'<p>Which Article of Indian Constitution says, &ldquo;No Child belong age of fourteen years shall be employed to work in any factory or mine or engaged in any other hazardous employment&rdquo;?</p>','<p>Article 24 Prohibition of employment of children in factories, etc. No child below the age of fourteen years shall be employed to work in any factory or mine or engaged in any other hazardous employment</p>','0',1,'2020-09-04 17:54:05','2020-09-04 17:54:40'),(330,'<p>103 Constitutional Amendment Act confirms</p>','<p>The&nbsp;One Hundred and Third Amendment&nbsp;of the&nbsp;Constitution of India, officially known as the&nbsp;Constitution (One Hundred and Third Amendment) Act, 2019, introduces 10% reservation for&nbsp;Economically Weaker Sections&nbsp;(EWS) of society for admission to Central Government-run educational institutions and private educational institutions (except for minority educational institutions), and for employment in Central Government jobs.</p>','0',1,'2020-09-04 17:54:55','2020-09-04 17:56:28'),(331,'<p><strong>-------- consists of economic conditions, economic policies, industrial policies and economic system</strong></p>','<p>The term economic environment refers to all the external economic factors that influence buying habits of consumers and businesses and therefore affect the performance of a company. These factors are often beyond a company&rsquo;s control, and may be either large-scale (macro) or small-scale (micro).</p>','0',1,'2020-09-04 18:18:30','2020-09-04 18:19:04'),(332,'<p><strong>An analysis of the external environment enables a firm to identify -</strong></p>','<p>Opportunities are openings or chances for something positive to happen, but you&#39;ll need to claim them for yourself.</p>\r\n\r\n<p>Threats include anything that can negatively affect your business from the outside, such as supply chain problems, shifts in market requirements, or a shortage of recruits.&nbsp;</p>','0',1,'2020-09-04 18:19:31','2020-09-04 18:20:06'),(333,'<p><strong>Which of the following is not a feature of Business environment</strong></p>','<p>The main features of business environment are:</p>\r\n\r\n<p>All the external forces, Specific and general forces, Inter-relation, and&nbsp;Uncertainty</p>','0',1,'2020-09-04 18:20:30','2020-09-04 18:21:10'),(334,'<p><strong>When the seller manipulates the price, it is known as</strong></p>','<p>Restrictive trade practices are targeted at the consumers who are burdened with restriction and unjustified costs through the practices of the trader. The trader manipulates the price or the conditions of delivery of the product which results in restrictive trade practice. This affects the supply of goods and services in the market and includes</p>','0',1,'2020-09-04 18:21:28','2020-09-04 18:22:03'),(335,'<p><strong>The consumer has the right to get compensation against unfair trade practices under right to</strong></p>','<p>It means right to seek redressal against unfair trade practices or unscrupulous exploitation of consumers. It also includes right to fair settlement of the genuine grievances of the consumer. Consumers must make complaint for their genuine grievances.</p>','0',1,'2020-09-04 18:22:52','2020-09-04 18:23:27'),(336,'<p><strong>Capitalistic, communistic and Mixed are the types of</strong></p>','<p>An&nbsp;<strong>economic system</strong>, or&nbsp;<strong>economic order</strong>&nbsp;is a&nbsp;system&nbsp;of&nbsp;production,&nbsp;resource allocation&nbsp;and&nbsp;distribution&nbsp;of&nbsp;goods and services&nbsp;within a&nbsp;society&nbsp;or a given&nbsp;geographic area. It includes the combination of the various&nbsp;institutions, agencies, entities, decision-making processes and patterns of&nbsp;consumption&nbsp;that comprise the economic structure of a given community.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-04 18:23:45','2020-09-04 18:24:17'),(337,'<p><strong>Globalization refers to:</strong></p>','<p><strong>Globalization</strong>&nbsp;is the process of&nbsp;interaction&nbsp;and integration among people, companies, and governments&nbsp;worldwide. As a complex and multifaceted phenomenon, globalization is considered by some as a form of capitalist expansion which entails the integration of local and national economies into a global, unregulated market economy</p>','0',1,'2020-09-04 18:24:39','2020-09-04 18:25:15'),(338,'<p><strong>&hellip;&hellip;.is the payment method most often used in International Trade which offers the exporter best assurance of being paid for the products sold internationally</strong></p>','<p>A letter of credit or &quot;credit letter&quot; is a letter from a bank guaranteeing that a buyer&#39;s payment to a seller will be received on time and for the correct amount. In the event that the buyer is unable to make a payment on the purchase, the bank will be required to cover the full or remaining amount of the purchase. It may be offered as a&nbsp;facility.</p>','0',1,'2020-09-04 18:25:35','2020-09-04 18:26:08'),(339,'<p><strong>Globalisation has improved in the living structure of</strong></p>','<p><strong>Globalization</strong>&nbsp;is the process of&nbsp;interaction&nbsp;and integration among people, companies, and governments&nbsp;worldwide. As a complex and multifaceted phenomenon, globalization is considered by some as a form of capitalist expansion which entails the integration of local and national economies into a global, unregulated market economy.</p>','0',1,'2020-09-04 18:27:05','2020-09-04 18:27:40'),(340,'<p><strong>Which of the following is not a non-tariff barrier? </strong></p>','<p>A nontariff barrier is a way to restrict trade using trade&nbsp;barriers in a form other than a&nbsp;tariff. Nontariff barriers include&nbsp;quotas,&nbsp;embargoes,&nbsp;sanctions, and&nbsp;levies</p>','0',1,'2020-09-04 18:28:09','2020-09-04 18:28:51'),(341,'<p><strong>The investment in productive assets and participation in management as stake holders in business enterprises is</strong></p>','<p>A&nbsp;<strong>Foreign Direct Investment</strong>&nbsp;(<strong>FDI</strong>) is an&nbsp;investment&nbsp;in the form of a&nbsp;controlling ownership&nbsp;in a&nbsp;business&nbsp;in one country by an entity based in another country.&nbsp;It is thus distinguished from a&nbsp;foreign portfolio investment&nbsp;by a notion of direct control</p>','0',1,'2020-09-04 18:29:25','2020-09-04 18:29:58'),(342,'<p><strong>The portfolio investment by foreign institutional investors is called</strong><br />\r\n<br />\r\n&nbsp;</p>','<p>A foreign institutional investor (FII) is an investor or&nbsp;investment fund&nbsp;investing in a country outside of the one in which it is registered or headquartered. The term foreign institutional investor is probably most commonly used in India</p>','0',1,'2020-09-04 18:30:17','2020-09-04 18:30:50'),(343,'<p><strong>Which of the following is part of capital account of a country?</strong></p>','<p>NRI deposits are foreign currency deposits made in an Indian bank by a non-resident Indian. These deposits can be repatriated by the NRI on maturity along with the interest earned.</p>','0',1,'2020-09-04 18:31:16','2020-09-04 18:31:51'),(344,'<p><strong>____ is a systematic record of all the economic transaction between one country and rest of the would</strong></p>','<p>The balance of payments (BOP) is a statement of all transactions made between entities in&nbsp;one&nbsp;country and the rest of the world&nbsp;over a defined period of time, such as a quarter or a year.</p>','0',1,'2020-09-04 18:32:09','2020-09-04 18:32:41'),(345,'<p><strong>As per IMF balance of payment manual, import export of goods should be presented on</strong></p>','<p>Free on Board (FOB) is a shipment term used to indicate whether the seller or the buyer is liable for goods that are damaged or destroyed during shipping. &quot;FOB shipping point&quot; or &quot;FOB origin&quot; means&nbsp;the buyer is at risk and takes&nbsp;ownership of goods&nbsp;once the seller ships the product</p>','0',1,'2020-09-04 18:33:03','2020-09-04 18:33:33'),(346,'<p><strong>Devaluation means</strong></p>','<p>Devaluation is the deliberate downward adjustment of the value of a country&#39;s money relative to another currency, group of currencies, or currency standard. Countries that have a&nbsp;fixed exchange rate&nbsp;or semi-fixed exchange rate use this monetary policy tool</p>','0',1,'2020-09-04 18:33:53','2020-09-04 18:34:30'),(347,'<p><strong>_______ is a systematic record of all transactions of a country in a year</strong></p>','<p>The balance of payments (BOP) is a statement of all transactions made between entities in&nbsp;one&nbsp;country and the rest of the world&nbsp;over a defined period of time, such as a quarter or a year.</p>','0',1,'2020-09-04 18:34:53','2020-09-04 18:35:22'),(348,'<p><strong>The current account of Balance of Payment includes trade balance and _______</strong></p>','<p>A nation may have a visible balance surplus but this can be offset by a larger deficit in the invisibles balance (creating a Balance of Trade deficit overall) &ndash; if, for example, there are large payments made to foreign businesses for invisibles such as shipping or tourism. On the other hand, a visible balance deficit can be offset by a strong surplus on the invisibles balance if, for example, foreign aid is being provided</p>','0',1,'2020-09-04 18:35:58','2020-09-04 18:36:28'),(349,'<p><strong>Balance of payment deficit can be removed through</strong></p>','<p>Devaluation is the deliberate downward adjustment of the value of a country&#39;s money relative to another currency, group of currencies, or currency standard</p>','0',1,'2020-09-04 18:36:48','2020-09-04 18:37:26'),(350,'<p><strong>The difference between the value of a nations visible exports and visible import is</strong></p>','<p>Balance of trade (BOT) is the difference between the value of a country&#39;s&nbsp;imports&nbsp;and&nbsp;exports&nbsp;for a&nbsp;given period and is the largest component of a country&#39;s&nbsp;balance of payments&nbsp;(BOP)</p>','0',1,'2020-09-04 18:37:44','2020-09-04 18:38:19'),(351,'<p><strong>The term &ldquo;Inner Six&rdquo; is related to......</strong></p>','<p><strong>European Economic Community (EEC)</strong>, byname&nbsp;<strong>Common Market</strong><strong>,</strong> former association designed to&nbsp;integrate&nbsp;the economies of Europe</p>','0',1,'2020-09-04 18:38:45','2020-09-04 18:39:15'),(352,'<p><strong>If the Balance of Payment of a country is adverse, then which institution will help that country?</strong></p>','<p>The International Monetary Fund (IMF) is an organization of 189 countries, working to foster global monetary cooperation, secure financial stability, facilitate international trade, promote high employment and sustainable economic growth, and reduce poverty around the world.</p>','0',1,'2020-09-04 18:39:49','2020-09-04 18:40:23'),(353,'<p><strong>Which of the following is known as the Paper Gold?</strong></p>','<p>The SDR was created as a supplementary international reserve asset in the context of the Bretton Woods fixed exchange rate system. The collapse of Bretton Woods system in 1973 and the shift of major currencies to floating exchange rate regimes lessened the reliance on the SDR as a global reserve asset. Nonetheless, SDR allocations can play a role in providing liquidity and supplementing member countries&rsquo; official reserves, as was the case amid the global financial crisis.</p>','0',1,'2020-09-04 18:44:31','2020-09-04 18:45:04'),(354,'<p><strong>Ultimately &hellip;&hellip;&hellip;&hellip;&hellip;&hellip;was replaced by the &hellip;&hellip;&hellip;&hellip;&hellip;.on 1st Jan 1995</strong></p>','<p><strong>The</strong>&nbsp;<strong>General Agreement on Tariffs and Trade</strong>&nbsp;(<strong>GATT</strong>) is a&nbsp;legal agreement&nbsp;between many countries, whose overall purpose was to promote international trade by reducing or eliminating trade barriers such as&nbsp;tariffs&nbsp;or&nbsp;quotas.</p>\r\n\r\n<p><strong>The World Trade Organization (WTO)</strong> is the only global international organization dealing with the rules of trade between nations. At its heart are the WTO agreements, negotiated and signed by the bulk of the world&rsquo;s trading nations and ratified in their parliaments. The goal is to help producers of goods and services, exporters, and importers conduct their business</p>','0',1,'2020-09-04 18:46:00','2020-09-04 18:46:44'),(355,'<p><strong>&hellip;..is only a legal agreement and it is not an institution, but &hellip;.. is a permanent institution</strong></p>','<p><strong>The</strong>&nbsp;<strong>General Agreement on Tariffs and Trade</strong>&nbsp;(<strong>GATT</strong>) is a&nbsp;legal agreement&nbsp;between many countries, whose overall purpose was to promote international trade by reducing or eliminating trade barriers such as&nbsp;tariffs&nbsp;or&nbsp;quotas.</p>\r\n\r\n<p><strong>The World Trade Organization (WTO)</strong> is the only global international organization dealing with the rules of trade between nations. At its heart are the WTO agreements, negotiated and signed by the bulk of the world&rsquo;s trading nations and ratified in their parliaments. The goal is to help producers of goods and services, exporters, and importers conduct their business.</p>','0',1,'2020-09-04 18:47:07','2020-09-04 18:47:40'),(356,'<p><strong>The WTO was established to implement the final act of Uruguay Round agreement of &hellip;&hellip;</strong></p>','<p>The&nbsp;<strong>General Agreement on Tariffs and Trade</strong>&nbsp;(<strong>GATT</strong>) is a&nbsp;legal agreement&nbsp;between many countries, whose overall purpose was to promote international trade by reducing or eliminating trade barriers such as&nbsp;tariffs&nbsp;or&nbsp;quotas. According to its preamble, its purpose was the &quot;substantial reduction of tariffs and other trade barriers and the elimination of preferences, on a reciprocal and mutually advantageous basis.&quot;</p>','0',1,'2020-09-04 18:48:34','2020-09-04 18:49:16'),(357,'<p><strong>The main promoter of trade liberalization was</strong></p>','<p>The&nbsp;<strong>General Agreement on Tariffs and Trade</strong>&nbsp;(<strong>GATT</strong>) is a&nbsp;legal agreement&nbsp;between many countries, whose overall purpose was to promote international trade by reducing or eliminating trade barriers such as&nbsp;tariffs&nbsp;or&nbsp;quotas. According to its preamble, its purpose was the &quot;substantial reduction of tariffs and other trade barriers and the elimination of preferences, on a reciprocal and mutually advantageous basis</p>','0',1,'2020-09-04 18:49:39','2020-09-04 18:50:12'),(358,'<p><strong>Which organizations strain on the liberalization of foreign investment and foreign trade?</strong></p>','<p><strong>The World Trade Organization (WTO)</strong> is the only global international organization dealing with the rules of trade between nations. At its heart are the WTO agreements, negotiated and signed by the bulk of the world&rsquo;s trading nations and ratified in their parliaments. The goal is to help producers of goods and services, exporters, and importers conduct their business</p>','0',1,'2020-09-04 18:50:43','2020-09-04 18:51:22'),(359,'<p><strong>Which institute supports investments and foreign trade in India?</strong></p>','<p><strong>The World Trade Organization (WTO)</strong> is the only global international organization dealing with the rules of trade between nations. At its heart are the WTO agreements, negotiated and signed by the bulk of the world&rsquo;s trading nations and ratified in their parliaments. The goal is to help producers of goods and services, exporters, and importers conduct their business</p>','0',1,'2020-09-04 19:29:28','2020-09-04 19:30:05'),(360,'<p><strong>India has approved its first National Intellectual Property Rights Policy reiterating India&rsquo;s commitment to TRIPS. What does TRIPS stand for?</strong></p>','<p>The&nbsp;<strong>Agreement on Trade-Related Aspects of Intellectual Property Rights</strong>&nbsp;(<strong>TRIPS</strong>) is an&nbsp;international legal agreement&nbsp;between all the member nations of the&nbsp;World Trade Organization&nbsp;(WTO). It sets down minimum standards for the regulation by national governments of many forms of&nbsp;intellectual property&nbsp;(IP) as applied to nationals of other WTO member nations</p>','0',1,'2020-09-04 19:30:24','2020-09-04 19:31:15'),(361,'<p><strong>TRIMS stand for</strong></p>','<p>The&nbsp;<strong>Agreement on Trade-Related Investment Measures</strong>&nbsp;(<strong>TRIMs</strong>) are rules that are applicable to the domestic regulations a country applies to foreign&nbsp;investors, often as part of an&nbsp;industrial policy. TRIMs are rules that restrict preference of domestic firms and thereby enable international firms to operate more easily within foreign markets.</p>','0',1,'2020-09-04 19:31:34','2020-09-04 19:32:41'),(362,'<p><strong>Which one of the following concepts is used as fund in the preparation of Funds Flow Statement?</strong></p>','<p>In narrow sense fund means <strong>cash</strong>. In broader sense fund means <strong>all the financial resources</strong> used in the business. In popular sense funds means <strong>working capital</strong></p>','0',1,'2020-09-04 19:37:23','2020-09-04 19:37:55'),(363,'<p><strong>Window dressing is prohibited due to</strong></p>','<p>According to this convention all the information that has an impact on business&rsquo;s financial statements should be disclosed or included alongside to the statement. So as per this convention all the information whether it is significant or not has to be disclose fully</p>','0',1,'2020-09-04 19:38:50','2020-09-04 19:39:26'),(364,'<p><strong>Assertion (A): Ratio analysis is one the tools employed to know the financial health of a concern.</strong></p>\r\n\r\n<p><strong>Reason (R): Ratio analysis is not the only technique available to take investment decision.&nbsp;</strong></p>\r\n\r\n<p>Codes:</p>','<p>Financial Ratio is a quantitative relationship between two variables taken from the financial statement. This ratio is a very useful tool for analysing financial health of an organisation. It helps the users of financial statement to analyse the financial statement and take appropriate decision about their activities</p>','0',1,'2020-09-04 19:39:57','2020-09-04 19:40:35'),(365,'<p><strong>In accounting, profit prior to incorporation is treated as</strong></p>','<p>The premium received on issue of shares, profit prior to incorporation and the profits on sale of fixed assets are the major examples of capital profit .Capital profit should be transferred to the capital reserve account, which is used to set off capital losses in future if any and this profit cannot be distributed as dividend. Any profit made prior to incorporation of the business should be treated as capital reserve</p>','0',1,'2020-09-04 19:41:04','2020-09-04 19:41:33'),(366,'<p><strong>Receipts and Payments Account is prepared by</strong></p>','<p>A&nbsp;receipt and payment account&nbsp;is a summarized&nbsp;cash book for a given period. This is a summary of the cash transactions as in the cash book. Non-profit organizations prepare receipt and payment account at the end of the year. With the help of this account and some additional information, we prepare income and expenditure account to disclose the true results of non-profit organizations. Income and Expenditure account is a nominal account</p>','0',1,'2020-09-04 19:41:54','2020-09-04 19:42:25'),(367,'<p>Owners equity stands for</p>','<p>Owner&rsquo;s equity is essentially the owner&rsquo;s rights to the assets of the business. It&rsquo;s what&rsquo;s left over for the owner after you&rsquo;ve subtracted all the liabilities from the assets.</p>\r\n\r\n<p><strong>Assets &ndash; Liabilities = Owner&rsquo;s Equity</strong></p>\r\n\r\n<p>The term &ldquo;owner&rsquo;s equity&rdquo; is typically used for a sole proprietorship. It may also be known as shareholder&rsquo;s equity or stockholder&rsquo;s equity if the business is structured as an LLC or a corporation</p>','0',1,'2020-09-04 19:42:43','2020-09-04 19:43:16'),(368,'<p>When the Debt Turnover Ratio is 4, what is the average collection period?</p>','<p>We can easily calculate the average collection period from Debtors Turnover Ratio by just dividing the 12 months by Debtors Turnover Ratio i.e. <math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mfrac><mn>12</mn><mn>4</mn></mfrac></math> &nbsp;= 3Months</p>','0',1,'2020-09-04 19:43:35','2020-09-04 19:44:31'),(369,'<p>Which of the following will result into sources of funds?</p>',NULL,'0',1,'2020-09-04 19:44:54','2020-09-04 19:52:10'),(370,'<p>Which of the following will result into sources of funds?</p>\r\n\r\n<p>Codes:</p>','<p>The fund flow statement is a statement which indicates various means by which the funds have been obtained during a specific period and the ways to which these funds have been used during that period. The term flow means movement and includes both inflows and outflows of resources. So, fund flow statement is the statement which shows the inflow and outflow of funds from different sources. Decrease of current assets implies sale of current assets which results in sources of inflow of fund and Increase in current liabilities also implies we are taking credit from others i.e. inflow of sources of fund</p>','1',1,'2020-09-04 19:45:19','2020-09-04 19:46:36'),(371,'<p>In marginal costing, contribution is equal to</p>','<p>The&nbsp;<em>term contribution</em>&nbsp;represents the difference between sales price and variable cost. Contribution means, &ldquo;contribution towards absorption of fixed costs and profits&rdquo;.&nbsp;</p>','0',1,'2020-09-04 20:01:35','2020-09-04 20:02:12'),(372,'<p>The funds available with a company after paying all claims including tax and dividend is called</p>','<p>Retained earnings= Net Profit-Tax-Preference dividend &ndash; Equity dividend</p>','0',1,'2020-09-04 20:02:29','2020-09-04 20:03:03'),(373,'<p>Assertion (A): Accounting information refers to only events which are concerned with business firm.</p>\r\n\r\n<p>Reason (R): Accounting information is presented in financial statements.</p>\r\n\r\n<p><strong>Codes:</strong><strong> </strong></p>','<p>Accounting information of any concern is provided through financial statement to the interested parties. Accounting information of any business is only relating to that particular organisation.&nbsp; Financial statement not only represents the profit and loss of the business but also the assets and liabilities of the business</p>','0',1,'2020-09-04 20:03:19','2020-09-04 20:03:55'),(374,'<p>The main objective of Accounting Standards is</p>','<p>In order to ensure transparency, consistency, comparability, adequacy and reliability of financial reporting, it is essential to standardize the accounting principles and policies, accounting standards basically provide framework and standard accounting policies so that financial statements of different enterprise become comparable. So the main objective of the Accounting Standard is to harmonise the diversified accounting standard</p>','0',1,'2020-09-04 20:04:34','2020-09-04 20:05:07'),(375,'<p>Given below are two statements:</p>\r\n\r\n<p>I. Activity ratios show where the company is going.</p>\r\n\r\n<p>II. Balance Sheet ratios show how the company stand.</p>\r\n\r\n<p><strong>Codes:</strong></p>','<p>This ratio helps to understand how efficient the management of the company is. As this ratio measures the efficiency of the utilization of assets of the company.<strong> </strong>Balance sheet ratio indicates relationship between two items of balance sheet or analysis of balance sheet items to interpret company&rsquo;s results on quantitative basis. Balance sheet ratio indicates the current position of the company</p>','0',1,'2020-09-04 20:05:48','2020-09-04 20:06:21'),(376,'<p>Income and Expenditure Account of non-profit organisation is a</p>','<p>A&nbsp;receipt and payment account&nbsp;is a summarized&nbsp;cash book for a given period. This is a summary of the cash transactions as in the cash book. Non-profit organizations prepare receipt and payment account at the end of the year. With the help of this account and some additional information, we prepare income and expenditure account to disclose the true results of non-profit organizations. Income and Expenditure account is a nominal account</p>','0',1,'2020-09-04 20:06:39','2020-09-04 20:07:11'),(377,'<p>If the current ratio is 2: 1 and working capital is Rs. 60,000, what is the value of the Current Assets?</p>','<p>CR=<math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mfrac><mrow><mi>C</mi><mi>A</mi></mrow><mrow><mi>C</mi><mi>L</mi></mrow></mfrac></math> =2:1</p>\r\n\r\n<p>Or, CA=2CL</p>\r\n\r\n<p>Or, 2CL=60000+CL</p>\r\n\r\n<p>Or, CL=60000</p>\r\n\r\n<p>CA=2*60000=&nbsp;&nbsp; Rs. 1,20,000</p>\r\n\r\n<p>W.C= CA-CL</p>\r\n\r\n<p>Or, CA-CL=60000</p>\r\n\r\n<p>Or, CA=60000+CL</p>','0',1,'2020-09-04 20:09:47','2020-09-04 20:11:03'),(378,'<p>Match List-I with List-II and select the correct answer:</p>\r\n\r\n<p><strong>Codes :&nbsp;</strong>(i) (ii) (iii) (iv)</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>',NULL,'2',1,'2020-09-04 20:11:30','2020-09-04 20:15:59'),(379,'<p>Consider the following items:</p>\r\n\r\n<p>Which of them are current liabilities?</p>',NULL,'0',1,'2020-09-04 20:13:36','2020-09-04 20:13:36'),(380,'<p>Consider the following items:</p>\r\n\r\n<p>Which of them are current liabilities?</p>','<p>Debentures is long term liabilities, prepaid rent and interest accrued are current assets. Bank overdraft is current liabilities</p>','1',1,'2020-09-04 20:13:40','2020-09-04 20:15:15'),(381,'<p>If Opening Stock is Rs. 10,000, Net Purchases Rs. 70,000, Wages Rs. 2,500, Carriage inward Rs. 500 and closing Stock Rs. 15,000, what is the Manufacturing Cost?</p>\r\n\r\n<p>????? ?? ??? ?? ?? ????? ? ???? ????????? ???? ?????? ???? ??? ?????? ??????????</p>\r\n\r\n<p>??????? ??? ???? ??? ????? ?? ??? 12 ???? ?????? ?? ??? ?????? ??, 8, 4 ???? ??</p>','<p>Manufacturing Expenses =Opening stock+ Net purchase+ Wages+ Carriage Inward-Closing Stock</p>','0',1,'2020-09-04 20:16:31','2020-09-04 20:35:00'),(382,'<p>Which one of the following statements is true?</p>','<p>Capital expenditure implies purchase of fixed assets which helps to generate income in future and capital expenditure is not charged to P/L account but, revenue expenditure directly charged to P/L account. So, Capital expenditure affects the profitability of a concern indirectly but revenue expenditure affects directly</p>','0',1,'2020-09-04 20:48:31','2020-09-04 20:49:06'),(383,'<p>X and Y are partners in a firm sharing profits in the ratios of 2: 1. Z is admitted with a 1/3 profit sharing. What will be the new profit-sharing ratio of X, Y and Z?</p>','<p>Let, Total share =1</p>\r\n\r\n<p>&nbsp;Z&rsquo;s share=1/3rd</p>\r\n\r\n<p>Remaining share= 2/3rd</p>\r\n\r\n<p>X&rsquo;s new share= 2/3*2/3=4/9</p>\r\n\r\n<p>Y&rsquo; s new share= 2/3*1/3=2/9</p>\r\n\r\n<p>New ratio, X:Y:Z= 4/9:2/9:1/3</p>\r\n\r\n<p>=4:2:3</p>','0',1,'2020-09-04 20:49:27','2020-09-04 20:50:03'),(384,'<p>Given below are two statements, one labelled as Assertion (A) and the other labelled as Reason (R):</p>\r\n\r\n<p>Assertion (A): When a company earns profit prior to its incorporation, it is called capital profit.</p>\r\n\r\n<p>Reason (R): Capital profit cannot be used for distribution as dividend to the shareholders.</p>\r\n\r\n<p>In the context of the above statements, which one of the following is correct?</p>\r\n\r\n<p><strong>Codes:</strong></p>','<p>The premium received on issue of shares, profit prior to incorporation and the profits on sale of fixed assets are the major examples of capital profit .Capital profit should be transferred to the capital reserve account, which is used to set off capital losses in future if any and this profit cannot be distributed as dividend. Any profit made prior to incorporation of the business should be treated as capital reserve</p>','0',1,'2020-09-04 20:50:25','2020-09-04 20:51:06'),(385,'<p>Reconstruction of a company takes place when</p>\r\n\r\n<p>Which one of the following is correct?</p>','<p>Reconstruction is an exercise of restating assets &amp; liabilities by company / entity whose financial position as reflected by its balance sheet is not healthy but future is promising. It is undertaken when the company is overcapitalised. The main objectives of reconstruction are</p>\r\n\r\n<p><strong>1.&nbsp;</strong>To generate surplus for writing off accumulated losses &amp; writing down overstated assets.</p>\r\n\r\n<p><strong>2.</strong>&nbsp;To generate cash for working capital needs, replacement of assets, to add balancing equipment, modernise plant &amp; machinery etc.</p>','1',1,'2020-09-04 20:51:25','2020-09-04 20:52:35'),(386,'<p>Match the items of List &ndash; I with the items of List &ndash; II and select the correct answer using the codes given below the lists:</p>\r\n\r\n<p><strong>Codes: (a) (b) (c) (d)</strong></p>',NULL,'2',1,'2020-09-04 20:53:13','2020-09-04 20:53:13'),(387,'<p>Match List &ndash; I with List &ndash; II and select the correct answer using the codes given below the lists:</p>\r\n\r\n<p><strong>Codes: (a) (b) (c) (d)</strong></p>',NULL,'2',1,'2020-09-04 20:55:24','2020-09-04 20:55:24'),(388,'<p>Present value of future earnings is a model of Human Resources Accounting suggested by</p>','<p>The Lev and Schwartz model states that the human resource of a co is the summation of value of all the Net present value (NPV) of expenditure on employees. The human capital embodied in a person of age r is the present value of his earning from employment</p>','0',1,'2020-09-04 20:58:12','2020-09-04 20:58:45'),(389,'<p>A and B are partners sharing profits in the ratio of 3 : 2. Their books showed goodwill at Rs. 3,000. C is admitted with &frac14; th share of profits and brings Rs. 10,000 as his capital. But he is not able to bring in cash for his share of goodwill Rs. 3,000. How will you treat this?</p>','<p>C is required to bring Rs.3000 as premium for goodwill for 1/4th share. So, total value of goodwill will be Rs.3000*4/1=Rs.12000. Goodwill already raised in the book is. Rs.3000. As C is unable to bring the premium for goodwill, it is to be raised at full value in the books i.e. Rs.12000. But goodwill already raised in the books is Rs.3000. so, balance amount Rs.(12000-3000)=Rs.9000 to be raised in the books</p>','0',1,'2020-09-04 20:59:04','2020-09-04 20:59:38'),(390,'<p>Improvement of profit-volume ratio can be done by</p>','<p>The formula for P/V ratio is Contribution/Sales. Again Contribution= S-VC. So we can improve the P/V ratio by increasing either by increasing selling price per unit or reducing variable cost per unit or by taking any activities which will be results in increasing selling price or reducing variable cost</p>','0',1,'2020-09-04 20:59:56','2020-09-04 21:00:26'),(391,'<p>Which of the following comes under efficiency ratios?</p>','<p>Activity ratio is also known as efficiency ratio i.e. how management is efficiently utilising the stock, debtors, creditors etc</p>','0',1,'2020-09-04 21:00:45','2020-09-04 21:01:21'),(392,'<p>Match the items of the following two lists:</p>\r\n\r\n<p><strong>Codes:&nbsp;(i) (ii) (iii) (iv)</strong></p>','<p>Statement of changes in working capital is associated with Funds Flow Statement, Deferred tax is associated with balance sheet, Three activities ( Cash flow from operating activities, Cash flow from financing activities and Cash flow from investing activities) is associated with cash flow statement and impairment of loss is associated with fixed assets.</p>','2',1,'2020-09-04 21:02:15','2020-09-04 21:03:53'),(393,'<p>Match the items of the following two lists and indicate the correct answer:</p>\r\n\r\n<p><strong>Codes: (i) (ii) (iii) (iv)</strong></p>','<p>Earning ability of a firm is measured with the help of P/V ratio, conservatism principle is associated with prudence, cash profit is associated with cash flow statement and cash and accrual basis is the basis of accounting</p>','2',1,'2020-09-04 21:04:28','2020-09-04 21:06:02'),(394,'<p>Given below are two statements, one labelled as Assertion (A) and the other labelled as Reason (R).</p>\r\n\r\n<p>Assertion (A): Only the relevant costs should be taken into consideration for decision making.</p>\r\n\r\n<p>Reason (R): All variable costs are relevant costs and all fixed costs are irrelevant costs.</p>\r\n\r\n<p>In the above statements, which one alternative of the following is correct?</p>\r\n\r\n<p><strong>Codes:</strong></p>','<p>Relevant costing attempts to determine the objective cost of a business decision. An objective measure of the cost of a business decision is the extent of cash outflows that shall result from its implementation. Relevant costing focuses on just that and ignores other costs which do not affect the future cash flows. Irrelevant costs are costs that won&rsquo;t be affected by a managerial decision. Relevant costs are costs that will be affected by a managerial decision.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-04 21:06:24','2020-09-04 21:06:59'),(395,'<p>Given below are two statements, one labelled as Assertion (A) and the other labelled as Reason (R):</p>\r\n\r\n<p>Assertion (A): Variance analysis is undertaken for planning and control of costs.</p>\r\n\r\n<p>Reason (R): Future costs are taken into consideration in budgeting and standard costing.</p>\r\n\r\n<p>In the above statements, which one alternative of the following is correct?</p>\r\n\r\n<p><strong>Codes:</strong></p>','<p>Standard costing uses estimated costs completely to calculate all three elements of product costs: direct materials, direct labour, and overhead. Managers use standard costs for planning and control in the management process such as planning for budget development; product costing, pricing, and distribution. <em>Budgetary control and standard costing have the common objective of cost control by establishing pre-determined targets.&nbsp;Standard costing and budgetary control have the same principles &ndash; setting targets, comparing actual performance with pre-set targets, analysing and reporting of variances</em></p>','0',1,'2020-09-04 21:07:21','2020-09-04 21:08:00'),(396,'<p>The main difference between marginal costing and absorption costing lies in the treatment of</p>','<p>Marginal costing applies only those&nbsp;costs&nbsp;to&nbsp;inventory that were incurred when each individual unit was produced, while&nbsp;absorption costing&nbsp;applies all production costs to all units produced. Only the&nbsp;variable cost&nbsp;is applied under marginal costing, while&nbsp;fixed costs as well as variable costs applied under absorption costing.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-04 21:08:21','2020-09-04 21:08:52'),(397,'<p>Which of the following is not applicable to responsibility accounting?</p>','<p>A responsibility centre can be classified into four centres like cost centre, revenue centre, profit centre and investment centre</p>','0',1,'2020-09-04 21:09:13','2020-09-04 21:09:44'),(398,'<p>A company sells its product at Rs. 15 per unit. In a period if it produces and sells 8,000 units, it incurs a loss of Rs. 5 per unit. If the volume is raised to 20,000 units it earns a profit of Rs. 4 per unit.</p>\r\n\r\n<p>Variable cost per unit will be</p>',NULL,'0',1,'2020-09-04 21:10:04','2020-09-04 21:10:04'),(399,'<p>Which of the following is a sub variance of labour efficiency variance?</p>','<p><strong>Total Labour cost variance = Rate variance + Efficiency variance + Idle time &nbsp;&nbsp;&nbsp;variance</strong><br />\r\n<strong><strong>Efficiency variance = Mix variance + Revised efficiency variance</strong></strong></p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-04 21:10:50','2020-09-04 21:11:22'),(400,'<p>An investment centre is a responsibility centre where the manager has control over</p>','<p><strong>Investment Centre</strong> is responsible for both investments and revenue. The investment manager can control expenses, income, the fund invested in assets, etc. He also has the authority to form a credit policy, which has an immediate impact on debt collection</p>','0',1,'2020-09-04 21:12:23','2020-09-04 21:12:58'),(401,'<p>When sales are Rs.30000 and P/V ratio is 20% then contribution will be--------</p>','<p>P/V ratio= C/S</p>\r\n\r\n<p>So, Contribution= 30000*20%=6000</p>','0',1,'2020-09-04 21:13:20','2020-09-04 21:13:52'),(402,'<p>Current Ratio 2.5, Liquid Ratio 1.5, and Working Capital Rs. 60,000. What are the Current Assets?</p>','<p>CA/CL=2.5/1</p>\r\n\r\n<p>CA-CL=60000</p>\r\n\r\n<p>CA=60000+CL</p>\r\n\r\n<p>2.5CL=60000+CL</p>\r\n\r\n<p>Or, 1.5CL=60000</p>\r\n\r\n<p>Or, CL=40000</p>\r\n\r\n<p>CA=60000+40000</p>\r\n\r\n<p>CA=Rs.100000</p>','0',1,'2020-09-04 21:14:28','2020-09-04 21:15:07'),(403,'<p>X, Y, Z are sharing profits in the ratio of 6 : 5 : 3. A is admitted into partnership for 1/8th share. The sacrificing ratio of X, Y and Z is</p>','<p>Let, total share =1</p>\r\n\r\n<p>A&rsquo;s share =1/8th</p>\r\n\r\n<p>Remaining share=7/8th</p>\r\n\r\n<p>New share</p>\r\n\r\n<p>X=7/8*6/14=42/84</p>\r\n\r\n<p>Y=7/8*5/14=35/84</p>\r\n\r\n<p>Z=7/8*3/14=21/84</p>\r\n\r\n<p>Sacrificing ratio</p>\r\n\r\n<p>X=Old ratio-New Ratio=6/14-42/84=36-42/84=-6/84</p>\r\n\r\n<p>Y=5/14-35/84=30-35/84=-5/84</p>\r\n\r\n<p>Z=3/14-21/84=18-21/84=-3/84</p>\r\n\r\n<p>X:Y:Z=6:5:3</p>','0',1,'2020-09-04 21:16:49','2020-09-04 21:17:20'),(404,'<p>Accounting information given by a company :</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Total assets turnover 3 times</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Net profit margin 10%</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Total assets Rs. 1,00,000</p>\r\n\r\n<p>The net profit is</p>','<p>Total assets turnover ratio= Sales/Total assets=S/100000=3</p>\r\n\r\n<p>So, sales=300000</p>\r\n\r\n<p>Net profit=300000*10%= Rs.30000</p>','0',1,'2020-09-04 21:17:40','2020-09-04 21:18:12'),(405,'<p>&ldquo;Make sufficient provisions for future losses, but do not anticipate future profits.&rdquo; This statement is in accordance to the concept of:</p>','<p>According to Conservatism approach probable losses has to be accounted but probable gains should not be included in financial statement. So, this concept allows accountants to anticipate future losses, rather than future gains</p>','0',1,'2020-09-04 21:18:30','2020-09-04 21:19:02'),(406,'<p>When a firm is dissolved, profit or loss on realisation is shared by the partners</p>','<p>When there is nothing mentioned about the treatment of deficiency of insolvent partner, the judgement of leading case of Garner vs. Murry (1903) is followed.</p>\r\n\r\n<p>As per this case the deficiency of insolvent partner must be borne by the other solvent partners in proportion to their capital, after each solvent partner has brought in cash equal to his own share of loss on realisation (i.e. on profit sharing ratio). To apply this decision, three conditions must be fulfilled</p>\r\n\r\n<p>a) There are two or more than two solvent partners</p>\r\n\r\n<p>b) One or more of partners are solvent</p>\r\n\r\n<p>c) The capitals are not in profit sharing ratio.</p>','0',1,'2020-09-04 21:19:22','2020-09-04 21:19:57'),(407,'<p>Subsequent expenditures that extend the useful life, improve the quality of output, or reduce operating costs of an existing asset beyond their originally estimated levels are</p>','<p>Capital expenditure refers to the investment used by a business to acquire, maintain, extend the useful life of the assets and upgrade fixed assets i.e. to expand business and to generate additional profits.</p>\r\n\r\n<p><strong>Examples: </strong>Purchase of plant and Machinery, motor car, furniture, addition to office building etc.</p>','0',1,'2020-09-04 21:20:19','2020-09-04 21:20:53'),(408,'<p>Marginal-costing technique is useful for</p>','<p>Marginal costing is used for short run decision making, when:</p>\r\n\r\n<ul>\r\n	<li>Business is calculating the break-even level of output.</li>\r\n	<li>Business is considering whether to make or buy a product.</li>\r\n	<li>Business is choosing between two or more alternatives.</li>\r\n	<li>Business is costing a project to determine the minimum possible price to be quoted.</li>\r\n	<li>Business is devising a price strategy.</li>\r\n	<li>Business is abandoning a line of business.</li>\r\n	<li>Business is facing a limiting factor and is deciding about optimum production mix.</li>\r\n</ul>','0',1,'2020-09-04 21:21:12','2020-09-04 21:21:52'),(409,'<p>Which of the following accounting equations is not correct?</p>','<p>The accounting equation is a simple way to view the relationship of financial activities across a business. The equation is typically written as:</p>\r\n\r\n<p>Assets = Liabilities + Owner Equity</p>\r\n\r\n<p>It can also be structured as:</p>\r\n\r\n<p>Liabilities = Assets - Owner Equity</p>\r\n\r\n<p>Owner Equity = Assets - Liabilities</p>','0',1,'2020-09-04 21:22:16','2020-09-04 21:22:47'),(410,'<p>Which one of the following statements is correct?</p>','<p>For increasing the liability, it must be credited and decreasing liability it must be debited. On the other hand, for increasing assets it must be debited and decreasing assets it must be credited. Expenses must be debited and income must be credited</p>','0',1,'2020-09-04 21:23:07','2020-09-04 21:23:45'),(411,'<p>A and B are partners in a firm sharing profit and loss in the ratio of 3 : 2. They admit C into partnership for &frac14; share and the new ratio between A and B is 2 : 1. The sacrificing ratio is</p>','<p>Sacrificing ratio=New ratio-Old ratio</p>\r\n\r\n<p>A=2/4-3/5=10-12/20=-2/20</p>\r\n\r\n<p>B=1/4-2/5=5-8/20=-3/20</p>\r\n\r\n<p>A:B=2:3</p>\r\n\r\n<p>New ratio,</p>\r\n\r\n<p>A=3/4*2/3=6/12</p>\r\n\r\n<p>B=3/4*1/3=3/12</p>\r\n\r\n<p>C=3/12</p>\r\n\r\n<p>A: B: C=2:1:1</p>','0',1,'2020-09-04 21:24:05','2020-09-04 21:24:35'),(412,'<p>Intrinsic value of a share is given by</p>','<p>Intrinsic&nbsp;value&nbsp;Per&nbsp;Share=Net&nbsp;Assets-Preference&nbsp;Share&nbsp;CapitalNo.of&nbsp;Equity&nbsp;Shares</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-04 21:24:55','2020-09-04 21:27:23'),(413,'<p>When a company takes over another one and clearly becomes a new owner, the action is called</p>','<p>An acquisition refers to a corporate transaction wherein a company purchases a portion or entire shares/assets of another company.&nbsp;&nbsp;A new company does not emerge from an acquisition; rather, the smaller company is often consumed and ceases to exist, and its assets become part of the larger company</p>','0',1,'2020-09-04 21:28:00','2020-09-04 21:33:58'),(414,'<p>Read the following statements:</p>\r\n\r\n<p>Which of the following combinations consists of all true statements ?</p>','<p>Financial statements are written records that convey the business activities and the financial performance of a company. Financial statements are often audited by government agencies, accountants, firms, etc. to ensure accuracy and for tax, financing, or investing purposes. These statements are prepared to give users outside of the company, like investors and creditors, more information about the company&rsquo;s financial positions. Publicly traded companies are also required to present these statements along with others to regulatory agencies in a timely manner. Financial statement not only represents the profit and loss of the business but also the assets and liabilities of the business</p>','1',1,'2020-09-04 21:34:25','2020-09-04 21:35:28'),(415,'<p>Which of the following is not a subsidiary book?</p>','<p>List of subsidiary books</p>\r\n\r\n<p>Purchase Books, Purchase return book, sales book, Sales return book, Cash book , journal proper, Bills receivable book, Bills payable book.</p>','0',1,'2020-09-04 21:35:47','2020-09-04 21:36:20'),(416,'<p>Which of the following are the applications of funds?</p>','<p>Application of fund implies the items for which cash outflow is occurred</p>','1',1,'2020-09-04 21:36:45','2020-09-04 21:37:39'),(417,'<p>Variable cost ratio is 60% Sales Rs.20000 and fixed cost Rs.5000, then profit will be</p>','<p>Sales- VC=Contribution-Fixed Cost= Profit</p>\r\n\r\n<p>Rs.20000-12000= Rs.8000-5000=Rs.3000</p>','0',1,'2020-09-04 21:38:11','2020-09-04 21:38:45'),(418,'<p>Accounting concepts are based on</p>','<p>The term concept includes those basic assumptions, conditions and ideas upon which the science of accounting is based</p>','0',1,'2020-09-04 21:39:03','2020-09-04 21:39:36'),(419,'<p>The main purpose of Cost Accounting is to</p>','<p>Cost Accounting is basically the next step to costing. Cost accounting involves analyzing relevant costing data, interpret it and present various management problems to management. So, cost accounting helps to prepare cost accounts following the accounting standard</p>','0',1,'2020-09-04 21:39:54','2020-09-04 21:40:29'),(420,'<p>The concept of budget that requires all levels to work from scratch is</p>','<p>Zero based budgeting in management accounting involves preparing the budget from the scratch with a zero-base. It involves re-evaluating every line item of cash flow statement and justifying all the expenditure that is to be incurred by the department</p>','0',1,'2020-09-04 21:40:48','2020-09-04 21:41:22'),(421,'<p>Minority interest includes</p>','<p>Minority interest = Share in Share capital+ Share in Capital Profit+ Share in revenue profit</p>','0',1,'2020-09-04 21:42:03','2020-09-04 21:42:32'),(422,'<p>Statement I: When there is one or more liquidation and no formation, it is known as acquisition.</p>\r\n\r\n<p>Statement II: When there is one liquidation and one formation it is known as reconstruction.</p>\r\n\r\n<p><strong>&nbsp;Select the correct Codes:</strong></p>','<p>An acquisition refers to a corporate transaction wherein a company purchases a portion or entire shares/assets of another company.&nbsp;&nbsp;A new company does not emerge from an acquisition; rather, the smaller company is often consumed and ceases to exist, and its assets become part of the larger company.</p>\r\n\r\n<p>The term &lsquo;External Reconstruction&rsquo; means the winding up of an existing company and registering itself into a new one after a rearrangement of its financial position. Thus, there are two aspects of &lsquo;External Reconstruction&rsquo;, one, winding up of an existing company and the other, rearrangement of the company&rsquo;s financial position</p>','0',1,'2020-09-04 21:43:05','2020-09-04 21:43:39'),(423,'<p>What is the excess of net assets over consideration paid called?</p>','<p>Any excess of the amount of purchase consideration over the value of net assets of the transferor company acquired by the transferee company should be recognised as goodwill in the financial statement of the transferee company. Any short fall should be shown as a capital reserve</p>','0',1,'2020-09-04 21:43:58','2020-09-04 21:44:32'),(424,'<p>The directors of a company forfeited 1000 shares of Rs. 10each, Rs.7.5 paid up for non-payment of call money @ Rs.2.5 per share, 700 of this shares are re-issued @Rs. 7 per share. The amount transfer to capital reserve A/C would be</p>','<p>Total forfeited amount =1000*7.5=7500</p>\r\n\r\n<p>Loss on re- issue of shares=700*3=2100</p>\r\n\r\n<p>Balance of share forfeiture account=5400</p>\r\n\r\n<p>Amount of profit on unissued shares=7.5*300=2250</p>\r\n\r\n<p>So, capital reserve=5400-2250=Rs.3150</p>\r\n\r\n<p>After any forfeited share has been re-issued, any balance left in forfeited share account represents a capital profit. It is transferred to Capital reserve Account .When all forfeited shares have been issued, the credit balance left on the share forfeiture account is transferred to capital reserve account. But, if all the forfeited shares are not re-issued, the proportionate profit is to be calculated only on the re-issued shares. Only that profit can be transferred.</p>','0',1,'2020-09-04 21:45:40','2020-09-04 21:46:18'),(425,'<p>A company can buy back</p>','<p>No company shall purchase its own shares or other specified securities under</p>\r\n\r\n<p>sub-section (1), unless&mdash;</p>\r\n\r\n<ul>\r\n	<li>All the shares or other specified securities for buy-back are fully paid-up;</li>\r\n</ul>','0',1,'2020-09-04 21:46:37','2020-09-04 21:47:10'),(426,'<p>A, B and C are three equal partners. D is admitted for 1/4th share. What is the sacrificing ratio?</p>','<p><strong>:</strong> Old Ratio,</p>\r\n\r\n<p>A:B:C=1:1:1</p>\r\n\r\n<p>D&rsquo;s share=1/4th</p>\r\n\r\n<p>Remaining share=3/4th</p>\r\n\r\n<p>New ratio</p>\r\n\r\n<p>A:B:C=3/4*1/3=3/12:3/12:3/12</p>\r\n\r\n<p>A:B:C:D=1:1:1:1</p>\r\n\r\n<p>Sacrificing ratio= New ratio-old ratio</p>\r\n\r\n<p>A=1/4-1/3=3-4/12=-1/12</p>\r\n\r\n<p>B=1/4-1/3=-1/12</p>\r\n\r\n<p>C=1/4-1/3=-1/12</p>\r\n\r\n<p>A:B:C=1:1:1</p>','0',1,'2020-09-04 21:47:29','2020-09-04 21:47:56'),(427,'<p>Which method of HR accounting was developed by Lev and Schwartz?</p>','<p>The Lev and Schwartz model states that the human resource of a co is the summation of value of all the Net present value (NPV) of expenditure on employees. The human capital embodied in a person of age r is the present value of his earning from employment.</p>','0',1,'2020-09-04 21:48:13','2020-09-04 21:48:44'),(428,'<p>Current Cost Accounting method attempted to match the current income against which cost?</p>','<p>Under Current Cost Accounting method, the cost categories and the various cost items and the items in the balance sheet are shown at the current cost rather than the historical cost and the profit is determined under this method, the cost categories and the various cost items and the items in the balance sheet are shown at the current cost rather than the historical cost. Current cost accounting (CCA) method was proposed by the Sandilands Committee of UK.</p>','0',1,'2020-09-04 21:48:59','2020-09-04 21:49:32'),(429,'<p>IFRS-2 applies to share-based payment transaction in which an entity------- goods or services</p>','<p>A share-based payment is a transaction in which the entity receives or acquired goods or services either as consideration for its equity instruments or by incurring liabilities for amounts based on the price of the entity&rsquo;s share or other equity instruments of the entity. The accounting requirement for the share-based payments depends on how the transaction will be settled, that is by the issuance of a) equity b) cash or c) equity or cash</p>','0',1,'2020-09-04 21:49:55','2020-09-04 21:50:27'),(430,'<p>The basic concept related to profit and loss account is /are</p>','<p><strong>Matching concept of accounting</strong><strong>&nbsp;</strong>defines and states that &ldquo;while preparing the income statement, revenue and profits are matched with the related expenses incurred in generating them&rdquo;. So as per matching concept in determining the net profit from business operations all cost which is applicable to revenue of the period should be charged against that. <strong>According to realisation concept</strong>, which is also known as the &ldquo;revenue recognition concept&rdquo;, revenue is considered as being earned on the date on which it is realized, i.e., the date on which goods and services are transferred to customers either for cash or for credit. &ldquo;Credit transactions create debtors and the promise of debtors to make payment is sufficient for the purpose of realising revenue. The realisation concept is important in ascertaining the exact profit earned during a period in a business concern. This concept is very important as it prevents firms from inflating their profits by recording sales and incomes that are likely to accrue</p>','0',1,'2020-09-04 21:50:47','2020-09-04 21:51:22'),(431,'<p>Which of the following equation is correct?</p>','<p>Cost of Goods Sold (COGS) = Opening stock+ Purchase-Closing stock</p>\r\n\r\n<p>Sales= COGS+ Gross profit</p>\r\n\r\n<p>Gross profit=Sales-GOGS</p>','0',1,'2020-09-04 21:51:41','2020-09-04 21:52:14'),(432,'<p>Which of the following is not an Accounting concept ?</p>','<p><strong>Accounting Concept</strong></p>\r\n\r\n<ul>\r\n	<li>Separate entity concept</li>\r\n	<li>Going concern Concept</li>\r\n	<li>Dual Concept</li>\r\n	<li>Money Measurement Concept</li>\r\n	<li>Cost Concept or Historical cost concept</li>\r\n	<li>Accounting period concept</li>\r\n	<li>Realisation Concept</li>\r\n	<li>Matching Concept</li>\r\n	<li>Accrual Concept</li>\r\n</ul>','0',1,'2020-09-04 21:52:43','2020-09-04 21:53:12'),(433,'<p>In the context of Standard Costing; Basic Standard is established for</p>','<p>Basic standard can be defined as the standard which is unaltered and is used over for a longer period of time and do not reflect current conditions. It is also known as the fixed or static standard</p>','0',1,'2020-09-04 21:53:28','2020-09-04 21:53:56'),(434,'<p>Which of the following are applications of funds?</p>','<p>Application of fund means outflow of funds i.e. the items for which organisations needs to pay</p>','0',1,'2020-09-04 21:54:22','2020-09-04 21:54:48'),(435,'<p><strong>In the context of Funds Flow Analysis, the word &ldquo;funds&rdquo; is used to define</strong></p>','<p>In narrow sense fund means <strong>cash</strong>. In broader sense fund means <strong>all the financial resources</strong> used in the business. In popular sense funds means <strong>working capital</strong></p>','0',1,'2020-09-04 21:55:08','2020-09-04 22:50:17'),(437,'<p>Consider double of the form</p>\r\n\r\n<p>&nbsp;<em>h</em><em>k,i</em><em>=</em><em>h</em><em>1</em><em>k</em><em>+i</em><em>h</em><em>2</em><em>k</em>&nbsp;mod<em> m</em></p>\r\n\r\n<p>where <em>h</em><em>1</em><em>k</em><em>=k</em>&nbsp;mod<em> m</em></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <em>h</em><em>2</em><em>k</em><em>=1+</em><em>k </em>mod <em>n</em></p>\r\n\r\n<p>Where <em>n=m-1 </em>and <em>m=701</em></p>\r\n\r\n<p>For <em>k=123456</em>, what is the difference between first and second probes in terms of slots?</p>','<p><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>k</mi><mo>=</mo><mn>123456</mn><mi>m</mi><mo>=</mo><mn>700</mn><mi>n</mi><mo>=</mo><mn>700</mn><mspace linebreak=\"newline\"/><msub><mi>h</mi><mn>1</mn></msub><mo>(</mo><mi>k</mi><mo>)</mo><mo>=</mo><mi>k</mi><mi>m</mi><mi>o</mi><mi>d</mi><mi>m</mi><msub><mi>h</mi><mn>1</mn></msub><mo>(</mo><mn>123456</mn><mo>)</mo><mo>=</mo><mn>123456</mn><mi>m</mi><mi>o</mi><mi>d</mi><mn>701</mn><mo>=</mo><mn>80</mn><mspace linebreak=\"newline\"/><msub><mi>h</mi><mn>2</mn></msub><mo>(</mo><mi>k</mi><mo>)</mo><mo>=</mo><mn>1</mn><mo>+</mo><mo>(</mo><mi>k</mi><mi>m</mi><mi>o</mi><mi>d</mi><mi>n</mi><mo>)</mo><msub><mi>h</mi><mn>2</mn></msub><mo>(</mo><mn>123456</mn><mo>)</mo><mo>=</mo><mn>1</mn><mo>+</mo><mn>123456</mn><mi>m</mi><mi>o</mi><mi>d</mi><mn>700</mn><mo>=</mo><mn>257</mn><mspace linebreak=\"newline\"/><mi>h</mi><mo>(</mo><mi>k</mi><mo>,</mo><mi>i</mi><mo>)</mo><mo>=</mo><mi>h</mi><mo>(</mo><mi>k</mi><mo>,</mo><mn>0</mn><mo>)</mo><mo>