ened species (version 3.1)?</p>','<p>1. Reduction of population &ge; 90% over the last 10 years or three-generation, whichever is the longer.</p>\r\n\r\n<p>2. The extent of occurrence estimated to be less than 100 km2 or less than 10 km2.</p>\r\n\r\n<p>3. Population size estimate to number fewer than 50 mature individuals. 4. Quantitative analysis showing the probability of extinction in the wild is at least 50% within 10 years or three generations, whichever is the longer (up to a maximum of 100 years).</p>','1',1,'2020-09-09 13:25:16','2020-09-09 13:28:11'),(651,'<p>Which of the following hypothesis best explains the occurrence of Himalayan floral elements in Western Ghats of India?&nbsp;&nbsp;</p>','<p>In the Nilgiris, Annamalia and Palani Hills of the Western Ghats one can find and bright red flowers of Rhododendron arboseum plants, the only rhododendron in the 1600 km mountainous stretch. One of the commonly held theories about the occurrence of the species is that they are emnants from the last glaciation events. He explained that within a long-term ice age, there are intermediate phases of cold climate called glacial periods alternating with warmer climate called interglacial periods</p>','0',1,'2020-09-09 13:28:27','2020-09-09 13:29:00'),(652,'<p>Which of the following is not a characteristic of late-successional forest plant species?</p>','<p>Long speed seed dispersal influences many key aspects of biology of plants including spreading of invasive species, metapopulation dynamics, and diversity and dynamis in plant communities</p>','0',1,'2020-09-09 13:29:20','2020-09-09 13:29:57'),(653,'<p>Which of the following organisms do not possess the ability to fix nitrogen?</p>','<p>Nitrogen fixation refers to the conversion of atmospheric nitrogen gas (N2) into a form usable by plants and other organisms. Organisms specialized for high altitude such as Yak, Tibetan gazelle, vicunas, Ilam mountain goats and certain birds etc. are not capable of nitrogen fixation</p>','0',1,'2020-09-09 13:30:35','2020-09-09 13:31:08'),(654,'<p>Which of the following greenhouse gases has got highest atmospheric life time?</p>','<p><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>C</mi><msub><mi>O</mi><mn>2</mn></msub><mo>&#160;</mo><mo>&#8211;</mo><mo>&#160;</mo><mn>5</mn><mo>-</mo><mn>200</mn><mo>&#160;</mo><mi>y</mi><mi>e</mi><mi>a</mi><mi>r</mi><mi>s</mi><mo>,</mo><mo>&#160;</mo><mi>C</mi><msub><mi>H</mi><mn>4</mn></msub><mo>&#160;</mo><mo>&#8211;</mo><mo>&#160;</mo><mn>12</mn><mo>&#160;</mo><mi>y</mi><mi>r</mi><mi>s</mi><mo>,</mo><mo>&#160;</mo><msub><mi>N</mi><mn>2</mn></msub><mi>O</mi><mo>&#160;</mo><mo>&#8211;</mo><mo>&#160;</mo><mn>114</mn><mo>&#160;</mo><mi>y</mi><mi>e</mi><mi>a</mi><mi>r</mi><mi>s</mi><mo>,</mo><mo>&#160;</mo><mi>C</mi><mi>F</mi><mi>C</mi><mi>s</mi><mo>&#160;</mo><mo>&#8211;</mo><mo>&#160;</mo><mn>67</mn><mo>-</mo><mn>33</mn><mo>&#160;</mo><mi>y</mi><mi>e</mi><mi>a</mi><mi>r</mi><mi>s</mi></math></p>','0',1,'2020-09-09 15:24:28','2020-09-09 15:25:52'),(655,'<p>Possible explanations for the age-related decline in primary productivity of trees are.</p>\r\n\r\n<p>Which of the above is/are correct?</p>','<p>Age related decline in net primary productivity is primarily responsible for decline and in rate of stand biomass accumulation. Other reasons include (a) photosynthesis-respiration imbalance (b) increased nutrient limitation (c) increased hydraulic resistance and (d) reduced allocation to stem production</p>','1',1,'2020-09-09 15:26:19','2020-09-09 15:27:45'),(656,'<p>In a census for a lake fish, 10 individuals were marked and released. In second sampling after a few days 15 individuals were caught, of which 5 individuals were found marked. The estimated population of the fish in the lake will be</p>','<p><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>w</mi><mi>e</mi><mo>&#160;</mo><mi>c</mi><mi>a</mi><mi>n</mi><mo>&#160;</mo><mi>f</mi><mi>i</mi><mi>n</mi><mi>d</mi><mo>&#160;</mo><mi>t</mi><mi>h</mi><mi>e