o>=</mo><mn>15</mn><mo>&#215;</mo><mn>10</mn><mo>/</mo><mn>5</mn><mo>&#160;</mo><mo>=</mo><mn>30</mn></math></p>','0',1,'2020-09-09 15:28:01','2020-09-09 15:29:02'),(657,'<p>Which of these programs is used to conserve a species facing extinction?</p>','<p>Natural resources &amp; sustainable use are used for material or substances occurring in nature. Edge effect is change in population structure that occur at the boundary of two capital. Captive breeding is breeding of animals in controlled environment within well-defined settings</p>','0',1,'2020-09-09 15:29:17','2020-09-09 15:29:59'),(658,'<p>Free&ndash;living nitrogen fixers can survive in different ecological niches. Identify the incorrect combination from the following list</p>','<p>Azotobacter is found in neutral &amp; alkaline soil</p>','0',1,'2020-09-09 15:30:19','2020-09-09 15:30:51'),(659,'<p>A plot of soil contaminated with diesel oil was inoculated with oyster mushrooms. After 4 weeks, more than 95% of the polycyclic aromatic hydrocarbons had been reduced to non&ndash;toxic compounds. This process is called</p>','<p>Mycoremediation, fungi are used to decontaminate the area</p>','0',1,'2020-09-09 15:31:07','2020-09-09 15:31:40'),(660,'<p>The speciation in which a population splits into two geographically isolated populations experience dissimilar selective pressure and genetic drift is knwon as</p>','<p>Allopatric - population splits into geographically isolated pop. peripatric - splition of smaller peripheral population that are prevented from exchanging genes. Parapatric - Partial separation afforded by geography sympatric - formation of descendant species within geography</p>','0',1,'2020-09-09 15:32:00','2020-09-09 15:32:32'),(661,'<p>Which of the following set of observations is true with reference to a comparison of aquatic (A) and terrestrial (T) ecosystems?&nbsp;</p>','<p>A food chain in terrestrial ecosystem starts with grasses and goes through grasshoppers, the frogs, the snake, the hawk in an orderly sequential arrangement based on the food habitats, whereas in a pond the order would start with phytoplankton&rsquo;s, going through water fleas, smaller fish, bigger fish, birds, larger animals and so on</p>','0',1,'2020-09-09 15:32:52','2020-09-09 15:33:33'),(662,'<p>A small lake has three trophic levels phytoplankton (autotrophs), Zooplankton (herbivore) and planktivorous fish (primary carnivore). Into this lake a population of piscivorous fish (secondary carnivore) was introduced to study the &#39;top &ndash; down&#39; effects&quot;. What is the expected long&ndash;term consequence of such an introduction to phytoplankton and zooplankton trophic levels?&nbsp;</p>','<p>Secondary carnivore feed on primary carnivore which feed on zooplankton. If primary carnivores will decrease then, zooplanktons will increase. When zooplanktons will increase, phytoplankton will decrease as they feed on autotrophs</p>','0',1,'2020-09-09 15:33:50','2020-09-09 15:34:26'),(663,'<p>The population density of an insect species increases from 40 to 46 in one month. If the birth rate during that period is 0.4 what is the death rate?</p>','<p><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>D</mi><mi>e</mi><mi>a</mi><mi>d</mi><mo>&#160;</mo><mi>R</mi><mi>a</mi><mi>t</mi><mi>e</mi><mo>=</mo><mfrac><mrow><mi>F</mi><mi>i</mi><mi>n</mi><mi>a</mi><mi>l</mi><mo>&#160;</mo><mi>P</mi><mi>o</mi><mi>p</mi><mi>u</mi><mi>l</mi><mi>a</mi><mi>t</mi><mi>i</mi><mi>o</mi><mi>n</mi><mo>-</mo><mi>I</mi><mi>n</mi><mi>i</mi><mi>t</mi><mi>i</mi><mi>a</mi><mi>l</mi><mo>&#160;</mo><mi>P</mi><mi>o</mi><mi>p</mi><mi>u</mi><mi>l</mi><mi>a</mi><mi>t</mi><mi>i</mi><mi>o</mi><mi>n</mi></mrow><mrow><mi>B</mi><mi>i</mi><mi>r</mi><mi>t</mi><mi>h</mi><mo>&#160;</mo><mi>R</mi><mi>a</mi><mi>t</mi><mi>e</mi></mrow></mfrac><mspace linebreak=\"newline\"/><mo>=</mo><mfrac><mrow><mn>46</mn><mo>-</mo><mn>40</mn></mrow><mrow><mn>0</mn><mo>.</mo><mn>4</mn></mrow></mfrac><mspace linebreak=\"newline\"/><mo>=</mo><mfrac><mrow><mn>6</mn><mo>&#215;</mo><mn>10</mn></mrow><mrow><mn>0</mn><mo>.</mo><mn>4</mn></mrow></mfrac><mo>&#160;</mo><mo>=</mo><mn>15</mn><mo>%</mo><mspace linebreak=\"newline\"/><mo>=</mo><mfrac><mn>15</mn><mn>100</mn></mfrac><mo>=</mo><mn>0</mn><mo>.</mo><mn>15</mn><mo>%</mo></math></p>','0',1,'2020-09-09 15:34:42','2020-09-09 15:38:41'),(664,'<p>An example of the species interaction called commensalism is</p>','<p>Commensalism defines the co-action in which two on more species are mutually associated in activities centering on food and one species at least, derives benefits from the association, while the other associates are neither benefitted nor harmed</p>','0',1,'2020-09-09 15:39:07','2020-09-09 15:39:41'),(665,'<p>In which ecosystem is the detrital pathway of energy flow most important?</p>','<p>There is abundance of decomposers which aid in high rate of decomposition for nutrient recycling. Ground resource availability controls the above ground biomass &amp; community structure of tropical rain forest. So, this is important</p>','0',1,'2020-09-09 15:39:57','2020-09-09 15:40:25'),(666,'<p>A general increase in the average body mass of animal population within a species with latitude is known as</p>','<p>According to Bergmann&#39;s rule, animals have large body size in cold climates as compared to warm climates. Large bodies have a smaller surface area to volume ratios so lesser heat is dissipated in the environment. In warm climates the animals are required to expel heat, so bodies are smaller and more linear</p>','0',1,'2020-09-09 15:40:45','2020-09-09 15:41:11'),(667,'<p>Reproductive isolation between segments of a single population is termed</p>','<p>Reproductive isolation between segments of a single population is termed</p>\r\n\r\n<p>disruptive divergence</p>','0',1,'2020-09-09 15:41:27','2020-09-09 15:41:59'),(668,'<p>Hardy-Weinberg law will NOT operate under conditions, when</p>','<p>When a population is in Hardy-Weinberg equilibrium for a gene. It is not evolving, and allele frequencies will stay the same across generations. There are five basic Hardy-Weinberg assumptions, no mutation, random mating, no gene flow, infinite population size and no. selection.</p>','0',1,'2020-09-09 15:42:15','2020-09-09 15:42:49'),(669,'<p>Which is correct graphical representation of effect of disturbance on species diversity as Island biogeography<strong>? </strong></p>\r\n\r\n<p>&nbsp;</p>','<p>According to &quot;equilibrium model of island biogeography&quot; the farther islands have lower probability of immigration as compared to nearer islands. It also states that species numbers tend to increase with increasing area and with greater area the rate of extinction declines. The graph shows a higher immigration thereby indicating that the island is closer/nearer to the mainland. In addition, it shows a lower extinction rate thus indicating that it is a large island.</p>','0',1,'2020-09-09 15:45:07','2020-09-09 15:50:21'),(670,'<p>Which statement is correct for r- selected species?</p>','<p>r-selected species are those that emphasize high growth rates, typically exploit less-crowded ecological niches, and produce many offspring, each of which has a relatively low probability of surviving to adulthood (i.e., high r, low K). A typical r species is the dandelion</p>','0',1,'2020-09-09 15:50:35','2020-09-09 15:51:11'),(671,'<p>Which of the following is not a characteristic of climax community?</p>','<p>The final stage of succession is called the climax or climax community. It is the final or stable community in a successional series. It is self-perpetuating and in equilibrium with the physical and biotic environment. Climax communities undergo changes in structure as a result of birth, death and growth processes in the community</p>','0',1,'2020-09-09 15:52:02','2020-09-09 15:52:32'),(672,'<p>In abandoned area first nitrogen fixing communities arrives and carry out nitrogen fixation, later on this community is replaced by non-nitrogen fixing species. In the mechanism of succession this is in general agreement according to</p>','<p>Facilitation model: It is based on the Clements ideas of relay communities in which the seral community is believed to modify. According to this model each new community in course of time prepares suitable ground to facilitate its own replacement by another better suited community. So, each community like a &lsquo;relay process&rsquo; delivers the habitat to next or higher status community. This model has not been supported by any proper evidence.</p>\r\n\r\n<p>Tolerance model: This model is based on the concept of IFC or initial floritic composition which suggests that arrival of new invaders of higher life form types necessarily does not eliminate pioneers. According to this model, only such higher succession or climax species are able to join which can be tolerated by the early settlers. So, the tolerance model differs from Clement&rsquo;s relay succession model in the sense that as the succession proceeds, more and higher life form plants are tolerated to join and co-exist, than necessarily replacing the earlier component species. With the passage of time, species which mutually tolerate each other gain control over the habitat to form the climax vegetation.</p>\r\n\r\n<p>Inhibition model: According to this model, the early arrived species (populations) on a new habitat may develop counter-mechanism to normal replacement process. For example, the allelopathy may be the common counter-acting adaptation to thwart or inhibit the entry of late arriving species. This kind of highly adaptated early stage communities may not be common on a wide range of habitats. In such a case, relay succession gains control only after the death of the allelopathic plants. Since inhibition model lacks universality, so it was also criticised</p>','0',1,'2020-09-09 15:52:48','2020-09-09 15:53:27'),(673,'<p>Mammalian jaw has evolved from</p>','<p>Mammalian jaw has evolved from Dentary and squamosal bones</p>','0',1,'2020-09-09 15:54:20','2020-09-09 15:54:49'),(674,'<p>Largest reservoir of carbon is</p>','<p>Largest reservoir of carbon is Ocean sediments</p>','0',1,'2020-09-09 15:55:05','2020-09-09 15:55:38'),(675,'<p>The most commonly used method of estimating primary productivity of a pond involves measurement of the amount</p>','<p>The most commonly used method of estimating primary productivity of a pond involves measurement of the amount of Oxygen released</p>','0',1,'2020-09-09 15:57:01','2020-09-09 15:58:03'),(676,'<p>The following figure shows McArthur and Wilson&#39;s equilibrium model of biota on a single Island</p>\r\n\r\n<p><img alt=\"\" src=\"https://teachinns.com/storage/uploads/banner/5f58762b54f00.JPG\" style=\"height:315px; width:399px\" /></p>\r\n\r\n<p>In this figure, term A, B. C and Din order are</p>','<p>(A)Immigration, (B)extinction, (C) equilibrium number of species, (D)size of species pool</p>','0',1,'2020-09-09 15:59:15','2020-09-09 15:59:51'),(677,'<p>According to MacArthur and Wilson&#39;s equilibrium theory, which of the following is true?</p>','<p>Equilibrium Theory of Island Biogeography (ETIB)- The ETIB describes the theoretical relationship between immigration and extinction of species to islands, depending on their size and distance from the mainland or other species source. According to ETIB, the number of species present on an island is determined by a balance between immigration and extinction. Generally, as the number of species present increases, the immigration rate decreases and the extinction rate increases. There are two general relationships to remember: a) Immigration is higher on near islands than on distant islands (in relation to the mainland), hence the equilibrium number of species present will be greater on near islands. b)&nbsp; Extinction is higher on small islands than on larger islands, hence the equilibrium number of species present will be greater on large islands. Therefore, the number of species on near, large islands &gt; The number of species on distant, small islands</p>','0',1,'2020-09-09 16:00:12','2020-09-09 16:00:44'),(678,'<p>Primary production in aquatic ecosystem is measured using Light and Dark bottle technique. In this method, as an indirect measure of photosynthetic production, dissolved oxygen concentration of the pond water enclosed in a BOD bottle is measured initially (I) and after a fixed duration of incubation in a light bottle (L) and a dark bottle (D). Then the gross and net primary productions are estimated is</p>','<p>The light/dark bottle is a way of measuring primary production by comparing before and after concentrations of dissolved oxygen</p>','0',1,'2020-09-09 16:01:01','2020-09-09 16:01:37'),(679,'<p>Gause&#39;s competitive exclusion principle states that two species with identical niches cannot coexist indefinitely. Which of the following statements is the most appropriate regarding the validity of the principle?</p>','<p>In ecology, the competitive exclusion principle, sometimes referred to as Gause&#39;s law of competitive exclusion or just Gause&#39;s law, is a proposition that states that two species competing for the same resource cannot coexist at constant population values, if other ecological factors remain constant. When two competing life forms attempt to occupy the same niche, only one outcome is possible: One life form will drive out the other</p>','0',1,'2020-09-09 16:01:53','2020-09-09 16:02:24'),(680,'<p>In a lake ecosystem, bottom up effects (B) refers to control of a lower trophic level by the higher trophic levels and top down effects (T) refer to the opposite. In a lake with three trophic levels - Phytoplankton (P), Zooplankton (Z) and Carnivore (C),</p>','<p>In the top-down control, the populations of the organisms lower trophic levels (bottom of the pyramid) are controlled by the organisms at the top. This approach is also called the predator-controlled food web of an ecosystem. The bottom-up control is driven by the presence or absence of the producers in the ecosystem. Changes in their population will affect the population of all the species in the food web, and thus, the ecosystem. This approach is also called the resource-controlled (or food-limited) food web of an ecosystem</p>','0',1,'2020-09-09 16:03:42','2020-09-09 16:04:15'),(681,'<p>Which of the following groups of species are typical of grassland habitats in India</p>','<p>Black buck, wolf, great Indian bustard, lesser florican.</p>','0',1,'2020-09-09 16:04:34','2020-09-09 16:05:15'),(682,'<p>The Hutchinsonian concept of ecological niche is based on</p>','<p>The Hutchinsonian niche is an &quot;n-dimensional hypervolume&quot;, where the dimensions are environmental conditions and resources, that define the requirements of an individual or a species to practice &quot;its&quot; way of life, more particularly, for its population to persist. The &quot;hypervolume&quot; defines the multi-dimensional space of resources (e.g., light, nutrients, structure, etc.) available to (and specifically used by) organisms, and &quot;all species other than those under consideration are regarded as part of the coordinate system</p>','0',1,'2020-09-09 16:05:33','2020-09-09 16:06:04'),(683,'<p>Which of the following is not a physiological characteristic of early successional plants?</p>','<p>Early successional plants tend to have high rates of photosynthesis and respiration, high rates of resource uptake, and high light compensation points, whereas late successional plants often have opposite characteristics</p>','0',1,'2020-09-09 16:06:19','2020-09-09 16:06:54'),(684,'<p>Aquatic primary production was measured using light-and-Dark Bottle technique. If the initial oxygen concentration was I and the final oxygen concentration in the light bottle was L and that in the dark bottle D, the gross productivity (in terms of oxygen released) is given as</p>','<p>Light and Dark Bottle Method is employed to measure primary productivity in an aquatic ecosystem such as a pond. It is based upon the assumption that the amount of oxygen produced is proportional to gross production because one molecule of oxygen is produced for each atom of carbon fixed. Samples of water from different depths are placed in paired bottles. One of the paired bottles is covered with black tape or aluminum foil to exclude light and other is kept clear to admit light and allow photosynthesis. The oxygen concentration of the bottles is determined by Winkles method. The bottles are suspended to the same depth from where samples were collected with the help of string. After 24 hours the bottles are removed their oxygen concentration is determined and compared with the concentration at the beginning. The decline of oxygen in the dark bottle indicates the amount of respiration by producers and consumers where the oxygen change in the light bottle reflects the net result of oxygen consumed by respiration and oxygen produced. Adding respiration and production together or subtracting final oxygen concentration in the dark bottle from that in the light bottles give an estimate of gross productivity for 24 hours. This method has its problems. Some of the respiration attributed to phytoplankton may be bacterial. The phytoplankton population may increase in the bottle during the experimental time but not in dark bottle. Also, the procedure is based on the assumption that respiration in the dark is the same as in the light</p>','0',1,'2020-09-09 16:07:13','2020-09-09 16:07:47'),(685,'<p>Wetlands are conserved internationally through an effort called as</p>','<p>The Ramsar Convention on Wetlands of International Importance especially as Waterfowl Habitat is an international treaty for the conservation and sustainable use of wetlands. It is also known as the Convention on Wetlands</p>','0',1,'2020-09-09 16:08:02','2020-09-09 16:08:29'),(686,'<p>Autotrophs in the aquatic ecosystem, unlike their counterparts in the terrestrial ecosystem, are mostly microscopic and very low in indigestible (to the herbivores) matter. This explains the fact that compared to the terrestrial ecosystem, in the aquatic ecosystem</p>','<p>Productivity/Biomass ratios are higher and energy transfer rates to higher trophic levels are faster</p>','0',1,'2020-09-09 16:08:49','2020-09-09 16:09:23'),(687,'<p>A grasshopper population is being assessed by the capture-mark-release-recapture method. On the first day, 100 grasshoppers were captured from a given area in 1 hour time, marked and released. On the next day during recapture, 10 marked and 90 unmarked grasshoppers could be found in the same time period from the same area. What will be the estimated population size in the given area?</p>','<p><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>P</mi><mi>o</mi><mi>p</mi><mi>u</mi><mi>l</mi><mi>a</mi><mi>t</mi><mi>i</mi><mi>o</mi><mi>n</mi><mo>&#160;</mo><mi>s</mi><mi>i</mi><mi>z</mi><mi>e</mi><mo>=</mo><mo>&#160;</mo><mfrac><mrow><mi>M</mi><mo>&#215;</mo><mi>p</mi></mrow><mi>m</mi></mfrac><mspace linebreak=\"newline\"/><mo>=</mo><mfrac><mrow><mn>100</mn><mo>&#215;</mo><mn>100</mn></mrow><mn>10</mn></mfrac><mspace linebreak=\"newline\"/><mo>=</mo><mn>1000</mn><mspace linebreak=\"newline\"/><mi>P</mi><mo>=</mo><mo>&#160;</mo><mi>P</mi><mi>o</mi><mi>p</mi><mi>u</mi><mi>l</mi><mi>a</mi><mi>t</mi><mi>i</mi><mi>o</mi><mi>n</mi><mo>&#160;</mo><mi>s</mi><mi>i</mi><mi>z</mi><mo>;</mo><mo>&#160;</mo><mi>m</mi><mo>=</mo><mi>r</mi><mi>e</mi><mi>c</mi><mi>a</mi><mi>p</mi><mi>t</mi><mi>u</mi><mi>r</mi><mi>e</mi><mi>d</mi><mo>&#160;</mo><mi>a</mi><mi>n</mi><mi>i</mi><mi>m</mi><mi>a</mi><mi>l</mi><mo>;</mo><mo>&#160;</mo><mi>M</mi><mo>=</mo><mo>&#160;</mo><mi>F</mi><mi>i</mi><mi>r</mi><mi>s</mi><mi>t</mi><mo>&#160;</mo><mi>m</mi><mi>a</mi><mi>r</mi><mi>k</mi><mi>e</mi><mi>d</mi><mo>&#160;</mo><mi>s</mi><mi>a</mi><mi>m</mi><mi>p</mi><mi>l</mi><mi>e</mi><mo>;</mo><mo>&#160;</mo><mi>p</mi><mo>=</mo><mo>&#160;</mo><mi>s</mi><mi>e</mi><mi>c</mi><mi>o</mi><mi>n</mi><mi>d</mi><mo>&#160;</mo><mi>m</mi><mi>a</mi><mi>r</mi><mi>k</mi><mi>e</mi><mi>d</mi><mo>&#160;</mo><mi>s</mi><mi>a</mi><mi>m</mi><mi>p</mi><mi>l</mi><mi>e</mi></math></p>','0',1,'2020-09-09 16:09:44','2020-09-09 16:12:33'),(688,'<p>All of the following statements about ecology are correct except:</p>','<p>Ecology is the study of the interactions between biotic and abiotic aspects of the environment. Ecology is a discipline that is independent from natural selection and evolutionary history. Ecology spans increasingly comprehensive levels of organization, from individuals to ecosystems</p>','0',1,'2020-09-09 16:12:52','2020-09-09 16:13:30'),(690,'<p>Nitrate reductase is an important enzyme for nitrate assimilation. Given below are some statement on nitrate reductase enzyme</p>\r\n\r\n<p>Which one of the following combination of statements on nitrate reductase mentioned above is correct?</p>','<p>One of the prosthetic groups complexed with pterin is molybdenum</p>','1',1,'2020-09-09 16:14:20','2020-09-09 16:15:33'),(691,'<p>Pyramid of biomass may be inverted it</p>','<p>The pyramid of biomass in sea is inverted because biomass of fish exceeds that of phytoplankton and in this scenario the biomass of trophic level depends on the reproductive potential and the longevity of the member. Marine environment has inverted biomass pyramids. Phytoplankton has much less lifespan than fish</p>','0',1,'2020-09-09 16:15:46','2020-09-09 16:16:14'),(692,'<p>Major source of green house gases are</p>','<p>Carbon dioxide (CO2) makes up the vast majority of greenhouse gas emissions from the sector, but smaller amounts of methane (CH4) and nitrous oxide (N2O) are also emitted. These gases are released during the combustion of fossil fuels, such as coal, oil, and natural gas, to produce electricity</p>','0',1,'2020-09-09 16:16:27','2020-09-09 16:16:54'),(693,'<p>Deepest enriched soil with nutrients is present at</p>','<p>Deepest enriched soil with nutrients is present at Tropical rain forests</p>','0',1,'2020-09-09 16:17:37','2020-09-09 16:18:04'),(694,'<p>Among the following which statement is false about r-selected species</p>','<p>The production of numerous small offspring followed by exponential population growth is the defining characteristic of r-selected species. They require short gestation periods, mature quickly (and thus require little or no parental care), and possess short life spans</p>','0',1,'2020-09-09 16:18:18','2020-09-09 16:19:13'),(695,'<p>Hardy Weinberg law operates on</p>','<p>When a population is in Hardy-Weinberg equilibrium for a gene. It is not evolving, and allele frequencies will stay the same across generations. There are five basic Hardy-Weinberg assumptions, no mutation, random mating, no gene flow, infinite population size and no. selection.</p>','0',1,'2020-09-09 16:19:46','2020-09-09 16:20:15'),(696,'<p>ICBN stands for</p>','<p>ICBN stands for International Code for Botanical Nomenclature</p>','0',1,'2020-09-09 16:20:41','2020-09-09 16:22:11'),(697,'<p>Random change of gene frequency in a population is termed as</p>','<p>In population genetics, gene flow (also known as gene migration or allele flow) is the transfer of genetic variation from one population to another. If the rate of gene flow is high enough, then two populations are considered to have equivalent allele frequencies and therefore effectively be a single population</p>','0',1,'2020-09-09 16:59:26','2020-09-09 16:59:56'),(698,'<p>Speciation occurring due to geographical barrier is termed as</p>','<p>Allopatric speciation, also known as geographic speciation, is speciation that occurs when biological populations of the same species become isolated due to geographical changes such as mountain building or social changes such as emigration</p>','0',1,'2020-09-09 17:00:19','2020-09-09 17:01:05'),(699,'<p>Hard-Weinberg law in a population represents</p>','<p>When a population is in Hardy-Weinberg equilibrium for a gene. It is not evolving, and allele frequencies will stay the same across generations. There are five basic Hardy-Weinberg assumptions, no mutation, random mating, no gene flow, infinite population size and no. selection.</p>','0',1,'2020-09-09 17:01:34','2020-09-09 17:02:04'),(700,'<p>Among the following which has highest Productivity/Biomass ratio</p>',NULL,'0',1,'2020-09-09 17:48:44','2020-09-09 17:48:44'),(701,'<p>Genetic Drift occurs by<strong> </strong></p>','<p>Genetic drift is a random process that can lead to large changes in populations over a short period of time. Random drift is caused by recurring small population sizes, severe reductions in population size called &quot;bottlenecks&quot; and founder events where a new population starts from a small number of individuals</p>','0',1,'2020-09-09 17:49:40','2020-09-09 17:50:09'),(702,'<p><strong>A characteristic feature of K-selected species is</strong></p>','<p>K-selected species possess relatively stable populations and tend to produce relatively low numbers of offspring; however, individual offspring tend to be quite large in comparison with r-selected species. K-selected species are characterized by long gestation periods lasting several months, slow maturation (and thus extended parental care), and long-life spans</p>','0',1,'2020-09-09 17:50:27','2020-09-09 17:51:07'),(703,'<p>In grasslands egret feeds follows grazing cows. Cow during grazing exposes insects from grasses to egrets. This is an example of</p>','<p>Commensalism, in biology, a relationship between individuals of two species in which one species obtains food or other benefits from the other without either harming or benefiting the latter</p>','0',1,'2020-09-09 17:51:22','2020-09-09 17:51:52'),(704,'<p>Type Ill survivorship curve is shown by</p>','<p>A survivorship curve is a graph showing the number or proportion of individuals surviving to each age for a given species or group (e.g. males or females). Survivorship curves can be constructed for a given cohort (a group of individuals of roughly the same age) based on a life table. Type I or convex curves are characterized by high age-specific survival probability in early and middle life, followed by a rapid decline in survival in later life. They are typical of species that produce few offspring but care for them well, including humans and many other large mammals. Type II or diagonal curves are an intermediate between Types I and III, where roughly constant mortality rate/survival probability is experienced regardless of age. Some birds and some lizards follow this pattern. Type III or concave curves have the greatest mortality (lowest age-specific survival) early in life, with relatively low rates of death (high probability of survival) for those surviving this bottleneck. This type of curve is characteristic of species that produce a large number of offspring. This includes most marine invertebrates. For example, oysters produce millions of eggs</p>','0',1,'2020-09-09 17:52:06','2020-09-09 17:52:37'),(705,'<p>Biodiversity hotspots arc characterized on the basis of</p>','<p>A biodiversity hotspot is a biogeographic region that is both a significant reservoir of biodiversity and is threatened with destruction. The term biodiversity hotspot specifically refers to 25 biologically rich areas around the world that have lost at least 70 percent of their original habitat</p>','0',1,'2020-09-09 17:52:50','2020-09-09 17:53:21'),(706,'<p>Which of the following index does not show relative abundance of species?</p>','<p>Relative species abundance is a component of biodiversity and refers to how common or rare a species is relative to other species in a defined location or community. Relative abundance is the percent composition of an organism of a particular kind relative to the total number of organisms in the area</p>','0',1,'2020-09-09 17:53:46','2020-09-09 17:54:14'),(707,'<p>Spermatogonial stem cell undergoes extensive metamorphosis to become a spermatozoan. Meiosis leads to the formation of spermatid containing 22 autosomes and one sex chromosome. A male mouse was found in a colony which always produced only female pups upon mating.</p>\r\n\r\n<p>Which one of following is a possible reason?</p>','<p>The Y encoded multicopy gene sly has a predominant role in the epigenetic repression of post meiotic sex chromatin (PMSC) and, as such, represses X and Y genes, among which are its X-linked hemologs SLx and SLxL1. SLx/SLx1 and Sly have antagonistic effects during sperm differentiation and are involved in a postmeiotic intragenenic conflict that causes segregation distortion and made sterility</p>','0',1,'2020-09-09 17:54:40','2020-09-09 17:55:22'),(708,'<p>In case of Xenopus laevis, which cells make up the Nieuwkoop centre and Spemann&#39;s organizer?</p>','<p>In Xenopus embryos, the dorso-ventral and anterior-posterior axes are established by the Spemann Maugold organizer. According to the prevalent model of early development, the organizer is induced by the dossalizing Nieuwkoop signal, which is secreted by the Nieukoof center</p>','0',1,'2020-09-09 17:55:37','2020-09-09 17:56:06'),(710,'<p>The functionality of the pax6 gene in the formation of optic and nasal structure may be attributed to the following,</p>\r\n\r\n<p>Which of the above attributions are true?</p>','<p>The Optic vesicles contacts the lens-competent ectoderm and induces a response that leads to thickening of ectoderm, termed lens placode</p>','1',1,'2020-09-09 17:56:40','2020-09-09 17:57:45'),(711,'<p>The following statements have been proposed for plant vegative development.</p>\r\n\r\n<p>Which of the above statements are true?</p>','<p>Lateral roots develops at exterior of mascular cylinders. It begins with unequal, periclinal division of the pericycle initial cells. Root cap is made of statocytes which are involved in gravity perception in plants</p>','1',1,'2020-09-09 17:58:03','2020-09-09 17:58:57'),(712,'<p>The pattern of embryonic cleavage specific to a species is determined by two major parameters.</p>\r\n\r\n<p>Which of the following statement is true?</p>','<p>Holoblastic cleavage occurs in Isolecithal eggs &amp; Mesolecithal eggs. Meroblastic cleavage occurs in telolecithal eggs &amp; centrolecithal eggs</p>','1',1,'2020-09-09 17:59:17','2020-09-09 18:00:05'),(713,'<p>The fate of a cell or a tissue is &#39;specified when it is capable of differentiating autonomously on being placed in a neutral environment with respect to the developmental pathway. An embryo will show a developmental pattern based on its type of specification.</p>\r\n\r\n<p>Based on the above facts it can be said that the potency of a cell is,</p>\r\n\r\n<p>Which of the above statements are true?</p>','<p>In mosaic development, cell fate = cell potency. The fate of cell is governed entirely by its intrinsic characteristics. In regulative development, cell potency is greater than cell fate. The fate of cell is governed by its interaction with other cells</p>','1',1,'2020-09-09 18:00:26','2020-09-09 18:01:21'),(714,'<p>In the context of the proximal&ndash;distal growth and differentiation of a tetrapod limb following experiments were visualized.</p>\r\n\r\n<p>Which of the above experiments would show the possible interactions between the AER and the limb bud mesenchyme directly beneath it during limb development?</p>','<p>The proximal-distal axis is defined only after the induction of the apical ectodermal ridge by the underlying mesoderm. The limb and elongates by means of proliferation of the mesenchyme cells underneath the AER</p>','1',1,'2020-09-09 18:01:39','2020-09-09 18:02:43'),(715,'<p>Capacitation of sperms in humans</p>','<p>Capacitance is the penltimate step in the maturation of mammalian spermatozoa. In this step typically occurs in female reproduction tract after ejaculation</p>','0',1,'2020-09-09 18:03:00','2020-09-09 18:03:31'),(716,'<p>With respect to development of any organism, &#39;autonomous specification&#39; would result in which type of development?</p>','<p>Autonomous specifications results from cell intrinsic properties; it gives rise to mosaic development. The cell-intrinsic properties arise from a cleavage of a cell with asymmetrically expressed maternal cytoplasmic determinant</p>','0',1,'2020-09-09 18:03:44','2020-09-09 18:04:39'),(717,'<p>If an embryo undergoes 13 cleavage divisions during embryogenesis, then the size of the embryo compared to zygote</p>','<p>In embryology, cleavage is the division of cells in the early embryo. The seggate of many species undergo rapid cell cycles with no significant growth, providing a cluster of cells the same size as the original zygote</p>','0',1,'2020-09-09 18:04:55','2020-09-09 18:05:26'),(718,'<p>Flowers represent a complex array of functionally specialized structures that differ substantially from the vegetative plant body in form and cell types. Following are statements made regarding floral meristems.</p>\r\n\r\n<p>Which combination of the above statements is true?</p>','<p>Each meristem consist of renewing population of stem cells. As they divide, they leave behind a trail of progeny that becomes displaced from the meristem region, enlarge, and finally differentiate. Although the shoot and root apical meristems generate all the basic varieties of cells that are needed to build leaves, roots and stems, mainly cells outside the apical meristems also keep a capacity for further proliferation and retain meristem potential. In this way trees and other perennial plants, for example, are able to increase the girth of their stem and roots as the years go by and can sprout new shoots from dormant regions if the plants are damaged</p>','1',1,'2020-09-09 18:05:47','2020-09-09 18:06:46'),(719,'<p>In C. elegans during embryogenesis, an anchor cell and 6 hypodermal Vulval Precursor Cells (VPCs) get involved in forming the vulva. If 3 of the hypodermal VPCs are killed by a laser beam, a normal vulva is still formed. This could be due to the following possible reasons.</p>\r\n\r\n<p>Which combination of the above statements is correct?</p>','<p>During the L3 stage, the vulva begins to form in the neutral epidermis when the anchor cell induces three of the six vulval precursor cells to divide and to adopt vulval fates</p>','1',1,'2020-09-09 18:07:04','2020-09-09 18:08:27'),(720,'<p>In tadpoles, if the tail is amputated it can regenerate. However, if the tail is amputated and then exposed to retinoic acid, it develops limbs instead of regenerating the tail. This could be due to the following reasons.</p>\r\n\r\n<p>Which combination of the above statements is true?</p>','<p>Treatment of regenerating tails with retinoic acid at the same time as the hindlimbs are developing results in appearance of additional hindlimb in place of a regenerated tail. It has been speculated that retinoic acid alters the anterior-posterior positional value of the regenerating tail blastema to that of the site along the anterior-posterior axis where the hindlimb would normally develop</p>','1',1,'2020-09-09 18:08:45','2020-09-09 18:09:38'),(721,'<p>The part of the embryo from which the ectoderm, mesoderm and endoderm are formed in chick is known as.</p>','<p>The embryo develops exclusively from epiblast. The hypoblast contributes to the formation of extraembryonic membranes. Thus, the fate map of avian embryo is exclusively restricted to epiblast</p>','0',1,'2020-09-09 18:10:05','2020-09-09 18:10:32'),(722,'<p>Which protein secreted by the amphibian organizer induces neural tissue formation by inhibiting Bone Morphogenetic Protein?</p>','<p>Noggin</p>','0',1,'2020-09-09 18:10:48','2020-09-09 18:11:19'),(723,'<p>The homologue of &beta;&ndash;catenin in Drosophila is</p>','<p>Fushi tarazu is a pair rule gene. Engrailed gene is required to distinguish posterior from anterior compartments in each segment of develop animal. Cubitus interrupts, is a zinc finger containing transcription factor involved in Hedgehog signalling pathway. &beta;&ndash;catenin is involved in cell-cell adhesion &amp; gene transcription. It is homologous to armadillo</p>','0',1,'2020-09-09 18:11:37','2020-09-09 18:12:07'),(724,'<p>Which of the floral whorls is affected in apetala 3/pistillata (ap3/pi) mutants?</p>','<p>Two mutation in type B gene have been found in A thaliana, APETALA 3 and PISTILLATA, which causes development of sepals instead of petals and carpels in place of stamen</p>','0',1,'2020-09-09 18:12:26','2020-09-09 18:12:59'),(725,'<p>Polyspermy results when two or more sperms fertilize an egg. It is usually lethal since it results in blastomeres with different numbers and types of chromosomes. Many species therefore, have two blocks to polyspermy: the fast block and the slow block.</p>\r\n\r\n<p>In the case of sea urchins:</p>\r\n\r\n<p>Which of the above statements are true?</p>','<p>The fast block is immediate and causes the egg membrane resting potential to rise which does not allow the sperm to fuse with the egg and is mediated by an influx of sodium ions. The slow block or cortical granule reaction is mediated by calcium ions</p>','1',1,'2020-09-09 18:13:20','2020-09-09 18:14:26'),(726,'<p>In an experiment, the cells that would normally become the middle segment of a Drosophila leg were removed from the leg forming area of the larva and were placed in the tip of the fly&#39;s antenna. Based on the &#39;French flag&#39; analogy for the operation of a gradient of positional information, which of the following statements is true?</p>','<p>The fresh flag model is a conceptual definition of a morphogen, described by Lewis Wolpert in the 1960s. Here, the cells retain their committed status as leg cells, but respond to the positional information of their environment. Thereby, they become leg tip cells-claws. Wolport said, this phenomenon is analogous to French flags</p>','0',1,'2020-09-09 18:14:42','2020-09-09 18:15:16'),(729,'<p>During reproductive development in plants</p>\r\n\r\n<p>Which of the above statements are true?&nbsp;</p>','<p>In flowering plants, flowers use meiosis to produce a haploid generation which produces gametes through mitosis. Pollen tube ruptured and release both the male gametes 1 fuses with nucleus of ovum and the 2nd with 2 polar nuclei to give rise eventually to endosperm</p>','1',1,'2020-09-09 18:16:13','2020-09-09 18:17:13'),(730,'<p>During fertilization in mammals, sperm&ndash;egg interaction is mediated by zona pellucida (ZP) membrane proteins and their receptors present in sperm membrane. ZP3 has been identified to be the principle ZP protein whose posttranslational modification is important for sperm&ndash;egg interaction. In a competitive inhibition assay the sperm is saturated with either active ZP3 or its modified forms, before studying sperm&ndash;egg&ndash;interaction. Which of the following experiments will not inhibit sperm egg interaction?</p>','<p>Deglycosylate the ZP3 protein and use it for saturation of sperm</p>','0',1,'2020-09-09 18:17:27','2020-09-09 18:17:59'),(731,'<p>Over&ndash;expression of a dominant negative FGF receptor during amphibian development would prevent formation of</p>','<p>Disruption of FGF signaling results in the inhibition of Nodal-dependent induction and formation of trunk and tail mesoderm</p>','0',1,'2020-09-09 18:18:13','2020-09-09 18:18:41'),(732,'<p>The change in the state of specification of imaginal disc of Drosphila to that of a different disc type is known as</p>','<p>Regeneration in the disc is mediated by a localized region of cell division, known as the regeneration blastema. Most regeneration disc cells strictly adhere to their disc specific identity, some cells however, switch fate in a phenomenon known as trans determination</p>','0',1,'2020-09-09 18:18:57','2020-09-09 18:19:26'),(733,'<p>During double fertilization in plants, one sperm fuse with the egg cell and the other sperm fuses with</p>','<p>One sperm fertilizes the egg cell and the other sperm combines with the two polar nuclei of the large control cell of the megagametophyte</p>','0',1,'2020-09-09 18:19:40','2020-09-09 18:20:12'),(734,'<p>Engrailed expression in Drosophila melanogaster defines</p>','<p>Engrailed gene is required to distinguish protein from anterior compartment in each segment</p>','0',1,'2020-09-09 18:20:25','2020-09-09 18:20:56'),(735,'<p>The proximal distal growth and differentiation of the tetrapod limb bud are made possible by a series of interactions between the Apical Ectodermal Ridge (AER) and limb bud mesenchyme directly beneath it. Some of the interactions performed in chick demonstrated the following results.</p>\r\n\r\n<p>Which of the above combinations is correct?&nbsp;</p>','<p>When forelimb mesenchyme is replaced with non-limb mesenchyme, the AER regresses, and limb development halts. The transplantation of an additional AER results in the duplication of limb structures, usually a mirror image next to the already developing limb</p>','1',1,'2020-09-09 18:22:01','2020-09-09 18:22:50'),(736,'<p>Mutation in a gene x in Arabidopsis thaliana results in more number of lateral root formation.</p>\r\n\r\n<p>Which one of the following is the correct statement?</p>','<p>Regulation of lateral root formation is controlled by MYB transcription factor AtMYB93 in Arabidopsis Atmyb93 mutants have faster lateral root development progression</p>','0',1,'2020-09-09 18:23:15','2020-09-09 18:23:48'),(737,'<p>Torpedo is a trans&ndash;membrane receptor on follicle cells that binds with Gurken protein located in the presumptive dorsal surface of the oocytes and inhibits a cascade leading to nuclear localization of the Dorsal protein.&nbsp; In an experiment, Drosophila germ line chimeras were made by interchanging pole cells (germ line precursors) between wild type embryos and embryos from mother homozygous for a mutation of torpedo gene.</p>\r\n\r\n<p>These transplants produced:&nbsp;</p>\r\n\r\n<p>(a) wild type females whose egg came from mutant mother, and&nbsp;&nbsp;</p>\r\n\r\n<p>(b) torpedo deficient females whose egg came from wild type mother</p>\r\n\r\n<p>The possible outcome of this experiment can be:</p>\r\n\r\n<p>which came from wild type eggs developed in Torpedo deficient ovary.</p>','<p>Torpedo deficient egg development in wild type ovary produced normal embryo</p>','1',1,'2020-09-09 18:24:30','2020-09-09 18:25:25'),(738,'<p>The splitting or migration or one sheet of cells into sheets as seen during hypoblast formation in bird embryogenesis is termed as</p>','<p>The act of splitting or separating a laminate into layers. Blastoderm splits into two layers to form gastrula</p>','0',1,'2020-09-09 18:25:37','2020-09-09 18:26:03'),(739,'<p>Lens formation requires sequential events whereby the anterior neural plate signals the anterior ectoderm to promote secretion of Pax 6, which renders the anterior ectoderm more receptive to secretions from the optic vesicle. The above can be best explained by which of the following phenomenon?</p>','<p>Induction is the process by which the presence of one tissue influences the development of others. The ability of an embryonic cell to react normally to the stimulated of an inductor, allowing continued normal growth or differentiation of the embryo</p>','0',1,'2020-09-09 18:26:17','2020-09-09 18:26:50'),(740,'<p>For successful fertilization in sea urchin, interaction between the surface of the egg and acrosomal proteins, specifically a 30.5 kDa protein called binding, is necessary. The following factors could affect this interaction and prevent fertilization</p>\r\n\r\n<p>Which one or the combination of the above statements is correct?</p>','<p>The sperm binds to the egg through a ligand reaction between receptors in the vitelline membrane fusion of plasma membrane of the sperm and egg are likely mediated by bindin. At the site of contact, fusion causes the formation of a fertilization cone</p>','1',1,'2020-09-09 18:27:08','2020-09-09 18:28:06'),(741,'<p>A two&ndash;celled embryo is made of blastomeres A and B. If the two blastomeres are experimentally separated, the &#39;A&#39; blastomere generates all the cells it would normally make. However, the &#39;B&#39; blastomere in isolation makes only a small fraction of cells it would normally make. Based on the above observations only, which one of the following conclusions is correct?</p>','<p>The determination of P1 lineages appears to be autonomous, with the cell fates determined by internal cytoplasmic factors rather than by interactions with neighbouring cells. The fate of cell or tissue is said to be specified when it is capable of differentiating autonomously when placed in a neutral environment such as Petri dish or test tube</p>','0',1,'2020-09-09 18:28:20','2020-09-09 18:28:54'),(742,'<p>A mutant was experimentally generated which had wings reduced to halter like structure. The following statements are put forward regarding this phenotype.</p>\r\n\r\n<p>The following combination of statements will be most appropriate explaining the molecular basis of mutant phenotype.</p>','<p>Mutation of Vbx gene will lead to transformation of dorsal and ventral appendages of 3rd thoracic segment (T3), which includes the halter and third leg, into the counterparts on the second thoracic segment (T2). If Vbx is present in T3, it will prevent the original fate of the T2 segment. Such mutations can produce a second set of wings</p>','1',1,'2020-09-09 18:29:13','2020-09-09 18:30:02'),(743,'<p>Following are certain statements regarding the activities of homeotic genes of classes A, B and C involved in floral organ identify</p>\r\n\r\n<p>Which one of the following combinations of above statements is correct?</p>','<p>A genes effect sepals and petals B genes affect petals and stamen C gene affect stamen and carpels</p>','1',1,'2020-09-09 18:30:18','2020-09-09 18:31:20'),(744,'<p>An embryo lacking biocoid is injected with biocoid m-RNA at middle portion. It will result into</p>','<p>Bicoid is a maternal effect gene whose protein concentration gradient patterns the anterior-posterior (A-P) axis during Drosophila embryogenesis. Bicoid was the first protein demonstrated to act as a morphogen. Although Bicoid is important for the development of Drosophila and other higher dipterans, it is absent from most other insects, where its role is accomplished by other genes</p>','0',1,'2020-09-09 18:31:36','2020-09-09 18:32:05'),(745,'<p>Which of the following is a species-specific protein in sea urchin which plays important role in recognization during acrosomal reaction?</p>','<p>Bindin is a 30,000-mol-wt protein of sea urchin sperm that is responsible for the specific adhesion of the sperm acrosomal process to the vitelline layer covering the egg plasma membrane during fertilization</p>','0',1,'2020-09-09 18:32:18','2020-09-09 18:32:47'),(746,'<p>Anterior-po axis and dorsal ventral nerve plate is determined by<strong> </strong></p>',NULL,'0',1,'2020-09-09 18:33:08','2020-09-09 18:33:08'),(747,'<p>One of the most important genes, involved in dorsal- ventral axis determination in Drosophila is dorsal. It codes Dorsal protein which</p>','<p>Is taken up into the nuclei of cells and this side will become the ventral side</p>','0',1,'2020-09-09 18:33:56','2020-09-09 18:34:26'),(748,'<p>Which is true for amount of yolk and cleavage in egg of amphibian?</p>','<p>Holoblastic cleavage occurs when the cleavage furrows pass through the entire egg. Meroblastic cleavage occurs more in microlecithal eggs, cleavage takes place only in a disk at the animal pole, the cleavage furrows do not extend into the yolk</p>','0',1,'2020-09-09 18:34:44','2020-09-09 18:35:11'),(749,'<p>Cytoplasmic determinants coding for anterior structure of Drosophila embryo if injected elsewhere in the recipient embryo, would lead to</p>',NULL,'0',1,'2020-09-09 18:35:22','2020-09-09 18:35:22'),(750,'<p>In case of sea urchin, which of the following is the correct sequence of events taking place during the interaction of sperm and egg?<strong> </strong></p>','<p>Chemo-attraction of sperm to the egg by soluble molecules secreted by the egg &mdash;&gt; exocytosis of the sperm acrosomal vesicles to release its enzymes &mdash;&gt; binding of the sperm to the extracellular matrix of the egg passage of sperm through this extracellular matrix &mdash;&gt; fusion of egg and sperm cell membranes</p>','0',1,'2020-09-09 18:36:18','2020-09-09 18:37:01'),(751,'<p>When a wrist blastema from a recently cut Axolotl forelimb is placed on a host hindlimb cut at the mid thin level, it will generate only a wrist. The host (whose own hind limb was removed) will fill the gap and regenerate the limb up to the wrist. However, if the donor blastema is treated with retinoic acid on grafting, the wrist blastema will regenerate and complete limb and will not allow the host to fill the gap.</p>\r\n\r\n<p>This happens because retinoic acid:</p>','<p>Helps in prefinalization of the blastema and activates the Hox genes differentially across the blastema</p>','0',1,'2020-09-09 18:37:16','2020-09-09 18:37:56'),(752,'<p>Which of the following maternal effect gene products regulate production of anterior structures in Drosophila embryo?</p>','<p>Anterior morphogen critical for establishing anterior-posterior polarity in the Drosophila embryo. Functions as a transcription factor to activate anterior specific gap genes and as a translational repressor to suppress posterior-specific gap genes. The high concentrations of Bicoid protein in the anterior portion of the egg turn on a gap gene called hunchback, while simultaneously turning off another gap gene, Knippel. Nanos at the posterior end reduces the translation of hunchback, so a difference in the concentration of these two gap genes products at the two ends is established</p>','0',1,'2020-09-09 18:38:09','2020-09-09 18:38:44'),(753,'<p>Which of the floral whorls is affected in agamous (ag) mutants?<strong> </strong></p>','<p>In 1991 the ABC model was proposed to explain how homeotic genes control organ identity. The ABC model postulates that organ identity in each whorl is determined by a unique combination of the three organ identity gene activities, Activity of type A alone specifies sepals.&nbsp; Activities of both A and B are required for the formation of petals.&nbsp; Activities of B and C form stamens.&nbsp;&nbsp; Activity of C alone specifies carpels</p>','0',1,'2020-09-09 18:39:02','2020-09-09 18:39:34'),(754,'<p>When the prospective neurons from an early gastrula of a frog were transplanted into the prospective epidermis region, the donor cells differentiated into epidermis. However, when a similar experiment was done with the late gastrula of frog, the prospective neurons developed into neurons only. These observations could possibly be explained by the following phenomena.</p>\r\n\r\n<p>Which of the conclusions drawn above are correct?</p>','<p>The early gastrula show conditional development whereas the late gastrula shows autonomous development. The prospective neurons from the early gastrula are only specified whereas those from the late gastrula are determined</p>','1',1,'2020-09-09 18:39:57','2020-09-09 18:41:23'),(755,'<p>API (APETLA 1) is one of the floral meristem identifying genes. In wild type Arabidopsis thaliana plants transformed with API:: GUS, &beta;- glucuronidase (GUS) activity is seen in floral meristem, only after the commitment to flowering. Ectopic expression of API::GUS in the EMBRYONIC FLOWER (emf) mutant background results in GUS activity throughout the shoots in four day old seedlings. These observations suggest that API is:</p>','<p>In 1991 the ABC model was proposed to explain how homeotic genes control organ identity. The ABC model postulates that organ identity in each whorl is determined by a unique combination of the three organ identity gene activities, Activity of type A alone specifies sepals.&nbsp; Activities of both A and B are required for the formation of petals.&nbsp; Activities of B and C form stamens. Activity of C alone specifies carpels</p>','0',1,'2020-09-09 18:41:37','2020-09-09 18:42:04'),(756,'<p>Cytoplasmic determinants coding for anterior structure of Drosophila embryo, if injected elsewhere in the recipient embryo, would lead to</p>','<p>Anterior morphogen critical for establishing anterior-posterior polarity in the Drosophila embryo. Functions as a transcription factor to activate anterior specific gap genes and as a translational repressor to suppress posterior-specific gap genes. Protein critical for the establishment of anterior-posterior polarity of the Drosophila embryo. Nanos mRNA is tethered to the posterior end of the oocyte and is translated after ovulation and fertilization. Nanos protein diffuses from the posterior end, while Bicoid diffuses from the anterior end, setting up two opposing gradients that establish the anterior-posterior polarity of the embryo</p>','0',1,'2020-09-09 18:42:18','2020-09-09 18:42:48'),(757,'<p>In case of Xenopus lavers. Which cells make up the Nieuwkoop Centre and Spemann&#39;s organizer?</p>','<p>In Xenopus embryos, the dorso-ventral and anterior-posterior axes are established by the Spemann Maugold organizer. According to the prevalent model of early development, the organizer is induced by the dossalizing Nieuwkoop signal, which is secreted by the Nieukoof center</p>','0',1,'2020-09-09 18:43:01','2020-09-09 18:43:28'),(758,'<p>In an experiment, sperm removed from epididymis of a male mouse was added in a dish containing appropriate media and oocyte. No fertilization was seen. However, when sperm from epididymis were directly placed in uterus of an ovulated female, she became pregnant. These observations suggest that:</p>','<p>The contents of female reproductive tract interact with sperm and activate it, for fertilization</p>','0',1,'2020-09-09 18:43:44','2020-09-09 18:44:19'),(759,'<p>Which of the following cells provide nutrition to the sperm?</p>','<p>Sertoli cells are found in germinal epithelium of seminiferous tubules. They nourish the developing sperm</p>','0',1,'2020-09-09 18:44:31','2020-09-09 18:44:58'),(760,'<p>What is the role of the Bicoid gene in Drosophila development?</p>','<p>Anterior morphogen critical for establishing anterior-posterior polarity in the Drosophila embryo. Functions as a transcription factor to activate anterior specific gap genes and as a translational repressor to suppress posterior-specific gap genes</p>','0',1,'2020-09-09 18:45:12','2020-09-09 18:45:40'),(761,'<p>Psychology&rsquo;s major contribution to education lies in</p>','<p>Educational psychology to the diversity and the different problems that may occur during the learning process and learning, and outcomes resulting from them, researchers and scientists collecting topics of psychology the most frequent educational and scientific literature and psychological, and these topics:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Knowledge and understanding of developmental characteristics in all its aspects; physical, emotional, moral, social and cognitive.</li>\r\n	<li>Modern and effective methods and methods of teaching, as well as control of educational situations in different educational environments.</li>\r\n	<li>IQ tests and mental abilities that measure students&#39; abilities and mental abilities, as well as ways to understand personality traits and patterns.</li>\r\n	<li>Methods and conditions for the establishment of psychological and educational tests, and the principles and bases for the development of tests of achievement through effective methods that confirm the achievement of the goal of the educational process.</li>\r\n	<li>Social and interactive life that arises between students and between students and teachers.</li>\r\n	<li>Educational theories that deal with the process of learning, scientific methods of learning process and measurement, and factors affecting them negatively and positively.</li>\r\n	<li>The process of social and school adjustment in the educational environment of individuals, in addition to the mental health of students and their levels during the educational process.</li>\r\n</ul>','0',1,'2020-09-09 19:01:31','2020-09-09 19:02:13'),(762,'<p>Research has constantly demonstrated&nbsp;&nbsp; that&nbsp;&nbsp; the&nbsp;&nbsp; best single index for readiness for a given academic task is</p>','<p>Mental age&nbsp;is a concept related to&nbsp;intelligence. It looks at how a specific individual, at a specific age, performs intellectually, compared to average intellectual performance for that individual&#39;s actual chronological age (i.e. time elapsed since birth). The intellectual performance is based on performance in tests and live assessments by a psychologist. The score achieved by the individual is compared to the&nbsp;median&nbsp;average scores at various ages, and the mental age (x, say) is derived such that the individual&#39;s score equates to the average score at age&nbsp;x</p>','0',1,'2020-09-09 19:02:45','2020-09-09 19:03:48'),(763,'<p>Which of the following is the correct sequence of motivational set?</p>','<p>Drive&gt; goal directed behavior&gt;attainment of goal&gt; satisfaction</p>','0',1,'2020-09-09 19:04:05','2020-09-09 19:04:44'),(764,'<p>The basic reason why meaningful material is learned rapidly is that</p>','<p>Learning experience&nbsp;refers to any interaction, course, program, or other experience in which learning takes place, whether it occurs in traditional academic settings (schools, classrooms) or nontraditional settings (outside-of-school locations, outdoor environments), or whether it includes traditional educational interactions (students learning from teachers and professors) or nontraditional interactions (students learning through games and interactive software applications)</p>','0',1,'2020-09-09 19:05:00','2020-09-09 19:05:39'),(765,'<p>Which of the following best describes the process of growth and development?</p>','<p>Growth&nbsp;is the progressive increase in the size of a child or parts of a child.</p>\r\n\r\n<p>Development&nbsp;is progressive acquisition of various skills (abilities) such as head support, speaking, learning, expressing the feelings and relating with other people</p>','0',1,'2020-09-09 19:05:55','2020-09-09 19:06:35'),(766,'<p>Eysenck measured personality based on</p>','<p>The term&nbsp;type&nbsp;has not been used consistently in psychology and has become the source of some confusion. Furthermore, because&nbsp;personality test&nbsp;scores usually fall on a&nbsp;bell curve&nbsp;rather than in distinct categories, personality type theories have received considerable criticism among&nbsp;psychometric&nbsp;researchers. One study that directly compared a &ldquo;type&rdquo; instrument (the&nbsp;MBTI) to a &ldquo;trait&rdquo; instrument (the&nbsp;NEO PI) found that the trait measure was a better predictor of personality disorders.&nbsp;Because of these problems, personality type theories have fallen out of favor in psychology. Most researchers now believe that it is impossible to explain the diversity of human personality with a small number of discrete types. They recommend trait models instead, such as the&nbsp;five-factor model</p>','0',1,'2020-09-09 19:06:58','2020-09-09 19:07:35'),(767,'<p>&lsquo;Humanist Theory&rsquo; of personality is advocated by</p>','<p>Some psychologists at the time disliked psychodynamic and behaviorist explanations of personality. They felt that these theories ignored the qualities that make humans unique among animals, such as striving for self-determination and self-realization. In the 1950s, some of these psychologists began a school of psychology called&nbsp;Humanism.</p>\r\n\r\n<p>The highest rung on&nbsp;Abraham Maslow&rsquo;s ladder of human motives is the need for&nbsp;Self-Actualization. Maslow said that human beings strive for self-actualization, or realization of their full potential, once they have satisfied their more basic needs. Maslow&rsquo;s hierarchy of needs theory</p>','0',1,'2020-09-09 19:07:53','2020-09-09 19:08:24'),(768,'<p>Match the following in List-I with that of List-II in the correct order:</p>\r\n\r\n<p><strong>Codes: (a)&nbsp;&nbsp;(b)&nbsp;&nbsp;(c) &nbsp;(d) </strong></p>',NULL,'2',1,'2020-09-09 19:09:09','2020-09-09 19:09:09'),(769,'<p>Defense mechanisms are used by the</p>','<p>Sigmund Freud posited that defense mechanisms work by distorting&nbsp;id&nbsp;impulses into acceptable forms, or by unconscious or conscious blockage of these impulses.&nbsp;Anna Freud considered defense mechanisms as intellectual and motor automatisms of various degrees of complexity, that arose in the process of involuntary and voluntary learning.</p>\r\n\r\n<p>Anna Freud introduced the concept of signal anxiety; she stated that it was &quot;not directly a conflicted instinctual tension but a signal occurring in the ego of an anticipated instinctual tension&quot;.&nbsp;The signaling function of anxiety was thus seen as crucial, and biologically adapted to warn the organism of danger or a threat to its equilibrium. The anxiety is felt as an increase in bodily or mental tension and the signal that the organism receives in this way allows for the possibility of taking defensive action regarding the perceived danger</p>','0',1,'2020-09-09 19:10:51','2020-09-09 19:11:24'),(770,'<p>A student who fails in an examination, makes a complaint that the examiner was strict. He/she is using a defense mechanism of</p>','<p>Rationalization: Some people may attempt to explain undesirable behaviors with their own set of &ldquo;facts.&rdquo; This allows you to feel comfortable with the choice you made, even if you know on another level it&rsquo;s not right.</p>\r\n\r\n<p>For example, people who might be angry at co-workers for not completing work on time could be ignoring the fact that they&rsquo;re typically late, too</p>','0',1,'2020-09-09 19:11:42','2020-09-09 19:12:14'),(771,'<p>Which one of the following statements best describes the mental health of a teacher?</p>','<p>Every day we support education professionals who are suffering the consequences of many factors causing severe pressure: budget cuts; fewer staff, bigger class sizes and localized recruitment and retention difficulties in some areas are adding to workload and increasing stress levels. Outside school, many are suffering financially.</p>\r\n\r\n<p>According to&nbsp;<strong>our latest research</strong>, 75% of all education staff has faced physical or mental health issues in the last two years because of their work and 53% have considered leaving as a result.</p>\r\n\r\n<ul>\r\n	<li>Almost one in five (19%) said they had experienced panic attacks.</li>\r\n	<li>Over half (56%) had suffered from insomnia and difficulties sleeping.</li>\r\n	<li>Over a third (41%) had experienced difficulty concentrating.</li>\r\n</ul>','0',1,'2020-09-09 19:12:31','2020-09-09 19:13:07'),(772,'<p>A student suffering from depression and sadness can be classified as</p>','<p>Melancholia&nbsp;(from&nbsp;Greek:&nbsp; melaina chole&nbsp;&quot;black bile&quot;, &quot;blackness of the bile&quot;&nbsp;also Latin&nbsp;lugere&nbsp;lugubriousness&nbsp;to mourn, Latin&nbsp;morosus&nbsp;moroseness&nbsp;of self-will or fastidious habit, and old English&nbsp;wist&nbsp;wistfulness&nbsp;of intent or&nbsp;saturnine) is a mental condition characterized by extreme depression, bodily complaints, and sometimes hallucinations and delusions. Melancholia is a concept from ancient or&nbsp;pre-modern medicine. Melancholy was one of the&nbsp;four temperaments&nbsp;matching the&nbsp;four humours.&nbsp;In the 19th century, &quot;melancholia&quot; could be physical as well as mental, and melancholic conditions were classified as such by their common cause rather than by their properties. It is the predecessor of the mental health diagnosis of&nbsp;clinical depression&nbsp;and still exists as a subtype for major depression known as&nbsp;melancholic depression.</p>','0',1,'2020-09-09 19:13:23','2020-09-09 19:13:56'),(773,'<p>In differentiating growth from development which one of the following is not the basis?</p>','<p>Emotions are biological states associated with the nervous system brought on by neurophysiological changes variously associated with thoughts, feelings, behavioral responses, and a degree of pleasure or displeasure. There is currently no scientific consensus on a definition.&nbsp;</p>','0',1,'2020-09-09 19:14:11','2020-09-09 19:15:08'),(774,'<p>According to Jean Piaget the formal operation stage is during the</p>','<p>The formal operational stage is the fourth and final stage in Piaget&#39;s theory. It begins at approximately&nbsp;11&nbsp;to 12 years of age, and continues throughout adulthood, although Piaget does point out that some people may never reach this stage of cognitive development</p>','0',1,'2020-09-09 19:15:35','2020-09-09 19:16:07'),(775,'<p>In schools, physical education programmes should be conceived primarily as</p>',NULL,'0',1,'2020-09-09 19:16:25','2020-09-09 19:16:25'),(776,'<p>Which one of the following statements appropriately describes personality?</p>','<p>&quot;Personality&nbsp;is the dynamic organization within the individual of those psychophysical systems that determine his characteristics behavior and thought&quot; (Allport, 1961, p. 28). &ldquo;The characteristics or blend of characteristics that make a person unique&rdquo; (Weinberg &amp; Gould, 1999).</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-09 19:17:20','2020-09-09 19:17:54'),(777,'<p>Which of the following trait can be measured effectively through projective techniques of personality?</p>','<p>Cognitive inhibition&nbsp;refers to the mind&#39;s ability to tune out stimuli that are irrelevant to the task/process at hand or to the mind&#39;s current state. Cognitive inhibition can be done either in whole or in part, intentionally or otherwise.&nbsp;Cognitive inhibition in particular can be observed in many instances throughout specific areas of&nbsp;cognitive science</p>','0',1,'2020-09-09 19:18:09','2020-09-09 19:18:42'),(778,'<p>A student shows excessive concern for cleanliness in family. This can be best explained as an example of</p>','<p>Reaction formation&nbsp;is a psychological&nbsp;defense mechanism&nbsp;in which a person goes beyond denial and behaves in the opposite way to which he or she thinks or feels. Conscious behaviors are adopted to overcompensate for the anxiety a person feels regarding their socially unacceptable unconscious thoughts or emotions.</p>','0',1,'2020-09-09 19:19:01','2020-09-09 19:19:32'),(779,'<p>In Indian system, the process of adjustment can be described best by</p>','<p>A state&nbsp;of rest or balance due to the equal action of opposing forces. equal balance between any powers, influences, etc.; equality of effect. mental or emotional balance; equanimity: The pressures of the situation caused her to lose her&nbsp;equilibrium. Chemistry</p>','0',1,'2020-09-09 19:19:45','2020-09-09 19:20:14'),(780,'<p>For organizing eclectic counselling which of the following is most important:</p>',NULL,'0',1,'2020-09-09 19:20:39','2020-09-09 19:20:39'),(781,'<p>Which of the following is the characteristic feature of the emotional development during adolescence?</p>','<p>Adolescence is a phase of the lifespan that begins around the onset of physical puberty and ends with the assumption of adult roles. This phase of the lifespan is associated with changes across widespread biological and psychological domains, including physical, social, cognitive, and emotional. In the emotional domain, although a typical adolescent is overall more happy than unhappy,&nbsp;evidence does suggest that adolescents experience frequent and intense emotions that accompany a marked increase in their risk for mental disorders characterized by problems with emotion regulation. Here, we take a process-level perspective to evaluate why emotions differ from childhood and adulthood in this particular way</p>','0',1,'2020-09-09 19:21:27','2020-09-09 19:22:01'),(782,'<p>In which of the following operant conditioning procedures the training arrangement insists the presence of a cue and making of a response to get negatively reinforced?</p>','<p>Active avoidance refers to experimental behavioral paradigms where subjects (mainly rodents) are trained, following the onset of a conditioned stimulus (CS), to move from a starting position to another position in the testing apparatus within a fixed amount of time (avoidance). Failure to move within the given time frame results in the onset of a negative reinforcer, usually a weak electric shock in a grid floor, until a correct move is performed (escape). In animals performing at a high level of correct response following training, drugs that are effective as antipsychotics, but not other classes of drugs, show a unique ability to selectively suppress the avoidance behavior, within a clinically relevant dose range, while leaving escape behavior intact. Because of this robust marker for the prediction of antipsychotic activity, the active avoidance test is primarily used and considered an important screening tool, for the detection of novel potentially antipsychotic drugs.</p>','0',1,'2020-09-09 19:22:26','2020-09-09 19:22:57'),(783,'<p>Brainstorming procedures are helpful specially for which category of children?</p>','<p>Mental retardation, a condition characterized by deficits in intellectual capabilities and adaptive behavior, can be particularly difficult to diagnose in the mild range of the disability</p>','0',1,'2020-09-09 19:23:12','2020-09-09 19:23:40'),(784,'<p>Which set of statements best describes the process of adjustment in the context of education? Select the code for giving your answer:</p>','<p>As the children start school, they face many challenges. Personal challenges occur as children take new identity at school. Children face the challenges to adjust to the strange building, new teachers, new academic activities, and they need to mix with the new and more diverse group of children.</p>\r\n\r\n<p>At school, daily schedule is more structured, with more formal rules. Children are faced with large groups of children of different ages and size especially during assembly and playtime, and they are confronted with the challenges of making new friends. Toilets are often located away from classrooms and play areas.</p>','1',1,'2020-09-09 19:23:57','2020-09-09 19:25:19'),(785,'<p>Match the two sets, Set-I theories of intelligence and Set-II the special emphasis given in explaining and measuring intelligence. Choose the correct code for indicating your answer: <strong>Codes:&nbsp;(a)&nbsp;&nbsp;(b)&nbsp; (c)&nbsp;&nbsp;(d) </strong></p>\r\n\r\n<p>&nbsp;</p>',NULL,'2',1,'2020-09-09 19:26:00','2020-09-09 19:26:00'),(786,'<p>Which of the following statements is correct with regard to growth and development?</p>','<p>Growth&nbsp;is the progressive increase in the size of a child or parts of a child.</p>\r\n\r\n<p>Development&nbsp;is progressive acquisition of various skills (abilities) such as head support, speaking, learning, expressing the feelings and relating with other people</p>','0',1,'2020-09-09 19:28:14','2020-09-09 19:28:48'),(787,'<p>Which stage of development is said to be overpowered with a tendency for &lsquo;hero worship&rsquo;?</p>','<h2><strong>Early Adolescence (Ages 10 to 13)</strong></h2>\r\n\r\n<ul>\r\n	<li><strong>During this stage, children often start to grow more quickly</strong>. They also begin notice other body changes, including hair growth under the arms and near the genitals, breast development in&nbsp;females&nbsp;and enlargement of the testicles in&nbsp;males. They usually start a year or two earlier in girls than boys, and it can be normal for some changes to start as early as age 8 for females and age 9 for males. Many girls may start their period at around age 12, on average 2-3 years after the onset of breast development.</li>\r\n	<li><strong>These body changes can inspire curiosity and anxiety in someâ€•especially if they do not know what to expect or what is normal</strong>. Some children may also question their&nbsp;gender identity&nbsp;at this time, and the onset of puberty can be a difficult time for&nbsp;transgender children.&nbsp;</li>\r\n	<li><strong>Early adolescents have concrete, black-and-white thinking</strong>. Things are either right or wrong, great or terrible, without much room in between.&nbsp; It is normal at this stage for young people to center their thinking on themselves (called &quot;egocentrism&quot;).&nbsp; As part of this, preteens and early teens are often self-conscious about their appearance and feel as though they are always being judged by their peers.</li>\r\n	<li><strong>Pre-teens feel an increased need for privacy</strong>.&nbsp; They may start to explore ways of being independent from their family. In this process, they may push boundaries and may react strongly if parents or guardians&nbsp;reinforce limits.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-09 19:29:02','2020-09-09 19:29:37'),(788,'<p>A mentally healthy person will show which of the following behavior?</p>','<p>The World Health Organization states that mental health is not just the absence of mental illness. It involves a state of well-being in which people are able to cope with the normal stresses they face in daily life. Mental health allows people to recognize their own abilities, work productively, and make meaningful contributions to their communities</p>','0',1,'2020-09-09 19:29:52','2020-09-09 19:30:37'),(789,'<p>Assertion (A): Distress usually accompanies abnormal behavior patterns.</p>\r\n\r\n<p>Reason (R) Behavior disorders are reflected in the reports of distress.</p>\r\n\r\n<p>&nbsp;Which of the following options is correct?</p>','<p>Abnormality&nbsp;(or&nbsp;dysfunctional behavior) is a behavioral characteristic assigned to those with conditions regarded as rare or dysfunctional.&nbsp;Behavior is considered abnormal when it is atypical or out of the ordinary, consists of undesirable behavior, and results in impairment in the individual&#39;s functioning. Abnormality is that which is considered&nbsp;deviant&nbsp;from specific societal, cultural and ethical expectations. These expectations are broadly dependent on age, gender, traditional and societal categorizations. The definition of abnormal behavior is an often-debated issue in&nbsp;abnormal psychology&nbsp;because of these subjective variables</p>','0',1,'2020-09-09 19:30:58','2020-09-09 19:31:37'),(790,'<p>A teacher holds discussion with a student and enables him/her to select appropriate choice of subject at higher secondary stage. This type of guidance is called:</p>','<p>Educational guidance is a process of assisting the individual student to reach optimum educational development. It is a sort of guidance that is only rendered to the student community.</p>\r\n\r\n<p>Educational Guidance helps the students to make right choices, as well as make adjustments in relation to schools, curriculum, courses and school life which is contribute to the all-round development</p>','0',1,'2020-09-09 19:31:51','2020-09-09 19:32:22'),(791,'<p>The Overall changes in shape, Form or structure resulting in the improved quality functioning refer to the:</p>','<p>Development refers to the qualitative changes in the organism as whole. Development is a continuous process through which physical, emotional and intellectual changes occur. It is a more wider and comprehensive term than growth. It is also possible without growth. t and can be measured</p>','0',1,'2020-09-09 19:32:36','2020-09-09 19:33:10'),(792,'<p>Assertion (A): Heredity influences the process of growth and development</p>\r\n\r\n<p>Reason(R): The living conditions - physical, social and cultural do not affect growth and development.</p>\r\n\r\n<p>In the context of the two statements, which one of the following is correct?</p>','<h3>1. Heredity: Heredity is the transmission of physical characteristics from parents to children through their genes. It influences all aspects of physical appearance such as height, weight, body structure, the color of the eye, the texture of the hair, and even intelligence and aptitudes. Diseases and conditions such as heart disease,&nbsp;diabetes,&nbsp;obesity, etc., can also be passed through genes, thereby affecting the growth and development of the child adversely.&nbsp;However, environmental factors and nurturing can bring the best out of the already present qualities in the genes.</h3>\r\n\r\n<h3>2. Environment: The environment plays a critical role in the development of children and it represents the sum total of physical and psychological stimulation the child receives. Some of the environmental factors influencing early childhood development involve the physical surroundings and geographical conditions of the place the child lives in, as well his social environment and relationships with family and peers.</h3>','0',1,'2020-09-09 19:50:13','2020-09-09 19:50:45'),(793,'<p>Inwhichstageofaperson&rsquo;slifeemotionsandtheircontrolbecomecrucialforprofessional and personal wellness life style?</p>','<h2><strong>Early Adolescence (Ages 10 to 13)</strong></h2>\r\n\r\n<ul>\r\n	<li><strong>During this stage, children often start to grow more quickly</strong>. They also begin notice other body changes, including hair growth under the arms and near the genitals, breast development in&nbsp;females&nbsp;and enlargement of the testicles in&nbsp;males. They usually start a year or two earlier in girls than boys, and it can be normal for some changes to start as early as age 8 for females and age 9 for males. Many girls may start their period at around age 12, on average 2-3 years after the onset of breast development.</li>\r\n	<li><strong>These body changes can inspire curiosity and anxiety in someâ€•especially if they do not know what to expect or what is normal</strong>. Some children may also question their&nbsp;gender identity&nbsp;at this time, and the onset of puberty can be a difficult time for&nbsp;transgender children.&nbsp;</li>\r\n	<li><strong>Early adolescents have concrete, black-and-white thinking</strong>. Things are either right or wrong, great or terrible, without much room in between.&nbsp; It is normal at this stage for young people to center their thinking on themselves (called &quot;egocentrism&quot;).&nbsp; As part of this, preteens and early teens are often self-conscious about their appearance and feel as though they are always being judged by their peers.</li>\r\n	<li><strong>Pre-teens feel an increased need for privacy</strong>.&nbsp; They may start to explore ways of being independent from their family. In this process, they may push boundaries and may react strongly if parents or guardians&nbsp;reinforce limits.</li>\r\n</ul>','0',1,'2020-09-09 19:50:59','2020-09-09 19:51:32'),(794,'<p>Withrespectto social development at which stage in dividuals may sacrifice their own interests for the greater cause of the group, society and the nation?</p>','<p>Adult development&nbsp;encompasses the changes that occur in biological and psychological domains of human life from the end of&nbsp;adolescence&nbsp;until the end of one&#39;s life. These changes may be gradual or rapid, and can reflect positive, negative, or no change from previous levels of functioning. Changes occur at the cellular level and are partially explained by biological theories of adult development and aging.&nbsp;Biological changes influence psychological and interpersonal/social developmental changes, which are often described by stage theories of human development. Stage theories typically focus on &quot;age-appropriate&quot; developmental tasks to be achieved at each stage</p>','0',1,'2020-09-09 19:51:46','2020-09-09 19:52:18'),(795,'<p>Classification of personalities as &lsquo;introverts&rsquo; and &lsquo;extroverts&rsquo; was first made by:</p>','<p>The&nbsp;traits&nbsp;of&nbsp;extraversion&nbsp;(or&nbsp;extroversion) and&nbsp;introversion&nbsp;are a central dimension in some human&nbsp;personality&nbsp;theories. The terms&nbsp;introversion&nbsp;and&nbsp;extraversion&nbsp;were popularized by&nbsp;Carl Jung,&nbsp;although both the popular understanding and psychological usage differ from his original intent. Extraversion tends to be manifested in outgoing, talkative, energetic behavior, whereas introversion is manifested in more reserved and solitary behavior.&nbsp;Rather than focusing on interpersonal behavior, however, Jung defined introversion as an &quot;attitude-type characterized by orientation in life through subjective psychic contents&quot;, and extraversion as &quot;an attitude-type characterized by concentration of interest on the external object&quot;</p>','0',1,'2020-09-09 19:52:32','2020-09-09 19:53:03'),(796,'<p>Which one of the following is not a Projective Test of Personality?</p>','<p><strong>Projective test</strong>, in&nbsp;psychology, examination that commonly employs&nbsp;ambiguous&nbsp;stimuli, notably inkblots (Rorschach Test) and&nbsp;enigmatic&nbsp;pictures (Thematic Apperception Test), to evoke responses that may reveal facets of the subject&rsquo;s&nbsp;personality&nbsp;by projection of internal attitudes, traits, and behaviour patterns upon the external stimuli. Projective tests are also used, less frequently, to study learning processes. Other projective methods involve requiring subjects to build wooden block structures, complete sentences, paint with the fingers, or provide handwriting samples; additional methods include association tests in which spoken words serve as the stimuli.</p>','0',1,'2020-09-09 19:53:25','2020-09-09 19:53:58'),(797,'<p>Whenthesubjectandtherespondentareoneandthesamepersonthenthetooliscalled:</p>','<p>A sociogram&nbsp;is a graphic representation of social links that a person has. It is a graph drawing that plots the structure of interpersonal relations in a group situation</p>','0',1,'2020-09-09 19:54:13','2020-09-09 19:54:42'),(798,'<p>Which of the following statements is correct?</p>','<p>Mental health&nbsp;is regarded as a condition of the individual, relative to the capacities and social-environmental context of that person.&nbsp;Mental hygiene&nbsp;includes all measures taken to promote and to preserve&nbsp;mental health</p>','0',1,'2020-09-09 19:54:58','2020-09-09 19:55:44'),(799,'<p>A boy who is really interested in pursuing B.A. Philosophy but is afraid the subject does not have bright career prospects is having:</p>','<p><strong>There are different types of conflicts. Very common among them are:</strong></p>\r\n\r\n<p>a) Intrapersonal or Goal conflicts b) Interpersonal conflicts,</p>\r\n\r\n<p><em><strong><u>a. Intrapersonal conflicts:</u></strong></em></p>\r\n\r\n<p>These are the conflicts caused within the individual. <strong>This is called multiple approach-avoidance conflicts. These are as follows:</strong></p>\r\n\r\n<p>1. Approach-approach conflict:</p>\r\n\r\n<p>In this type of conflict, individuals will have two desires with positive valence which are equally powerful. For example, a person has two attractive job offers and he has to choose any one of the- tension arises.</p>\r\n\r\n<p>2. Avoidance-avoidance conflict:</p>\r\n\r\n<p>This conflict involves two goals with negative valence. At times the individual is forced to choose one among two negative goals. In such conflicts, both are unwanted goals, but he cannot keep quiet without opting also. For example, a woman must work at a job which she dislikes very much or else she has to remain unemployed.</p>\r\n\r\n<p>3. Approach-avoidance conflict:</p>\r\n\r\n<p>This is also a most complex conflict and very difficult to resolve. Because in this type of conflict a person is both attracted and repelled by the same goal object. Here the goal object will have both positive and negative valences.</p>\r\n\r\n<p>4. Multiple-approach-avoidance conflict:</p>\r\n\r\n<p>Some of the situations in life we come across will involve both positive and negative valences of multiple nature. Suppose a woman is engaged to be married. The marriage to her has positive valences like-providing security to life and marrying a person whom she loves very much.</p>\r\n\r\n<h3><strong>5. Resolution of Conflicts:</strong></h3>\r\n\r\n<p>The conflicts may arise from frustrations, competing roles or goals having positive or negative valences. Some conflicts are of great danger to the mental health of the individual. Hence, it is necessary to resolve them as quickly as possible.</p>\r\n\r\n<p><em><strong><u>b. Interpersonal conflicts:</u></strong></em></p>\r\n\r\n<p>Interpersonal conflict is caused by individuals. This can be resolved through some strategies such as avoiding, smoothing, forcing, confronting, and compromising. Assertive behavior and I am ok, you are ok interpersonal orientation help to resolve such conflicts easily.</p>\r\n\r\n<h3><strong>1. Unconscious Conflict:</strong></h3>\r\n\r\n<p>The mental conflict below the level of conscious awareness is called unconscious conflict. The conflicts in the conscious level, when repressed, shift to the unconscious. Here the desires which cannot be satisfied at the conscious level are repressed to the unconscious level as a mechanism of escaping. Many of our wants raised by Id may not be socially acceptable. Such wants are objected by the Ego and the Superego. Hence these are repressed to the unconscious.</p>','0',1,'2020-09-09 19:55:57','2020-09-09 19:57:01'),(800,'<p>Match the following two lists in order to render them meaningful in terms of the psychology of growth and development and select the right answer from the given codes.&nbsp;<strong>Codes:&nbsp; (a) (b) &nbsp;(c) &nbsp;(d) </strong></p>',NULL,'2',1,'2020-09-09 19:57:36','2020-09-09 19:57:36'),(801,'<p>In improving classroom teaching-learning interactions, which of the following strategies is linked with the later adolescence stage of development?</p>',NULL,'0',1,'2020-09-09 19:59:13','2020-09-09 19:59:13'),(802,'<p>Who is an arch advocate of trait theory of personality?</p>','<p>In 1936, psychologist&nbsp;Gordon Allport&nbsp;found that one English-language dictionary alone contained more than 4,000 words describing&nbsp;different personality traits</p>','0',1,'2020-09-09 19:59:55','2020-09-09 20:00:30'),(803,'<p>A student is rebuked by his/her class teacher for negligence in studies. When he/she comes back to his/her home, he/she ill-treats the pets/toys etc. This is a case of</p>','<h3><strong>1. Denial:</strong></h3>\r\n\r\n<p>Denial is one of the most common defense mechanisms. It occurs when you refuse to accept reality or facts. You block external events or circumstances from your mind so that you don&rsquo;t have to deal with the emotional impact. In other words, you avoid the painful feelings or events.</p>\r\n\r\n<h3><strong>2. Repression:</strong></h3>\r\n\r\n<p>Unsavory thoughts, painful memories, or irrational beliefs can upset you. Instead of facing them, you may unconsciously choose to hide them in hopes of forgetting about them entirely.</p>\r\n\r\n<h3><strong>3. Projection:</strong></h3>\r\n\r\n<p>Some thoughts or feelings you have about another person may make you uncomfortable. If you&nbsp;project those feelings, you&rsquo;re misattributing them to the other person.</p>\r\n\r\n<p>For example, you may dislike your new co-worker, but instead of accepting that, you choose to tell yourself that they dislike you. You see in their actions the things you wish you could do or say.</p>\r\n\r\n<h3><strong>4. Displacement:</strong></h3>\r\n\r\n<p>You direct strong emotions and frustrations toward a person or object that doesn&rsquo;t feel threatening. This allows you to satisfy an impulse to react, but you don&rsquo;t risk significant consequences.</p>\r\n\r\n<p>A good example of this defense mechanism is&nbsp;getting angry at your child&nbsp;or spouse because you had a bad day at work. Neither of these people is the target of your strong emotions, but reacting to them is likely less problematic than reacting to your boss.</p>\r\n\r\n<h3><strong>5. Regression:</strong></h3>\r\n\r\n<p>Some people who feel threatened or anxious may unconsciously &ldquo;escape&rdquo; to an earlier stage of development.</p>\r\n\r\n<p>Adults can regress, too. Adults who are struggling to cope with events or behaviors may return to sleeping with a cherished stuffed animal, overeat foods they find comforting, or begin chain smoking or chewing on pencils or pens. They may also avoid everyday activities because they feel overwhelming.</p>\r\n\r\n<h3><strong>6. Rationalization:</strong></h3>\r\n\r\n<p>Some people may attempt to explain undesirable behaviors with their own set of &ldquo;facts.&rdquo; This allows you to feel comfortable with the choice you made, even if you know on another level it&rsquo;s not right.</p>\r\n\r\n<p>For example, people who might be angry at co-workers for not completing work on time could be ignoring the fact that they&rsquo;re typically late, too.</p>\r\n\r\n<h3><strong>7. Sublimation:</strong></h3>\r\n\r\n<p>This type of defense mechanism is considered a&nbsp;positive strategy. That&rsquo;s because people who rely on it choose to redirect strong emotions or feelings into an object or activity that is appropriate and safe.</p>\r\n\r\n<p>For example, instead of lashing out at your employees, you choose to channel your frustration into kickboxing or exercise. You could also funnel or redirect the feelings into music, art, or sports.</p>\r\n\r\n<h3><strong>8. Reaction formation:</strong></h3>\r\n\r\n<p>People who use this defense mechanism recognize how they feel, but they choose to behave in the opposite manner of their instincts.</p>\r\n\r\n<p>A person who reacts this way, for example, may feel they should not express negative emotions, such as anger or frustration. They choose to instead react in an overly positive way.</p>\r\n\r\n<h3><strong>9. Compartmentalization:</strong></h3>\r\n\r\n<p>Separating your life into independent sectors may feel like a way to protect many elements of it.</p>\r\n\r\n<p>For example, when you choose to not discuss personal life issues at work, you block off, or compartmentalize, that element of your life. This allows you to carry on without facing the anxieties or challenges while you&rsquo;re in that setting or mindset.</p>\r\n\r\n<h3><strong>10. Intellectualization:</strong></h3>\r\n\r\n<p>When you&rsquo;re hit with a trying situation, you may choose to remove all emotion from your responses and instead focus on quantitative facts. You may see this strategy in use when a person who is let go from a job choose to spend their days creating spreadsheets of job opportunities and leads.</p>','0',1,'2020-09-09 20:00:56','2020-09-09 20:01:30'),(804,'<p>Which of the following is intimately associated with mental health?</p>','<p>Mental health&nbsp;is the level of&nbsp;psychological&nbsp;well-being&nbsp;or an absence of&nbsp;mental illness. It is the state of someone who is &quot;functioning at a satisfactory level of&nbsp;emotional&nbsp;and behavioral adjustment&quot;. From the perspectives of&nbsp;positive psychology&nbsp;or of&nbsp;holism, mental health may include an individual&#39;s ability to enjoy&nbsp;life&nbsp;and to create a balance between life activities and efforts to achieve&nbsp;psychological resilience.&nbsp;According to the&nbsp;World Health Organization&nbsp;(WHO), mental health includes &quot;subjective well-being, perceived self-efficacy, autonomy, competence, inter-generational dependence, and self-actualization of one&#39;s intellectual and emotional potential, among others&quot;. The WHO further states that the well-being of an individual is encompassed in the realization of their abilities, coping with normal stresses of life, productive work, and contribution to their&nbsp;community. Cultural differences, subjective assessments, and competing professional theories all affect how one defines &quot;mental health&quot;.</p>\r\n\r\n<p>&nbsp;</p>','0',1,'2020-09-09 20:01:45','2020-09-09 20:02:18'),(805,'<p>Match the two sets: Set &ndash; I which indicates stages of development and Set - II which details the characteristics associated with them. Select the correct code to provide your answer.&nbsp;<strong>Codes:(a) (b)&nbsp;(c)&nbsp;(d)</strong></p>','<ol>\r\n	<li><strong>The Sensorimotor Stage:</strong></li>\r\n</ol>\r\n\r\n<h3><strong><strong>Ages: Birth to 2 Years</strong></strong></h3>\r\n\r\n<ul>\r\n	<li>The infant knows the world through their movements and sensations</li>\r\n	<li>Children learn about the world through basic actions such as sucking, grasping, looking, and listening</li>\r\n	<li>Infants learn that things continue to exist even though they cannot be seen (object permanence)</li>\r\n	<li>They are separate beings from the people and objects around them</li>\r\n	<li>They realize that their actions can cause things to happen in the world around them</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><strong>The Preoperational Stage</strong></li>\r\n</ol>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ages: 2 to 7 Years</strong></p>\r\n\r\n<ul>\r\n	<li>Children begin to think symbolically and learn to use words and pictures to represent objects.</li>\r\n	<li>Children at this stage tend to be egocentric and struggle to see things from the perspective of others.</li>\r\n	<li>While they are getting better with language and thinking, they still tend to think about things in very concrete terms.</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><strong>The Concrete Operational Stage</strong></li>\r\n</ol>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp; Ages: 7 to 11 Years</strong></p>\r\n\r\n<ul>\r\n	<li>During this stage, children begin to thinking logically about concrete events</li>\r\n	<li>They begin to understand the concept of conservation; that the amount of liquid in a short, wide cup is equal to that in a tall, skinny glass, for example</li>\r\n	<li>Their thinking becomes more logical and organized, but still very concrete</li>\r\n	<li>Children begin using inductive logic, or reasoning from specific information to a general principle</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><strong>The Formal Operational Stage</strong></li>\r\n</ol>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp; Ages: 12 and Up</strong></p>\r\n\r\n<ul>\r\n	<li>At this stage, the adolescent or young adult begins to think abstractly and reason about hypothetical problems</li>\r\n	<li>Abstract thought emerges</li>\r\n	<li>Teens begin to think more about moral, philosophical, ethical, social, and political issues that require theoretical and abstract reasoning</li>\r\n	<li>Begin to use deductive logic, or reasoning from a general principle to specific information</li>\r\n</ul>','2',1,'2020-09-09 20:04:26','2020-09-09 20:06:36'),(806,'<p>Which of the following features belongs to intellectual development during adolescence stage?</p>','<p>Adolescence (10-19 years) is a phase of life which has recently gained recognition as a distinct phase of life with its own special needs. This phase is characterized by acceleration of physical growth and, psychological and behavioral changes thus bringing about transformation from childhood to adulthood.</p>\r\n\r\n<p>Adolescence has been described as the transition period in life when an individual is no longer a child, but not yet an adult. It is a period in which an individual undergoes enormous physical and psychological changes. In addition, the adolescent experiences changes in social expectations and perceptions. Physical growth and development are accompanied by sexual maturation, often leading to intimate relationships. The individual&rsquo;s capacity for abstract and critical thought also develops, along with a sense of self-awareness when social expectations require emotional maturity.</p>\r\n\r\n<ul>\r\n	<li>Searching for identity, influenced by gender, peer group, cultural background and family expectations</li>\r\n	<li>Seeking more independence.</li>\r\n</ul>\r\n\r\n<p>Seeking more responsibility, both at home and at school</p>\r\n\r\n<ul>\r\n	<li>Looking for new experiences. May engage in more risk-taking behavior.</li>\r\n	<li>Thinking more about &#39;right&#39; and &#39;wrong&#39;.</li>\r\n	<li>Influenced more by friends&#39; behavior- sense of self and self-esteem</li>\r\n	<li>Starting to develop and explore a sexual identity</li>\r\n	<li>Communicating in different ways. Communication with peers through internet, mobile phones and social media</li>\r\n</ul>','0',1,'2020-09-09 20:07:15','2020-09-09 20:07:53'),(807,'<p>Who advanced the concept of &lsquo;creative self&rsquo; as the most essential aspect of one&rsquo;s personality?</p>','<p>Adler called his theory Individual&nbsp;Psychology&nbsp;because he believed that people were unique and that no theory created before his applied to all people. He originally followed Sigmund Freud&#39;s teachings but left after a disagreement of Freud&#39;s theory which says that the drive of human behavior is sex</p>','0',1,'2020-09-09 20:08:16','2020-09-09 20:08:46'),(808,'<p>&lsquo;Defense Mechanisms&rsquo; are used by an individual</p>','<p>Defense mechanisms operate at an unconscious level and help ward off unpleasant feelings (i.e., anxiety) or make good things feel better for the individual.</p>\r\n\r\n<p>Ego-defense mechanisms are natural and normal.&nbsp; When they get out of proportion (i.e., used with frequency), neuroses develop, such as anxiety states, phobias, obsessions, or hysteria.</p>','0',1,'2020-09-09 20:08:58','2020-09-09 20:09:28'),(809,'<p>Which of the following characteristics is not true of divergent thinking?</p>','<p>Divergent thinking is a thought process or method used to generate creative ideas by exploring many possible solutions. It typically occurs in a spontaneous, free-flowing, &quot;non-linear&quot; manner, such that many ideas are generated in an emergent cognitive fashion.</p>','0',1,'2020-09-09 20:09:41','2020-09-09 20:10:10'),(810,'<p>Structure of Intellect (SI model) is evolved by</p>','<p>Structure of Intellect&nbsp;theory. ...&nbsp;SI&nbsp;theory comprises up to 180 different intellectual abilities organized along three dimensions: operations, content, and products. The Structure of Intellect&nbsp;Theory advanced by Guilford was applied by Mary N. Meeker for educational purposes.</p>\r\n\r\n<ul>\r\n	<li>Works written:&nbsp;Psychometric methods, Structure...</li>\r\n	<li>Born:&nbsp;March 7, 1897</li>\r\n	<li>Profession:&nbsp;Psychologist</li>\r\n	<li>Nationality:&nbsp;United States</li>\r\n</ul>','0',1,'2020-09-09 20:10:25','2020-09-09 20:11:09'),(811,'<p>While measuring intelligence which tests assume that upto a certain chronological age intelligence reaches a peak?</p>','<p>Non&nbsp;&ndash;&nbsp;Verbal&nbsp;Reasoning is problem-solving using pictures and diagrams. It&nbsp;tests&nbsp;the ability to analyses visual information and solve problems based on visual reasoning. ...Verbal&nbsp;Reasoning requires children to problem solve using words and letters</p>','0',1,'2020-09-10 16:46:49','2020-09-10 16:47:29'),(812,'<p>Synectic&rsquo;s is the method for dealing with&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>','<p>Synectic&rsquo;s is one of the creative problem-solving techniques. It emphasizes metaphor, imagery, emotion, energy, and procedural approaches that focus on private listings. Like brainstorming, Synectic&rsquo;s suspends judgment; while Synectic&rsquo;s widens and deepens the process of suspending judgment in more different ways than brainstorming does. Some characteristics are introduced below</p>','0',1,'2020-09-10 16:47:47','2020-09-10 16:48:20'),(813,'<p>By arranging following concepts of intelligence in the order in which they appeared, select the correct code:</p>',NULL,'1',1,'2020-09-10 16:48:36','2020-09-10 16:48:36'),(814,'<p>Identify the correct statement:</p>','<p>Concept formation is a type of discovery learning involving psychological processes such as analysis, hypothesis, generation and testing and generalization. Children usually learn concepts through concept formation method</p>','0',1,'2020-09-10 16:50:00','2020-09-10 16:50:36'),(815,'<p>The stage of manifest inactivity in creative thinking process is called</p>',NULL,'0',1,'2020-09-10 16:50:56','2020-09-10 16:50:56'),(816,'<p>In Advance organizer model, what is the focus?</p>','<p>As Ausubel and Robinson (1969:50) point out, a primary assumption which is central to the theory is that the most important factor influencing learning is the quantity, clarity and organization of the learner&#39;s present knowledge. This present knowledge, they assert, which consists of the facts, concepts, propositions, theories and raw perceptual data that the learner has available to him/her at any point in time, is referred to as his/her cognitive structure. The second important focus of Ausubel&#39;s theory is the nature of the material to be learned. According to Ausubel (1963), as Joyce and Wei: (1986:72) point out, whether material is meaningful depends on the learner and the material, not the method of presentation - another widely held belief.</p>','0',1,'2020-09-10 16:51:42','2020-09-10 16:52:20'),(817,'<p>Which concept of intelligence addresses the problem of meaning and value?</p>','<p>Cultural intelligence&nbsp;is the ability that individuals have to interact effectively acrosscultural&nbsp;contexts and with&nbsp;culturally&nbsp;different individuals. It is theorized to consist of three facets of&nbsp;cultural&nbsp;knowledge, cross-cultural&nbsp;skills, and&nbsp;cultural&nbsp;metacognition that reflect the higher-level latent factor</p>','0',1,'2020-09-10 16:52:36','2020-09-10 16:53:14'),(818,'<p>Development of creative thinking begins at what stage?</p>','<p>Childhood&nbsp;is the age span ranging from birth to&nbsp;puberty.&nbsp;It may also include&nbsp;adolescence, but precedes&nbsp;adulthood&nbsp;regardless. According to&nbsp;Piaget&#39;s theory of cognitive development, childhood consists of two stages: preoperational stage and concrete operational stage. In&nbsp;developmental psychology, childhood is divided up into the developmental stages of&nbsp;early childhood&nbsp;(preschool age), middle childhood (school age), and adolescence (puberty to legal adulthood). Various childhood factors could affect a person&#39;s attitude formation. The concept of childhood emerged during the 17th and 18th centuries, particularly through the educational theories of the philosopher&nbsp;John Locke&nbsp;and the growth of books for and about children. Previous to this point; children were often seen as incomplete versions of adults</p>','0',1,'2020-09-10 16:53:29','2020-09-10 16:54:03'),(819,'<p>Educational performance of a student is a function of</p>',NULL,'0',1,'2020-09-10 16:54:20','2020-09-10 16:54:20'),(820,'<p>The problem-solving ability depends up on the</p>',NULL,'0',1,'2020-09-10 16:55:04','2020-09-10 16:55:04'),(821,'<p>Which of the following intelligence does not stop increasing with age of a person?</p>','<p>Spatial intelligence, or visuo-spatial&nbsp;ability, has been defined &quot;the ability to generate, retain, retrieve, and transform well-structured visual images&quot; (Lohman 1996). It&#39;s what we do when we visualize shapes in our &quot;mind&#39;s eye.&quot; It&#39;s the mental feat that architects and engineers perform when they design buildings</p>','0',1,'2020-09-10 16:55:53','2020-09-10 16:56:25'),(822,'<p>In Emotional Intelligence which will not be considered a component?</p>','<p>Emotional intelligence&nbsp;has been defined, by Peter Salovey and John Mayer, as &quot;the ability to monitor one&#39;s own and other people&#39;s&nbsp;emotions, to discriminate between different&nbsp;emotions&nbsp;and label them appropriately, and to use&nbsp;emotional&nbsp;information to guide thinking and behavior&quot;.</p>','0',1,'2020-09-10 16:56:42','2020-09-10 16:57:12'),(823,'<p>Assertion (A): All gifted children are creative also. Reasoning (R): Creativity is not necessarily related to giftedness. Which of the following options is correct?</p>','<p>Students with gifts and talents perform&mdash;or have the capability to perform&mdash;at higher levels compared to others of the same age, experience, and environment in one or more domains. They require modification(s) to their educational experience(s) to learn and realize their potential. Student with gifts and talents:</p>\r\n\r\n<p>Come from all racial, ethnic, and cultural populations, as well as all economic strata.</p>\r\n\r\n<p>Require sufficient access to appropriate learning opportunities to realize their potential.</p>\r\n\r\n<p>Can have learning and processing disorders that require specialized intervention and accommodation.</p>\r\n\r\n<p>Need support and guidance to develop socially and emotionally as well as in their areas of talent.</p>','0',1,'2020-09-10 16:57:28','2020-09-10 16:58:05'),(824,'<p>In explaining the development of &lsquo;problem solving&rsquo; capability which of the combination is most appropriate?</p>',NULL,'0',1,'2020-09-10 17:20:44','2020-09-10 17:20:44'),(825,'<p>The concept of functional autonomy of motives was advanced by</p>','<p>Allport pioneered research on human personality. At a time when behaviorism held sway in psychology departments in the U.S., and psychoanalytic approaches dominated elsewhere, Allport championed an empirical methodology that considered the influences of current context and conscious motivations, without dismissing the possible contribution of unconscious memories and/or mechanisms to human thought and behavior</p>','0',1,'2020-09-10 17:22:01','2020-09-10 17:22:45'),(826,'<p>In the list given below a few theories of intelligence have been indicated. What is the correct sequence of their historic formulation? Give your answer by selecting the appropriate alternative from the code.</p>\r\n\r\n<p><strong>List:</strong></p>\r\n\r\n<p>Burt&rsquo;s group factor theory, Spearman&rsquo;s two factor theory, Guilford&rsquo;s Structure of intellect, Daniel Goleman&rsquo;s theory of Emotional intelligence, Zohar and Marshall&rsquo;s theory of spiritual intelligence</p>',NULL,'0',1,'2020-09-10 17:23:04','2020-09-10 17:23:04'),(827,'<p>For the concept of Emotional Intelligence which theory of intelligence is considered to be the fore-runner?</p>',NULL,'0',1,'2020-09-10 17:23:53','2020-09-10 17:23:53'),(828,'<p>Creativeness and originality are processes of arranging well known facts and principles in new relationships so that whatever is intended may be achieved more effectively. In other words, this means:</p>',NULL,'0',1,'2020-09-10 17:24:41','2020-09-10 17:24:41'),(829,'<p>Choose the appropriate sequence of steps involved in problem solving:</p>\r\n\r\n<p><strong>Codes: </strong></p>','<p>Step 1:&nbsp;Define the Problem</p>\r\n\r\n<ul>\r\n	<li>What is the problem?</li>\r\n	<li>How did you discover the problem?</li>\r\n	<li>When did the problem start and how long has this problem been going on?</li>\r\n	<li>Is there enough data available to contain the problem and prevent it from getting&nbsp;passed to the next process step? If yes, contain the problem.</li>\r\n</ul>\r\n\r\n<p>Step 2: Clarify the Problem</p>\r\n\r\n<ul>\r\n	<li>What data is available or needed to help clarify, or fully understand the problem?</li>\r\n	<li>Is it a top priority to resolve the problem at this point in time?</li>\r\n	<li>Are additional resources required to clarify the problem? If yes, elevate the&nbsp;problem to your leader to help locate the right resources and form a team.&nbsp;</li>\r\n</ul>\r\n\r\n<p>Step 3: Define the Goals</p>\r\n\r\n<ul>\r\n	<li>What is your end goal or desired future state?</li>\r\n	<li>What will you accomplish if you fix this problem?</li>\r\n	<li>What is the desired timeline for solving this problem?</li>\r\n</ul>\r\n\r\n<p>Step 4: Identify Root Cause of the Problem</p>\r\n\r\n<ul>\r\n	<li>Identify possible causes of the problem.</li>\r\n	<li>Prioritize possible root causes of the problem.</li>\r\n	<li>What information or data is there to validate the root cause?</li>\r\n</ul>\r\n\r\n<p>Step 5: Develop Action Plan</p>\r\n\r\n<ul>\r\n	<li>Generate a list of actions required to address the root cause and prevent problem&nbsp;from getting to others.</li>\r\n	<li>Assign an owner and timeline to each action.</li>\r\n	<li>Status actions to ensure completion.</li>\r\n</ul>\r\n\r\n<p>Step 6:&nbsp;Execute Action Plan</p>\r\n\r\n<ul>\r\n	<li>Implement action plan to address the root cause.</li>\r\n	<li>Verify actions are completed.</li>\r\n</ul>\r\n\r\n<p>Step 7:&nbsp;Evaluate the Results</p>\r\n\r\n<ul>\r\n	<li>Monitor and Collect Data.</li>\r\n	<li>Did you meet your goals defined in step 3? If not, repeate th 8-Step Process.&nbsp;</li>\r\n	<li>Were there any unforeseen consequences?</li>\r\n	<li>If problem is resolved, remove activities that were added previously to contain the problem.</li>\r\n</ul>\r\n\r\n<p>Step 8:&nbsp;Continuously Improve</p>\r\n\r\n<ul>\r\n	<li>Look for additional opportunities to implement solution.</li>\r\n	<li>Ensure problem will not come back and communicate lessons learned.</li>\r\n	<li>If needed, repeat the 8-Step Problem Solving Process to drive further improvements.</li>\r\n</ul>','1',1,'2020-09-10 17:25:37','2020-09-10 17:27:18'),(830,'<p>A trainer so designs the training procedure that in the presence of cue, negative reinforcement is made contingent on making of a response by the trainee. The operant conditioning procedure so used is called by the name of:</p>','<p>punishment&nbsp;is any change in a human or animal&#39;s surroundings which, occurring after a given behavior or response, reduces the likelihood of that behavior occurring again in the future. As with&nbsp;reinforcement, it is the&nbsp;behavior, not the human/animal, that is punished. Whether a change is or is not punishing is determined by its effect on the rate that the behavior occurs, not by any &quot;hostile&quot; or&nbsp;aversive&nbsp;features of the change. For example, a painful stimulus which would act as a punisher for most people may actually reinforce some behaviors of&nbsp;masochistic individuals</p>','0',1,'2020-09-10 17:27:32','2020-09-10 17:28:14'),(831,'<p>Below are given a few items needed as a support to guidance personnel&rsquo;s. Which of them is scarce in Indian context?</p>\r\n\r\n<p>&nbsp;Select your answers from the code:</p>','<p>The basis for guidance lies in good human relationships. A school student is constantly in a state of interaction with his/her peers, the school staff, members of his/her family and community. These personalities all have an important impact on the life of the student. Most human beings are dependent on other human beings at times throughout life for advice, consultation or support in facing difficult decisions</p>','1',1,'2020-09-10 17:28:37','2020-09-10 17:29:58'),(832,'<p>A high school student soon after passing the examination intends to choose subjects for future professional placement. Which of the following will be useful in this regard?</p>','<p>The school students need guidance since they are still in the formative years in all the aspects of their personality. He/she is developing physically, intellectually and emotionally into what our culture intends, a well-adjusted member of society. Thus, one of the deep underlying reasons for adequate and well-trained personnel in guidance is basically the dependence of the young upon the adult. Another reason for maintaining guidance personnel in the schools arises out of the growth and development of a high degree of complexity in almost all aspects of social, professional, vocational and educational life</p>','0',1,'2020-09-10 17:30:32','2020-09-10 17:31:08'),(833,'<p>Latent learning is a concept enunciated by</p>','<p>Latent learning&nbsp;is the&nbsp;subconscious&nbsp;retention of information without reinforcement or motivation. In latent learning, one changes behavior only when there is sufficient motivation later than when they subconsciously retained the information.</p>\r\n\r\n<p>Latent learning is a form of&nbsp;observational learning, which is when the observation of something, rather than experiencing something directly, can effect later behavior. Observational learning can be many things. A human observes a behavior, and later repeats that behavior at another time (not direct imitation) even though no one is rewarding them to do that behavior.</p>\r\n\r\n<p>In the&nbsp;social learning theory, humans observe others receiving rewards or punishments, which invokes feelings in the observer and motivates them to change their behavior</p>','0',1,'2020-09-10 17:31:24','2020-09-10 17:31:54'),(834,'<p>Punishment is a</p>','<p>Punishment&nbsp;is any change in a human or animal&#39;s surroundings which, occurring after a given behavior or response, reduces the likelihood of that behavior occurring again in the future. As with&nbsp;reinforcement, it is the&nbsp;behavior, not the human/animal, that is punished. Whether a change is or is not punishing is determined by its effect on the rate that the behavior occurs, not by any &quot;hostile&quot; or&nbsp;aversive&nbsp;features of the change. For example, a painful stimulus which would act as a punisher for most people may actually reinforce some behaviors of&nbsp;masochistic individuals</p>','0',1,'2020-09-10 17:32:08','2020-09-10 17:32:38'),(835,'<p>Assertion (A): Sometimes the school children become mischievous, explosive, rebellious or apathetic.</p>\r\n\r\n<p>&nbsp;Reason (R): It is because of the inappropriateness of work assigned or demands made.</p>\r\n\r\n<p><strong>Codes:</strong></p>',NULL,'0',1,'2020-09-10 17:32:59','2020-09-10 17:32:59'),(836,'<p>Constructivist learning is advocated by</p>','<p>Constructivism is a theory in education that recognizes the learners&#39; understanding and knowledge based on their own experiences prior to entering school. It is associated with various philosophical positions, particularly in epistemology as well as ontology, politics, and ethics</p>','0',1,'2020-09-10 17:33:44','2020-09-10 17:34:17'),(837,'<p>A student of class XII aspires to get &lsquo;A&rsquo; in his school final examination. Which of the following will best explain his/her motivation?</p>',NULL,'0',1,'2020-09-10 17:34:32','2020-09-10 17:34:32'),(838,'<p>Which of the following learning theories is intimately related to Thorndike&rsquo;s law of effect?</p>','<p>Operant conditioning is a method of learning that occurs through rewards and punishments for behavior. Through operant conditioning, an individual makes an association between a particular behavior and a consequence (Skinner, 1938).</p>\r\n\r\n<p>By the 1920s, John B. Watson had left academic psychology, and other&nbsp;behaviorists&nbsp;were becoming influential, proposing new forms of learning other than&nbsp;classical conditioning. Perhaps the most important of these was Burrhus Frederic Skinner. Although, for obvious reasons, he is more commonly known as B.F. Skinner</p>','0',1,'2020-09-10 17:35:21','2020-09-10 17:35:54'),(839,'<p>Which learning theory lays stress on emergent synthesis?</p>','<p>Field theory is a psychological theory which examines patterns of interaction between the individual and the total field, or environment. The concept first made its appearance in psychology with roots to the holistic perspective of Gestalt theories. It was developed by Kurt Lewin, a Gestalt psychologist, in the 1940s</p>','0',1,'2020-09-10 17:36:11','2020-09-10 17:36:40'),(840,'<p>In which of the following, the principle of differential reinforcement is used?</p>','<p>Shaping&nbsp;is the process of&nbsp;reinforcing&nbsp;successively closer and closer approximations to a desired terminal behavior. The shaping of behavior starts at an early age. For example, a child learns to pull itself up, to stand, to walk and to finally move about through reinforcement of slightly exceptional instances of behaviors. Walking doesn&#39;t necessarily come naturally to a child, but through subtle reinforcements of being able to reach a toy or move more independently, the child&#39;s behavior is shaped</p>','0',1,'2020-09-10 17:36:54','2020-09-10 17:37:28'),(841,'<p>Which schedule of reinforcement in operant conditioning is likely to produce steadiness in acquired behavior?</p>','<p>A schedule of reinforcement is basically a rule stating which instances of behavior will be reinforced. In some cases, a behavior might be reinforced every time it occurs. Sometimes, a behavior might not be reinforced at all</p>','0',1,'2020-09-10 17:37:49','2020-09-10 17:38:57'),(842,'<p>The progress of a nation mostly depends on the</p>',NULL,'0',1,'2020-09-10 17:39:15','2020-09-10 17:39:15'),(843,'<p>Gestalt psychologists explain transfer of learning in terms of</p>','<p>The phenomenon of&nbsp;transposition, first studied in chicks by the Gestalt psychologist Wolfgang K&ouml;hler, suggests that animals may solve even simple discriminations in ways more complex than the experimenter had imagined</p>','0',1,'2020-09-10 17:40:08','2020-09-10 17:40:40'),(844,'<p>What is not a factor for influencing learning?</p>',NULL,'0',1,'2020-09-10 17:40:56','2020-09-10 17:40:56'),(845,'<p>In Gagne&rsquo;s hierarchy, the assumption is that</p>',NULL,'0',1,'2020-09-10 17:41:35','2020-09-10 17:41:35'),(846,'<p>In the study of personality which sequence is most appropriate:</p>','<p>Personality trait&gt;Personality type&gt;Psychoanalytic</p>','0',1,'2020-09-10 17:42:23','2020-09-10 17:43:00'),(847,'<p>In the context of social development which of the following stages is characterized by &lsquo;Intense self-Awareness&rsquo;?</p>',NULL,'0',1,'2020-09-10 17:43:16','2020-09-10 17:43:16'),(848,'<p>Which of the following subordinate laws of learning developed by Thorndike is related to classical conditioning of Pavlov?</p>','<p>Thorndike&rsquo;s Law of Associative Shifting is similar to conditioning. Responses learned to one stimulus condition may be learned to another stimulus condition, if the overall situation is not altered. Pavlovian conditioning principle is similar to associative shifting. In Pavlovian conditioning, the dog that salivates in the presence of food learns gradually to salivate in the presence of bell. This is associative shifting</p>','0',1,'2020-09-10 17:43:53','2020-09-10 17:44:28'),(850,'<p>Which of the following list reflects the basis for Tolman&rsquo;s sign gestalt learning?</p>\r\n\r\n<p>Select from the code:</p>','<p>Tolman&rsquo;s version of behaviorism emphasized the relationships between stimuli rather than stimulus-response (Tolman, 1922). According to Tolman, a new stimulus (the sign) becomes associated with already meaningful stimuli (the significate) through a series of pairings; there was no need for reinforcement in order to establish learning. For this reason, Tolman&rsquo;s theory was closer to the&nbsp;connectionist framework&nbsp;of Thorndike than the drive reduction theory of&nbsp;drive reduction&nbsp;theory of Hull or other behaviorists</p>','1',1,'2020-09-10 17:45:29','2020-09-10 17:46:44'),(851,'<p>In which of the following teaching-learning presentations, shaping of a response is called for?</p>',NULL,'0',1,'2020-09-10 17:46:57','2020-09-10 17:46:57'),(852,'<p>In Skinner&rsquo;s view secondary reinforces are derived when associated with</p>','<p>In&nbsp;negative reinforcement, the&nbsp;stimulus&nbsp;removed following a response is an aversive stimulus; if this&nbsp;stimulus&nbsp;were presented contingent on a response, it may also function as a positive punisher. The form of a&nbsp;stimulus&nbsp;is separate from its function in terms of whether it will reinforce or punish behavior</p>','0',1,'2020-09-10 17:47:45','2020-09-10 17:48:13'),(853,'<p>Which of the areas individual difference is most important for organizing educational programmers effectively?</p>',NULL,'0',1,'2020-09-10 17:48:29','2020-09-10 17:48:29'),(854,'<p>à¦šà¦°à§à¦¯à¦¾à¦ªà¦¦à§‡à¦° à¦ªà§à¦°à¦¥à¦® à¦ªà¦¦à¦Ÿà¦¿ à¦°à¦šà§Ÿà¦¿à¦¤à¦¾ à¦¹à¦²à§‡à¦¨-</p>',N