INSERT INTO `mock_question_options` VALUES (291,33,'a','<p>Verbal communication can stimulate ideas</p>',NULL,NULL,'2020-08-29 14:03:39','2020-08-29 14:03:39'),(292,33,'b','<p>Communication is leant ability</p>',NULL,NULL,'2020-08-29 14:03:39','2020-08-29 14:03:39'),(293,33,'c','<p>Communication is a universal process</p>',NULL,NULL,'2020-08-29 14:03:39','2020-08-29 14:03:39'),(294,33,'d','<p>Communication cannot break down</p>',NULL,NULL,'2020-08-29 14:03:39','2020-08-29 14:03:39'),(295,33,'e','<p>More communication means more effective learning by students</p>',NULL,NULL,'2020-08-29 14:03:39','2020-08-29 14:03:39'),(296,33,'f','<p>Value of what is learnt through classroom communication is not an issue of students</p>',NULL,NULL,'2020-08-29 14:03:39','2020-08-29 14:03:39'),(297,39,'1','<p>National Education Policy 2020 is the second education policy approved by the Govt. of India after independence.</p>',NULL,NULL,'2020-08-29 14:18:26','2020-08-29 14:18:26'),(298,39,'2','<p>The National Education Policy has been headed by K. Kasturirangan.</p>',NULL,NULL,'2020-08-29 14:18:26','2020-08-29 14:18:26'),(299,39,'3','<p>Education is the concurrent subject and both the central and state govt. can make policy on it.</p>',NULL,NULL,'2020-08-29 14:18:26','2020-08-29 14:18:26'),(300,41,'1','<p>Urban Heat Island (UHI) is an urban area that is significantly warmer than its rural surrounding due to human activities.</p>',NULL,NULL,'2020-08-29 14:23:20','2020-08-29 14:23:20'),(301,41,'2','<p>The effect of Urban Heat Island is more severe in the day time rather than at night.</p>',NULL,NULL,'2020-08-29 14:23:20','2020-08-29 14:23:20'),(302,41,'3','<p>The UHI decreases air quality by increasing the production of pollutants such as Ozone and the decreased water quality.</p>',NULL,NULL,'2020-08-29 14:23:20','2020-08-29 14:23:20'),(303,42,'1','<p>Burning of crop residue</p>',NULL,NULL,'2020-08-29 14:25:15','2020-08-29 14:25:15'),(304,42,'2','<p>Agricultural soils</p>',NULL,NULL,'2020-