INSERT INTO `products` VALUES (102,'NET-Leader-Bengali',NULL,'<ul>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Unit wise separate text in pdf version;</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">The Solution of previous years questions with proper references or explanation;</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">1000 model MCQs with answers and proper references or explanation;</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">500 key points for Last Minute Suggestion (available from 15.10.2020);</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Online MOCK test facility (available from 15.10.2020);</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Daily updates till last night before the exam;</span></span></li>\r\n</ul>','<p><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">In this individual pack for Bengali (Paper-II), we provide comprehensive study material, online mock tests, question paper analysis with solutions, and last-minute suggestions. This pack offers everything you need to score high in your Bengali paper in the upcoming NET/SET/JRF June 2020 exam.</span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">This highly innovative course is designed by our expert and well-qualified faculties. It ensures the aspirants to qualify NET/SET covering entire syllabus&nbsp;by minimum effort.</span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Course includes:</span></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Individualize instructional model&nbsp;</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">The scientific and systematic study material&nbsp;</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Blend of experience with technology</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">in-depth analysis of previous year questions</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Unique study material</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Model question paper</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Full-time faculty support</span></span></li>\r\n</ul>','<ul>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Exam-oriented study material developed by seasoned teachers and tutors</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">In-depth analysis of previous year question papers</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Chapter-wise categorization of MCQs</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">1000 original and unique model questions</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Full-length online mock test sessions for self-assessment</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Classification of the entire syllabus into key points (standard and advance)</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Last-minute suggestions</span></span></li>\r\n</ul>','<p><span style=\"font-size:18px\"><span style=\"font-family:times new roman,times,serif\">This course will valid till 30.06.2021</span></span></p>',13000.00,6500.00,50,NULL,'2020-02-20','2021-06-30',0,0,0,'5f2cda75c6c65.jpg',1,1,0,1,'bengali-study-material','bengali-study-material,sample-questions,notes-2020','UGC NET/SET/JRF Bengali Study Material, Previous Years Solved Papers, Sample Questions, Notes 2020','Study Material & Previous Years Solved Papers For UGC NTA NET/SET/JRF Bengali',NULL,'Get unique UGC NTA-NET/SET/JRF Bengali study material, model question paper, previous year question paper analysis, and more at Teachinns. Enroll Now!','2020-02-20 12:54:57','2020-12-04 18:22:05'),(103,'NET-Leader Sanskrit',NULL,'<ul>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Unit wise separate text in pdf version;</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">The Solution of previous years questions with proper references or explanation;</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">1000 model MCQs with answers and proper references or explanation;</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">500 key points for Last Minute Suggestion (available from 15.10.2020);</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Online MOCK test facility (available from 15.10.2020);</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Daily updates till last night before the exam;</span></span></li>\r\n</ul>','<p><span style=\"font-size:1