INSERT INTO `question_masters` VALUES (10,'Look at this series: 2, 1, (1/2), (1/4), ... What number should come next?','This is a simple division series; each number is one-half of the previous number.\r\n\r\nIn other terms to say, the number is divided by 2 successively to get the next result.\r\n\r\n4/2 = 2\r\n2/2 = 1\r\n1/2 = 1/2\r\n(1/2)/2 = 1/4\r\n(1/4)/2 = 1/8 and so on.',2,1,'2020-03-24 11:18:24','2020-03-24 11:18:24'),(11,'Who will lead the COVID-19 Economic Response Task Force announced by Prime Minister Narendra Modi?',NULL,2,1,'2020-03-24 13:26:48','2020-03-24 13:26:48'),(12,'Which Bank has launched an emergency loan facility for its existing loan customers whose business has been hit due to Coronavirus 2019 (COVID 19)?','State Bank of India has launched an emergency loan facility for its existing loan customers whose business has been hit due to Coronavirus 2019 (COVID 19).',2,1,'2020-03-24 13:28:07','2020-03-24 13:28:07'),(13,'The World Water Day is celebrated on which of the following dates?','The World Water Day is celebrated on 22 March every year to raise awareness about the vital importance of water to safeguarding human security and maintaining the health of the planet\'s ecosystems.',2,1,'2020-03-24 13:29:15','2020-03-24 13:29:15'),(14,'Which intitute has launched a 30- days long capacity-building program called \"Tech for Tribal\"?','A 30- days long capacity-building program called \"Tech for Tribal\" has been launched by the Tribal Cooperative Marketing Development Federation of India (TRIFED),which works under Ministry of Tribal Affairs.',2,1,'2020-03-24 13:30:25','2020-03-24 13:30:25'),(15,'What is the rank of India in 8th World Happiness Report 2020?','On March 21, 2020 the United Nations (UN) released the 8th World Happiness Report 2020 to measure the happiness of people of 156 countries where India(3.573) ranks in 144th position & Finland(7.809) tops the 3rd time',2,1,'2020-03-24 13:32:19','2020-03-24 13:32:19'),(16,'Kenny Rogers, has passed away at the age of 81. He was a noted person of which field?','Noted American singer-songwriter and Country music icon, Kenny Rogers, has passed away. He was 81.Rogers was a three-time Grammy winner, six-time Country Music Awards winner and a member of the Country Music Hall of Fame.',2,1,'2020-03-24 13:33:36','2020-03-24 13:33:36'),(17,'Which two countries have pledge to contribute USD 1 million and USD 200,000 respectively to the SAARC Corona Emergency Fund proposed by PM Modi?','Afghanistan and Maldives pledge to contribute USD 1 million and USD 200,000 respectively to the SAARC Corona Emergency Fund proposed by PM Modi.',2,1,'2020-03-24 13:35:14','2020-03-24 13:35:14'),(18,'The International Day for the Elimination of Racial Discrimination is observed globally on which date?','The International Day for the Elimination of Racial Discrimination is observed globally on 21 March every year. The day is celebrated annually on 21 March as on this day in 1960, the police in Sharpeville, South Africa, opened fire and killed 69 people at a peaceful demonstration against apartheid \"pass laws\"',2,1,'2020-03-24 13:36:35','2020-03-24 13:36:35'),(19,'Which country has confirmed as the co-chair of the governing council of India-led global Coalition for Disaster Resilient Infrastructure (CDRI)?','UK confirmed as co-chair of the governing council of India-led global Coalition for Disaster Resilient Infrastructure (CDRI)',2,1,'2020-03-24 13:38:17','2020-03-24 13:38:17'),(20,'Which of the following bank has teamed-up with Bharti AXA to launch a complimentary insurance plan which will cover all medical conditions, including Covid-19?','DBS Bank India has teamed-up with Bharti AXA to launch a complimentary insurance plan which will cover all medical conditions, including Covid-19.',2,1,'2020-03-24 13:39:23','2020-03-24 13:39:23'),(21,'What is the name of the bird whose fossil have been discovered recently and is world\'s oldest known modern bird skull?','Wonderchicken\': oldest fossil of modern bird discovered. On March 18, 2020, Scientists at the University of Cambridge in the United Kingdom (UK) have discovered a fossil of the world\'s oldest known modern bird skull dating to about 66.8m - 66.7m years ago- means the birds lived alongside dinosaurs for around a million years before the latter died out.',2,1,'2020-03-24 13:40:33','2020-03-24 13:40:33'),(22,'What is the name of pre-paid card launched by Karur Vysya Bank ?','Karur Vysya Bank launches pre-paid card Enkasu in Tamil Nadu.',2,1,'2020-03-24 13:41:49','2020-03-24 13:41:49'),(23,'Which state has announced to provide one-month free food grains to poor people along with Rs 1,000 as compensation to daily wage workers who have been affected due to the outbreak of the deadly virus?','Uttar Pradesh govt announced several actions and measures in its fight against coronavirus. Chief Minister Yogi Adityanath announced to provide one-month free food grains to poor people along with Rs 1,000 as compensation to daily wage workers who have been affected due to the outbreak of the deadly virus.',2,1,'2020-03-24 13:42:50','2020-03-24 13:42:50'),(24,'What is the number of women matches officials across different International Cricket Council panels?','The number of women matches officials across different International Cricket Council panels has gone up to 12 as Janani Narayanan, and Vrinda Rathi of India was named in the International Panel of ICC Development Umpires.',2,1,'2020-03-24 13:43:46','2020-03-24 13:43:46'),(25,'Reserve bank of India extended the regulatory restrictions on Punjab and Maharashtra Cooperative Bank (PMC) Bank by how much time?','Reserve bank of India extended the regulatory restrictions on Punjab and Maharashtra Cooperative Bank (PMC) Bank by another three months. The validity of the directive dated 23 September 2019, stands modified from 23 March 2020 to 22 June 2020.',2,1,'2020-03-24 13:44:57','2020-03-24 13:44:57');
